insert  into `t_admin`(`uid`,`user_name`,`pass_word`,`gender`,`avatar`,`email`,`birthday`,`mobile`,`valid_code`,`summary`,`login_count`,`last_login_time`,`last_login_ip`,`status`,`create_time`,`update_time`,`nick_name`,`qq_number`,`we_chat`,`occupation`,`github`,`gitee`,`role_uid`,`person_resume`) values ('1723ad77a1ca06b29a011471036a2dd6','test1','$2a$10$eus6faJ6/X2hNo5Cm.7bK.Z0oP9UQADthoqRaGTwHEdwehnaMj4Lu','1',',70f5b89fe70a28d95e10c19c96bf2e85','xzx19950624@qq.com',NULL,NULL,NULL,NULL,40,'2020-04-25 20:57:04','192.168.80.1',1,'2020-03-22 10:23:12','2020-04-23 21:51:20','test1',NULL,NULL,NULL,NULL,NULL,'434994947c5a4ee3a710cd277357c7c4',NULL),('1f01cd1d2f474743b241d74008b12333','admin','$2a$10$hMxXWDrxPkrqmtPwziYP7.2cPewb9IcwpojeB9r.1N8aHe8v9BvEC','1',',63da0632ccf7f1fde167bdf92ff25b6b','1595833114@qq.com',NULL,NULL,NULL,'一个95后！正在潜心研究机器学习和Java后端技术，一边学习一边积累经验',140,'2020-04-30 09:55:16','192.168.80.1',1,'2020-03-22 08:38:04','2020-03-22 08:38:04','陌溪','1595833114',NULL,'Java开发','https://github.com/moxi624/mogu_blog_v2','https://gitee.com/moxi159753/mogu_blog_v2','434994947c5a4ee3a710cd277357c7c3','<h2>前言</h2>\r\n\r\n<p>目前博客源码已经开源至码云和Github中，感兴趣的小伙伴可以star关注一下下~</p>\r\n\r\n<p>Gitee地址：<a href=\"https://gitee.com/moxi159753/mogu_blog_v2\">https://gitee.com/moxi159753/mogu_blog_v2</a></p>\r\n\r\n<p>Github地址：<a href=\"https://github.com/moxi624/mogu_blog_v2\">https://github.com/moxi624/mogu_blog_v2</a></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<h2>关于我</h2>\r\n\r\n<p>许志翔，目前就读于桂林电子科技大学，是一名研二的学生，所属计算机信息与安全学院，研究方向是教育大数据，是一名&quot;不顾正业&quot;的研究僧，沉迷于Java和Vue技术开发，梦想着进入BATJ，也将一直为此不断努力了~</p>\r\n\r\n<p>正宗95后，爱编程，爱旅游，爱生活，爱锻炼，从刚研究生入学后，就坚持着两件事，一个是写代码，一个就是每天5公里慢跑</p>\r\n\r\n<pre>\r\n<code>意志力和天生才华，都是人们在事实发生了之后再去赋予某个人的优点：杰森是位不可思议的网球选手，因此，他一定生下来就具有这种才华；杰尼年复一年地练习拉小提琴，每天坚持几个小时，因此，他一定有着令人难以置信的意志力。\r\n\r\n——《刻意练习：从新手到大师》</code></pre>\r\n\r\n<p>最近可能随着研究生生涯过半，已经要着手开始写小论文的事情了，博客项目的更新估计会变的比较缓慢，应该不会存在大版本的更新迭代了</p>\r\n\r\n<p>不过目前博客项目的技术功能也编写的差不多，可能还要做的就是SEO优化，后面一段时间应该注重于网站的稳定性和BUG的解决，要是小伙伴在使用的时候，发现了什么问题，欢迎私聊我，或者在QQ群里提出~</p>\r\n\r\n<p>在今年的8、9月份，也该着手于校招了，后面应该更多的时间沉淀在Java的基础学习了，当然如果有老哥有内推名额的话，欢迎推荐我一下下....&nbsp; &nbsp;卑微.jpg&nbsp;</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/52552ed0efb245a9a67d5c9928d72e14\" /></p>\r\n\r\n<p>回顾2019年，每天也会在项目中，花费一些时间去提交代码，可能有的时候是增加了新功能，有的时候是解决一个BUG，到现在已经成为了一个习惯了，因此博客项目中也添加了比较多的有趣的功能，比如这个文章贡献度</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/aaff67a315c547c5964f0aebb4e8ce23\" /></p>\r\n\r\n<p>哈哈哈，其实它和码云上的代码贡献度是一样的，每次发表一篇博客，就会标记出个点，点越大说明该天发表博客越多，可能是因为自己有些强迫症的原因，不过我也希望能够借此来激励自己养成每天写博客的习惯，通过分享自己学习到的东西，来和各位IT的前辈们共同进步。</p>\r\n\r\n<p>当然闲暇之余也会玩玩游戏，有空的时候会在酒馆搓搓炉石~，玩玩农药，有喜欢的小伙伴也可以一起，虽然我贼菜</p>\r\n\r\n<hr />\r\n<h2>项目起因</h2>\r\n\r\n<p>本博客项目由我和几个小伙伴参与开发的，最开始的搭建蘑菇博客的初心是为了巩固和学习Java开发的一些知识，因此项目的技术选型都是比较新颖的技术，可能这些技术并不一定适用于博客系统，但是我也想着能尽可能把更多的技术融合进来，毕竟通过自己手把手的操作一遍，也能够算是入门了。我也很庆幸我成功将自己的项目开源出来了，并且坚持下来，蘑菇博客起源是2018年9月，到想在也已经度过了1年半的岁月。我也从最开始只会一点点Jsp和Servlet就出去找工作的傻小子慢慢成长了，在读研之前，我也在公司里呆过，算上来好像将近快一年，很感谢之前在公司里的同事和领导，是他们带我入门企业级的项目开发，让我养成了很多Java项目开发的规范。</p>\r\n\r\n<p>起初项目开源在码云上，没有多少人关注，所以自己也是坚持做自己的喜欢的事，有的时候是看看论文，有的时候敲敲代码，在2019年12月14日，蘑菇博客被码云推荐了，上了首页</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/49865d11fd4c4b289d87bf305b2dde0a\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>然后项目的关注度就开始上升了，有些小伙伴就开始关注项目的运行和部署了，所以我也花费了一些时间，整理了博客的开发、运行、部署的文档，希望每个小伙伴都能够通过本项目一起学习</p>\r\n\r\n<p>目前蘑菇博客已经有300star了，很高兴大家对蘑菇博客项目的认可</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/f55b31b7e00b42eda71e88105c4e147a\" /></p>\r\n\r\n<p>同时因为更新比较勤快，项目也在码云&nbsp; 博客&nbsp; &nbsp;关键字搜索的第一个，不过未来要走得路还很长，我也希望能够认识更多志同道合的小伙伴，然后一起学习和交流</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/36588a0c8bf04e9bb103eac0f432bfa7\" /></p>\r\n');

/*Table structure for table `t_blog` */

DROP TABLE IF EXISTS `t_blog`;

CREATE TABLE `t_blog` (
  `uid` varchar(32) NOT NULL COMMENT '唯一uid',
  `title` varchar(200) DEFAULT NULL COMMENT '博客标题',
  `summary` varchar(200) DEFAULT NULL COMMENT '博客简介',
  `content` longtext COMMENT '博客内容',
  `tag_uid` varchar(255) DEFAULT NULL COMMENT '标签uid',
  `click_count` int(11) DEFAULT '0' COMMENT '博客点击数',
  `collect_count` int(11) DEFAULT '0' COMMENT '博客收藏数',
  `file_uid` varchar(255) DEFAULT NULL COMMENT '标题图片uid',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `admin_uid` varchar(32) DEFAULT NULL COMMENT '管理员uid',
  `is_original` varchar(1) DEFAULT '1' COMMENT '是否原创（0:不是 1：是）',
  `author` varchar(255) DEFAULT NULL COMMENT '作者',
  `articles_part` varchar(255) DEFAULT NULL COMMENT '文章出处',
  `blog_sort_uid` varchar(32) DEFAULT NULL COMMENT '博客分类UID',
  `level` tinyint(1) DEFAULT '0' COMMENT '推荐等级(0:正常)',
  `is_publish` varchar(1) DEFAULT '1' COMMENT '是否发布：0：否，1：是',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序字段',
  `start_comment` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否开启评论(0:否 1:是)',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='博客表';

/*Data for the table `t_blog` */

insert  into `t_blog`(`uid`,`title`,`summary`,`content`,`tag_uid`,`click_count`,`collect_count`,`file_uid`,`status`,`create_time`,`update_time`,`admin_uid`,`is_original`,`author`,`articles_part`,`blog_sort_uid`,`level`,`is_publish`,`sort`,`start_comment`) values ('0231f82f169c4398ff695d8260694dd7','默认标题','默认简介','<h1>Eureka管理页面配置/actuator/info接口返回git信息</h1>\n<h2>前言</h2>\n<p>这阵子在弄监控页面，我点击eureka里面的地址</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573092808.png\" alt=\"image-20200107213729955\" /></p>\n<p>发现进去的页面没有 任何内容显示，后面想想可能是没有什么东西没有配置而引起的</p>\n<p>通过查阅资料发现，微服务若是用git管理，当前微服务部署的git的版本信息是不可或缺的信息，spring boot admin中通过/actuator/info接口返回git基本信息。该接口若要返回git信息，首先需要引入Actuator依赖</p>\n<pre><code>&lt;!-- 使用Actuator的/info端点输出Git版本 --&gt;\n&lt;dependency&gt;\n    &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n    &lt;artifactId&gt;spring-boot-starter-actuator&lt;/artifactId&gt;\n&lt;/dependency&gt;\n</code></pre>\n<p>同时需要添加git-commit-id-plugin插件</p>\n<pre><code>            &lt;plugin&gt;\n                &lt;groupId&gt;pl.project13.maven&lt;/groupId&gt;\n                &lt;artifactId&gt;git-commit-id-plugin&lt;/artifactId&gt;\n                &lt;version&gt;2.1.15&lt;/version&gt;\n                &lt;executions&gt;\n                    &lt;execution&gt;\n                        &lt;goals&gt;\n                            &lt;goal&gt;revision&lt;/goal&gt;\n                        &lt;/goals&gt;\n                    &lt;/execution&gt;\n                &lt;/executions&gt;\n                &lt;configuration&gt;\n                    &lt;dotGitDirectory&gt;${project.basedir}/.git&lt;/dotGitDirectory&gt;\n                &lt;/configuration&gt;\n            &lt;/plugin&gt;\n</code></pre>\n<p>添加完成后，我们查看IDEA的Maven，能够发现多出了一个 git-commit-id:revision</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573092935.png\" alt=\"image-20200107214012195\" /></p>\n<p>我们点击后，在<code>target/classes</code>目录下，我们可以发现产生了一个<code>git.properties</code>配置信息：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573093056.png\" alt=\"image-20200107214404474\" /></p>\n<p>里面的内容就是当前项目的git信息：</p>\n<pre><code>#Generated by Git-Commit-Id-Plugin\n#Tue Jan 07 21:25:46 CST 2020\ngit.build.user.email=xzx19950624@qq.com\ngit.build.host=DESKTOP-DIA5I1I\ngit.dirty=true\ngit.remote.origin.url=https\\://github.com/moxi624/mogu_blog_v2.git\ngit.closest.tag.name=\ngit.commit.id.describe-short=6f1ef9e-dirty\ngit.commit.user.email=xzx19950624@qq.com\ngit.commit.time=2020-01-07T19\\:58\\:26+0800\ngit.commit.message.full=update banner\ngit.build.version=0.0.1-SNAPSHOT\ngit.commit.message.short=update banner\ngit.commit.id.abbrev=6f1ef9e\ngit.branch=dev\ngit.build.user.name=陌溪_\ngit.closest.tag.commit.count=\ngit.commit.id.describe=6f1ef9e-dirty\ngit.commit.id=6f1ef9e48bbd0f3cb825b7934152dde21d821456\ngit.tags=\ngit.build.time=2020-01-07T21\\:25\\:46+0800\ngit.commit.user.name=陌溪_\n\n</code></pre>\n<p>然后启动eureka页面，在点击刚刚的a标签，发现能够成功获取到git信息了</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573093007.png\" alt=\"image-20200107214142962\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:44:59','2020-04-11 10:44:59','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('07d5a3bfdbb1267904c6bcf2837761cd','测试评论3','测试评论3','<p>测试评论3</p>\n','6b0ba63beabccc91c4f8fb938984f8a3',1,0,'d2424afcd30ca070d43930d0257097ad',1,'2020-04-24 08:47:54','2020-04-26 13:33:01','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','1ec7047fe5c672d7c756bf79405cd04b',1,'1',1,1),('0dca4065cb0eb5d146654cd6f557dcc8','默认标题','默认简介','<h1>http和https</h1>\n\n<h2>http</h2>\n\n<p>http是一种无状态协议。无状态是指客户机和服务器之间不需要建立持久连接，这意味着当一个客户端向服务器发出请求，然后服务器返回响应（response），连接就被关闭了，在服务器端不保留连接的有关信息，HTTP遵循请求/应答模型。客户机向服务器发送请求，服务器处理请求并返回适当的应答。所有HTTP连接都构成一套请求和应答。</p>\n\n<h2>https</h2>\n\n<p>HTTPS是以安全为目标的HTTP通道，简单将就是HTTP的安全版。即HTTP下加入SSL层，HTTPS的安全基础是SSL。其所用的端口是443，过程大致如下：</p>\n\n<h3>获取连接证书</h3>\n\n<p>SSL客户端通过TCP和服务器建立连接后（443端口），并且在一般的TCP连接协商过程中请求证书。即客户端发出一个消息给服务器，这个消息里面包含了自己可实现的算法列表和其它一些需要的消息，SSL的服务器端会回应一个数据包，这里面确定了这次通信所需要的算法，然后服务器向客户端返回证书。（证书里面包含了服务器信息：域名。申请证书的公司，公共密钥）</p>\n\n<h3>证书验证</h3>\n\n<p>客户端在收到服务器返回的证书后，判断签发这个证书的公共签发机构，并使用这个机构的公共密钥确认签名是否有效，客户端还会确保证书中列出的域名就是它正在连接的域名</p>\n\n<h3>数据加密和传输</h3>\n\n<p>如果确认证书有效，那么生成对称密钥并使用服务器的公共密钥进行加密。然后发送给服务器，服务器使用它的密钥进行解密，这样两台计算机可以开始进行对称加密进行通信。</p>\n\n<p><img alt=\"image-20200413085448943\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821524.png\" /></p>\n\n<p>对称加密：是指加密和解密用的都是同一个密钥，目前微信小程序采用的就是这个加密方式</p>\n\n<h3>对称加密存在的问题</h3>\n\n<p>首先我们知道对称加密是指：加密和解密都使用的同一个密钥，这种方式存在的最大的问题就是密钥发送问题，即如果安全的将密钥发送给对方。</p>\n\n<h4>为什么叫对称加密？</h4>\n\n<p>一方通过密钥将信息加密后，把密文传给另一个方，另一方通过这个相同的密钥将密文解密，转换成可以理解的明文。他们之间的关系如下</p>\n\n<blockquote>\n<p>明文 -&gt; 密钥 -&gt; 密文</p>\n</blockquote>\n\n<p>但是从上面的图我们可以看出，我们在进行加密后，首先需要将密钥发送给服务器，那么这个过程就可能存在危险的</p>\n\n<p><img alt=\"image-20200413091318404\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821727.png\" /></p>\n\n<h3>非对称加密</h3>\n\n<p>上面提到的是对称加密，其实还有一种是非对称加密，非对称加密是通过两个密钥（公钥 - 私钥）来实现对数据的加密和解密的，公钥用于加密，私钥用于解密。</p>\n\n<p><img alt=\"image-20200413085937800\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821663.png\" /></p>\n\n<p>过程如下：</p>\n\n<p>首先服务器会颁发一个公钥放在网络中，同时它自己还有一份私钥，然后客户端可以直接获取到对应的公钥</p>\n\n<p>然后将客户端的数据进行公钥的加密，加密后传输的服务器中，服务器在进行私钥解密，得到最终的数据</p>\n\n<p><img alt=\"image-20200413102124070\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821777.png\" /></p>\n\n<p>由于非对称加密的方式不需要发送用来解密的私钥，所以可以保证安全性，但是和对称加密比起来，它非常慢，所以我们还是要用对称加密来传送消息，但是对称加密使用的密钥我们通过非对称加密的方式发送出去。这个结果就变成了：</p>\n\n<p><img alt=\"image-20200413102622594\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821827.png\" /></p>\n\n<p>但是我们需要注意的是，此时交换的两个公钥不一定正确，因为可能会被中间人截获，同时掉包</p>\n\n<p>例如：中间人虽然不知道小红的私钥是什么，但是在截获了小红的公钥Key1之后，却可以偷天换日，自己另外生成一对公钥私钥，把自己的公钥Key3发送给小灰。</p>\n\n<p><img alt=\"image-20200413102718466\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821885.png\" /></p>\n\n<p>这一次通信再次被中间人截获，中间人先用自己的私钥解开了Key3的加密，获得Key2，然后再用当初小红发来的Key1重新加密，再发给小红</p>\n\n<p><img alt=\"image-20200413102738635\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821913.png\" /></p>\n\n<h3>证书机制</h3>\n\n<p>这个时候我们需要做的就是从指定的机构出获取公钥，而不是任由其在网络传输</p>\n\n<ul>\n	<li>作为服务器端的小红，首先先把自己的公钥给证书颁发机构，向证书颁发机构申请证书</li>\n	<li>证书颁发机构自己也有一堆公钥和私钥。机构利用自己的私钥来解密Key1，通过服务端网址等信息生成一个证书签名，证书签名同样经过机构的私钥加密。证书制作完成后，机构把证书发送给服务端的小红。</li>\n	<li>当小灰向小红请求通信的时候，小红不再直接返回自己的公钥，而是把自己申请的证书返回给小灰。</li>\n	<li>小灰收到证书以后，要做的第一件事就是验证证书的真伪，需要说明的是，各大浏览器和操作系统已经维护了所有权威证书机构的名称和公钥，所以小灰只需要知道是哪个机构颁发的证书，就可以从本地找到对应的机构公钥，解密出证书签名。</li>\n</ul>\n\n<p><img alt=\"image-20200413103251089\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821975.png\" /></p>\n\n<h2>参考</h2>\n\n<p>https://blog.csdn.net/jiangshangchunjiezi/article/details/88545263</p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-13 17:23:46','2020-04-20 21:22:13','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('162c5decb0e122e845ee945f6253bacd','我是默认标题','默认简介','<h2>Mysql默认搜索引擎</h2>\n<p>Mysql5.5以后默认使用InnoDB为搜索引擎</p>\n<p>MyISAM是表锁，不支持事务和主外键</p>\n<p><img src=\"images/image-20200404084731063.png\" alt=\"image-20200404084731063\" /></p>\n<p>InnoDB默认可以创建16个索引</p>\n<h2>硬盘</h2>\n<p><img src=\"images/image-20200404085422944.png\" alt=\"image-20200404085422944\" /></p>\n<p>Mysql是存储在硬盘上，因此Redis比Mysql快</p>\n<h2>索引</h2>\n<p>Mysql官方对索引的定位为：索引是帮助Mysql高效获取数据的数据结构，可以得到索引的本质就是，索引是数据结构。</p>\n<p>可以简单的理解为：排好序的快速查找B+树数据结构，B+树中的B代表平衡(balance) 而不是 二叉（binary）</p>\n<h2>检索原理</h2>\n<p>在数据之外，数据库系统还维护着满足特定查找算法的数据结构，这些数据结构以某种方式引用（指向）数据，这样就可以在这些数据上实现高级查找算法，这种数据结构，就是索引。下图就是一种可能的索引方式示例：</p>\n<p><img src=\"images/image-20200404090022629.png\" alt=\"image-20200404090022629\" /></p>\n<p>为了加快Col2的查找，可以维护一个左边所示的二叉树，每个节点分别包含索引键值和一个指向对应数据记录的物理地址的指针，这样就可以运用二叉树在一定的复杂度内获取相应数据，从而快速的检索出符合条件的记录。</p>\n<h2>B+树</h2>\n<p>B树：Balance Tree，多路平衡查找树</p>\n<p>B+树：加强版多路平衡查找树</p>\n<p>tip：没有B-树，B-树就是B树，中间不是减号而是横线</p>\n<h2>Mysql搜索引擎的发展之路</h2>\n<p>Mysql InnoDB的搜索引擎 的 底层也不是一来就是 B+树的，而是经过了不断的迭代过程</p>\n<ul>\n<li>全部遍历</li>\n<li>Hash</li>\n<li>二叉树</li>\n<li>平衡二叉树（AVL）</li>\n<li>B树</li>\n<li>B+树</li>\n</ul>\n<h3>全部遍历</h3>\n<p>相当于全表查询，把每条数据都查找一遍</p>\n<h3>Hash</h3>\n<p>加速查找速度的数据结构，常见的有两类</p>\n<ul>\n<li>哈希，例如HashMap，查询、插入、修改、删除的平均时间复杂度都是O(1)</li>\n<li>树：例如平衡二叉搜索树，查询、插入、修改、删除的平均事件复杂度都是O(log<sub>2</sub> (n))</li>\n</ul>\n<p>可以看到，不管是读请求，还是写请求，哈希类型的索引，都要比树型的索引更快一些，为什么不用Hash做索引呢，而要设计成树型结构呢？</p>\n<p>假设SQL语句为：</p>\n<pre><code>select * from student where age = 15\n</code></pre>\n<p>我们能够通过Hash就可以很好的用Hash进行解决</p>\n<p>但是随着SQL的复杂化，对于以下范围查找，Hash就搞不定了，也就是说Hash就只能解决查1的问题</p>\n<pre><code>select * from student where age &gt; 15 and age &lt; 20\n</code></pre>\n<p>想想范围/排序等其它SQL条件：</p>\n<p>哈希型的索引，时间复杂度会退化O(n) 而树型的“有序” 特性，依然能够保持 O(log<sub>2</sub>(n) )</p>\n<p>InnoDB：并不支持Hash索引</p>\n<h3>二叉树</h3>\n<p>二叉树的特点</p>\n<ul>\n<li>一个节点只能有两个子节点，也就是一个节点的度不能超过2</li>\n<li>左子节点小于本节点，右子节点大于等于本节点，比我大的向右，比我小的向做</li>\n</ul>\n<p><img src=\"images/image-20200404093846645.png\" alt=\"image-20200404093846645\" /></p>\n<p>对该二叉树的节点查找发现：</p>\n<p>深度为1的节点查找次数为：1</p>\n<p>深度为2的节点查找次数为：2</p>\n<p>深度为N的节点查找次数为：N</p>\n<p>结论：因此其平均查找长度为：(1+2+2+3+3+3) / 6 = 2.3次</p>\n<h4>问题</h4>\n<ul>\n<li>如果ID是持续递增的话，会出现什么样的结构？</li>\n</ul>\n<p><img src=\"images/image-20200404094336765.png\" alt=\"image-20200404094336765\" /></p>\n<p>这样树型结构，又会退化到 O(n) 的时间复杂度</p>\n<h3>平衡二叉树（AVL）</h3>\n<h4>结构图</h4>\n<p><img src=\"images/image-20200404094719626.png\" alt=\"image-20200404094719626\" /></p>\n<h4>问题</h4>\n<p>从算法的数学逻辑来讲，二叉树的查找速度和比较次数都是最小的，那为什么我们选择BTree?因为AVL还有一个问题，那就是 磁盘IO的问题</p>\n<ul>\n<li>磁盘IO的次数，就是由树高来决定的，也即磁盘的IO次数最坏的情况下就等于树的高度。</li>\n</ul>\n<p>随着数据量增加，树就会越高，那么查找的就越慢，而且导致的IO操作增加</p>\n<h4>解决方法</h4>\n<p>我们需要解决的就是树的高度问题，导致磁盘IO过多</p>\n<p>那么就需要将树进行压缩，也就是将原来的瘦高 -&gt; 矮胖，通过降低树的高度达到减少IO的次数</p>\n<h3>B树</h3>\n<p>B树，又被称为 2-3树，也就是B树上的节点，可能是2，也可能是3</p>\n<h4>结构图：</h4>\n<p><img src=\"images/image-20200404100139814.png\" alt=\"image-20200404100139814\" /></p>\n<h4>底层原理</h4>\n<p>数据库索引是存储在磁盘上的，如果数据很大，必然导致索引的大小也会很大，超过几个G（好比新华字典字数多必然导致目录厚）</p>\n<p>当我们利用索引查询时，是不可能将全部几个G的索引都加载进内存的，我们能做的只能是：</p>\n<p>逐一加载每一个磁盘页，因为磁盘页对应着索引树的节点。</p>\n<p>InnoDB的 page_size</p>\n<pre><code>SHOW GLOBAL STATUS LIKE \'Innodb_page_size\';\n</code></pre>\n<p><img src=\"images/image-20200404151334993.png\" alt=\"image-20200404151334993\" /></p>\n<p>系统从磁盘读取数据到内存时是以磁盘块（block）为单位的，位于同一磁盘块中的数据会被一次性读取出来，而不是需要什么取什么</p>\n<p>InnoDB存储引擎中有页(Page)的概念，页是其磁盘管理的最小单位。</p>\n<p>系统一个磁盘块的存储空间往往没有这么大，因此InnoDB每次申请磁盘空间时都会是若干地址连续磁盘块来达到页的大小16KB。InnoDB在把磁盘数据读入到磁盘时会以页为基本单位，在查询数据时如果一个页中每条数据都有助于定位数据记录的位置，这将会减少磁盘I/O次数，提高效率。</p>\n<p>一句话说：就是多个块填充到一页大小</p>\n<h4>检索原理</h4>\n<p>B树比平衡二叉树减少了一次IO操作</p>\n<p><img src=\"http://localhost:8600/null\" alt=\"image-20200404152149658\" /></p>\n<p>每个节点占用一个盘块的磁盘空间，一个节点上有两个升序排序的关键字和三个指向子树根节点的指针，指针存储的是子节点所在磁盘块的地址。</p>\n<p>模拟查找关键字29的过程</p>\n<ul>\n<li>根据根节点找到磁盘块1，读入内存【磁盘IO操作1次】</li>\n<li>比较关键字29在区间(17, 35)，找到磁盘块1的指针P2。</li>\n<li>根据P2指针找到磁盘块3，读入内存。【磁盘IO操作第2次】</li>\n<li>比较关键字29在区间(26, 30)，找到磁盘块3的指针P2。</li>\n<li>根据P2指针找到磁盘块8，读入内存。【磁盘IO操作3次】</li>\n<li>在磁盘块8中的关键字列表，找到关键字29</li>\n</ul>\n<p>分析上述过程，发现需要3次IO操作，和3次内存查找操作，由于内存中的关键字是一个有序表结构，可以利用二分法查找提高效率。而3次磁盘IO操作是影响整个BTree查找效率的决定性因素。BTree相对于AVLTree缩减了节点个数，使每次磁盘IO取到内存的数据都发挥了作用，从而提高了查找效率。</p>\n<h3>B+树</h3>\n<p>B+树把所有数据放在叶子节点，形成了链表，我们查找数据更方便</p>\n<p>好查，好排序，好划定范围</p>\n<h4>B+树结构图</h4>\n<p><img src=\"images/image-20200404155456211.png\" alt=\"image-20200404155456211\" /></p>\n<p>把两种数据结构集成在一块了：树 + 链表</p>\n<p>图中可以看出所有的data信息都移动叶子节点中，而且子节点和子节点之间会有指针指向，这个也是B+树的核心点，这样可以大大提升范围查找效率，也方便遍历整个树。</p>\n<ul>\n<li>非叶子节点不在存储数据，数据只存储在同一层的叶子节点上</li>\n<li>叶子之间，增加链表，获取所有节点，不再需要中序遍历</li>\n<li>这也说明了，B+树的检索性能比B树强</li>\n</ul>\n<h4>检索原理</h4>\n<p>由于B+树的非叶子只存储键值信息，假设每个磁盘块能存储4个键值及指针信息，那就变成如下结构</p>\n<p><img src=\"images/image-20200404161422032.png\" alt=\"image-20200404161422032\" /></p>\n<p>B树结构图中可以看出每个节点不仅包含数据的key值，还有data值，而每一页的存储空间是有限的，如果data数据较大时将会导致每个节点（即一个页）能存储的key的数量很小，当存储数量很大时同样会导致B树的深度较大，增大查询时的磁盘IO次数进而影响查询效率。</p>\n<h2>Mysql为什么是B+树</h2>\n<p>B+树中，所有数据记录节点都是按照键值大小顺序存放在同一层叶子节点上，而非叶子节点上只存储key值信息，这样可以大大加大每个节点存储的key值数量，降低B+树的高度。</p>\n<ul>\n<li>InnoDB存储引擎的最小存储单元是页，页可以用于存放数据，也可以用于存放键值+指针，在B+树中叶子节点存放数据，而非叶子节点存放键值+指针</li>\n<li>索引组织表通过非叶子节点的二分查找法以及指针确定数据在哪个页中，首先找到根页进而去数据页查找到需要的数据</li>\n</ul>\n<p>B+树算法：通过集成B树的特征，B+树相比B树，新增叶子节点与非叶子节点关系，叶子节点包含了键值和数据，非叶子节点只是包含键值和子节点引用，不包含数据。</p>\n<p>通过非叶子节点查询叶子节点获取相应的数据，所有相邻的叶子节点包含非叶子节点使用链表进行结合，叶子节点是顺序并且相邻节点有顺序引用关系。</p>\n<h4>结论</h4>\n<p>从B树到B+树，B+树在B树的基础上的一种优化使其更适合实现外存储索引结构，InnoDB存储引擎就是用B+树实现的索引结构</p>\n<p>B树和B+树的不同之处</p>\n<ul>\n<li>非叶子节点只存储键值信息</li>\n<li>所有叶子节点之间都有一个链指针</li>\n<li>数据记录都存放在叶子节点中</li>\n</ul>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-11 00:24:46','2020-04-11 00:24:46',NULL,'1','陌溪',NULL,'1ec7047fe5c672d7c756bf79405cd04b',0,'0',0,1),('19d9ae8845205723ea610439b3307f1d','默认标题','默认简介','<h1>两个栈实现一个队列</h1>\n<h2>题目描述</h2>\n<p>用两个栈来实现一个队列，完成队列的Push和Pop操作。 队列中的元素为int类型。</p>\n<h2>思考</h2>\n<p>栈：先进后出</p>\n<p>队列：先进先出.</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587996717233.png\" alt=\"image-20200423094525763\" /></p>\n<p>我们需要使用一个栈用于接收数据，并且一个栈用于输出数据</p>\n<h2>代码</h2>\n<pre><code>class Solution:\n    def __init__(self):\n        # 接收栈\n        self.acceptStack = []\n        # 输出栈\n        self.outputStack = []\n\n    def push(self, node):\n        # 把节点放到栈中\n        self.acceptStack.append(node)\n\n    def pop(self):\n        # 从接收栈中获取元素，把它放入到 输出栈中\n        if self.outputStack == []:\n            while self.acceptStack:\n                self.outputStack.append(self.acceptStack.pop())\n\n        # 判断输出栈中是否有元素，有，则输出最后一个\n        if self.outputStack != []:\n            return self.outputStack.pop()\n        else:\n            return None\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-27 22:12:03','2020-04-27 22:12:03','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('1d3720e28bd00fcbe9841bf9b03cac6f','我是默认标题','默认简介','<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568188262.png\" alt=\"\" /></p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568188300.png\" alt=\"image-20200411085724059\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-11 09:23:18','2020-04-11 09:23:18',NULL,'1','陌溪',NULL,'1ec7047fe5c672d7c756bf79405cd04b',0,'0',0,1),('1de2399f84547eb228ae8e8466734f08','我是默认标题','默认简介','<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586567852228.png\" alt=\"\" /></p>\n<p><img src=\"images/image-20200411085724059.png\" alt=\"image-20200411085724059\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-11 09:17:47','2020-04-11 09:17:47',NULL,'1','陌溪',NULL,'1ec7047fe5c672d7c756bf79405cd04b',0,'0',0,1),('22612ff204db09fb584e3d448cd98d95','测试','测试','<p>123</p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'a5d84f5e443b781fe8146620e1abb5b8',0,'2020-04-23 15:23:31','2020-04-23 15:23:31','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'1',0,1),('243c0368be2cd31674b3d4369d7fbabc','默认标题','默认简介','<h1>Spring Security造成Eureka 无法使用iframe的内嵌页面的解决方法</h1>\n<h2>前言</h2>\n<p>最近想写个监控页面，让eureka的管理页面能够嵌入到我们的后台管理中，我们使用<iframe>标签，代码如下所示：</p>\n<pre><code class=\"language-html\">&lt;template&gt;\n  &lt;div class=&quot;app-container&quot;&gt;\n    &lt;iframe  :src=&quot;adminSwaggerUrl&quot; width=&quot;100%&quot; height=&quot;660px;&quot;&gt;&lt;/iframe&gt;\n  &lt;/div&gt;\n&lt;/template&gt;\n\n&lt;script&gt;\n\n  export default {\n\n    data() {\n      return {\n        adminSwaggerUrl: &quot;http://localhost:8761&quot;,\n      }\n    },\n    created() {\n\n    },\n    methods: {\n\n    }\n  }\n&lt;/script&gt;\n</code></pre>\n<p>但是发现无法直接正常显示：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573331917.png\" alt=\"image-20200106095854704\" /></p>\n<p>F12打开调试页面，发现下列的错误信息：</p>\n<pre><code>Refused to display \'http://localhost:8761/\' in a frame because it set \'X-Frame-Options\' to \'deny\'\n</code></pre>\n<p>这是因为Spring Security默认设置X-Frame-Options 为 deny：拒绝</p>\n<h2>X-Frame-Options</h2>\n<p>下面介绍下X-Frame-Options主要用处是用于防止点击劫持，点击劫持（ClickJacking）是一种视觉上的欺骗手段。攻击者使用一个透明的iframe，覆盖在一个网页上，然后诱使用户在网页上进行操作，此时用户将在不知情的情况下点击透明的iframe页面。通过调整iframe页面的位置，可以诱使用户恰好点击在iframe页面的一些功能性按钮上。\nHTTP响应头信息中的X-Frame-Options，可以指示浏览器是否应该加载一个iframe中的页面。如果服务器响应头信息中没有X-Frame-Options，则该网站存在ClickJacking攻击风险。网站可以通过设置X-Frame-Options阻止站点内的页面被其他页面嵌入从而防止点击劫持。</p>\n<p>X-Frame-Options响应头。赋值有如下三种：</p>\n<ul>\n<li>DENY：不能被嵌入到任何iframe或者frame中。</li>\n<li>SAMEORIGIN：页面只能被本站页面嵌入到iframe或者frame中</li>\n<li>ALLOW-FROM uri：只能被嵌入到指定域名的框架中</li>\n</ul>\n<h2>解决方案</h2>\n<p>从这里就可以看到，是因为Spring Security默认设置X-Frame-Options响应头是 DENY，也就是不能被嵌入到任何iframe中，这也造成了我们无法正常显示eureka页面，所以我们需要在Spring Security的配置文件中设置关闭X-Frame-Options即可，也就是加入下面这句</p>\n<pre><code>.headers().frameOptions().disable();\n</code></pre>\n<p>完整代码如下：</p>\n<pre><code class=\"language-java\">package com.moxi.mogublog.eureka.config;\n\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.security.config.annotation.web.builders.HttpSecurity;\nimport org.springframework.security.config.annotation.web.configuration.EnableWebSecurity;\nimport org.springframework.security.config.annotation.web.configuration.WebSecurityConfigurerAdapter;\nimport org.springframework.security.config.http.SessionCreationPolicy;\n\n/**\n * WebSecurityConfig\n *\n * @author: 陌溪\n * @create: 2019-12-21-19:20\n */\n@Configuration\n@EnableWebSecurity\npublic class WebSecurityConfig extends WebSecurityConfigurerAdapter {\n\n    /**\n     * 高版本的丢弃了\n     * &lt;p&gt;\n     * security:\n     * basic:\n     * enabled: true\n     * &lt;p&gt;\n     * 配置，应该使用以下方式开启\n     *\n     * @param http\n     * @throws Exception\n     */\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        // Configure HttpSecurity as needed (e.g. enable http basic).\n        http.sessionManagement().sessionCreationPolicy(SessionCreationPolicy.NEVER);\n        http.csrf().disable()\n        .headers().frameOptions().disable();\n\n        //注意：为了可以使用 http://${user}:${password}@${host}:${port}/eureka/ 这种方式登录,所以必须是httpBasic,\n        // 如果是form方式,不能使用url格式登录\n        http.authorizeRequests().anyRequest().authenticated().and().httpBasic();\n    }\n\n}\n</code></pre>\n<p>添加后，就能够正常显示页面了：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573332039.png\" alt=\"image-20200106101231543\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:48:58','2020-04-11 10:48:58','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('2fd90b1ae8a4c35e7d90675e74fdd015','默认标题','默认简介','<h1>ElementUI中Upload组件如何批量上传</h1>\n<h2>前言</h2>\n<p>最近一直使用Element提供的文件上传组件，但是使用后发现，其实当我们批量选中的时候，文件不是一次性都上传进去的，而是把它又拆分成一个个的文件进行上传。首先这容易造成的问题就是我们如果同时提交多个图片文件的时候，会重复的请求接口，造成接口并发访问的时可能出现的问题，下面是Element 的Github写的一个Issue</p>\n<p>地址：<a href=\"https://github.com/ElemeFE/element/issues/15036\">Element</a></p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/12/1586692004860.png\" alt=\"image-20200411115231912\" /></p>\n<p>上面也是提出了这个问题，就是希望能够合并请求提交，但是得到的官方回复却是：这个合并提交不在计划内，并不打算支持。</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/12/1586692005636.png\" alt=\"image-20200411115319703\" /></p>\n<h2>解决方案</h2>\n<p>后面通过查看issue发现，有一篇能够解决图片合并上传的需求：<a href=\"https://github.com/ElemeFE/element/issues/8052\">issue</a></p>\n<p>主要是定义了两个方法，首先就是我们写的upload组件</p>\n<pre><code>      &lt;el-upload\n        class=&quot;upload-demo&quot;\n        ref=&quot;uploadFile&quot;\n        name=&quot;filedatas&quot;\n        :headers=&quot;importHeaders&quot;\n        :action=&quot;uploadAdminHost&quot;\n        :auto-upload=&quot;false&quot;\n        multiple\n      &gt;\n        &lt;el-button slot=&quot;trigger&quot; size=&quot;small&quot; type=&quot;primary&quot;&gt;选取博客文件&lt;/el-button&gt;\n        &lt;el-button style=&quot;margin-left: 10px;&quot; size=&quot;small&quot; type=&quot;success&quot; @click=&quot;submitUpload&quot;&gt;提交到服务器&lt;/el-button&gt;\n      &lt;/el-upload&gt;\n</code></pre>\n<p>然后我们是上传逻辑，我们首先获取到upload组件上的dom，然后获取文件，上传地址和数据</p>\n<pre><code>    // 文件上传\n    submitUpload() {\n      let {uploadFiles, action, data} = this.$refs.uploadFile      \n      this.uploadFiles({\n        uploadFiles,\n        data,\n        action,\n        success: (response) =&gt; {\n          console.log(response)\n          // 上传成功后，将里面的内容删除\n          this.$refs.uploadFile.clearFiles();\n          this.$refs.uploadPicture.clearFiles();\n        },\n        error: (error) =&gt; {\n          console.log(\'失败了\', error)\n        }\n      })\n    },\n</code></pre>\n<p>下面封装了一个 uploadFiles 方法，这里uploadFiles 就可以是多文件，通过封装ajax方式</p>\n<pre><code>    /**\n     * 自定义上传文件\n     * @param fileList 文件列表\n     * @param data 上传时附带的额外参数\n     * @param url 上传的URL地址\n     * @param success 成功回调\n     * @param error 失败回调\n     */\n    uploadFiles({uploadFiles, headers, data, action, success, error}) {\n      let form = new FormData()\n      // 文件对象\n      uploadFiles.map(file =&gt; form.append(&quot;filedatas&quot;, file.raw))\n      // 附件参数\n      for (let key in data) {\n        form.append(key, data[key])\n      }\n      let xhr = new XMLHttpRequest()\n      // 异步请求\n      xhr.open(&quot;post&quot;, action, true)\n      // 设置请求头\n      xhr.setRequestHeader(&quot;Authorization&quot;, getToken());\n      xhr.onreadystatechange = function() {\n        if (xhr.readyState == 4){\n          if ((xhr.status &gt;= 200 &amp;&amp; xhr.status &lt; 300) || xhr.status == 304){\n            success &amp;&amp; success(xhr.responseText)\n          } else {\n            error &amp;&amp; error(xhr.status)\n          }\n        }\n      }\n      xhr.send(form)\n    }\n</code></pre>\n<p>最后后台接口，同时接受多个文件</p>\n<pre><code>    @PostMapping(&quot;/pictures&quot;)\n    public Object uploadPics(HttpServletRequest request, List&lt;MultipartFile&gt; filedatas) {\n          // 逻辑代码\n	}\n</code></pre>\n<p>最后我们查看请求，会同时携带多个文件</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/12/1586692005697.png\" alt=\"image-20200411172208388\" /></p>\n<p>并且返回多个上传成功的结果</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/12/1586692005747.png\" alt=\"image-20200411172255665\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-12 19:46:54','2020-04-12 19:46:54','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('3be4eef974b1d55913661678b1e3b530','默认标题','默认简介','<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"images/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"images/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"images/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"images/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"images/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"images/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"images/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"images/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"images/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"images/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:16:44','2020-04-11 10:16:44','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('3daf3fcf6a3c448b6ec8085748ca5870','默认标题','默认简介','<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587996717067.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-27 22:12:03','2020-04-27 22:12:03','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('429ce3206ff8b84f07514685d5198975','发送','发送','<p>发送</p>\n','6b0ba63beabccc91c4f8fb938984f8a3',0,0,NULL,0,'2020-04-23 16:25:30','2020-04-23 16:25:30','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','1ec7047fe5c672d7c756bf79405cd04b',0,'1',0,1),('42e3a2a0a32427b6801522b81eac4a92','·12','·12','<p>&middot;12</p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-23 15:32:33','2020-04-23 15:43:42','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','1ec7047fe5c672d7c756bf79405cd04b',0,'1',0,1),('43a0fa6225a273074d6be20c6cffc486','默认标题','默认简介','<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"images/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"images/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"images/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"images/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"images/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"images/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"images/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"images/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"images/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"images/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:44:09','2020-04-11 10:44:09','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('4bfde944dfdf4f2dc303e6b4c5cea1ba','312','123','<p>123</p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-23 15:32:24','2020-04-23 15:32:24','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'1',0,1),('520bed092554ed15973ee03e70d44617','默认标题','默认简介','<h1>斐波那契数列</h1>\n<h2>题目</h2>\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n<p>n&lt;=39</p>\n<h2>菲波那切数列是什么</h2>\n<pre><code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n<h2>递归方法实现</h2>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n<h3>存在问题</h3>\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036727470.png\" alt=\"image-20200422211936865\" /></p>\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n<h2>非递归实现</h2>\n<p>我们继续查看刚刚的规律</p>\n<pre><code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-28 09:18:59','2020-04-28 09:18:59','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('5554a10145bae3876909299ea867b3d9','123','123','<p>123</p>\n','5c4c541e600ff422ccb371ee788f59d6',1,0,'a5d84f5e443b781fe8146620e1abb5b8',1,'2020-04-23 21:09:58','2020-04-26 13:33:05','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',2,'1',0,1),('55879c52480119b3b7c65287a1fb2cbd','默认标题','默认简介','<h1>SpringBoot+Vue如何集成第三方登录登录JustAuth</h1>\n<h2>前言</h2>\n<p>这两天打算给蘑菇博客增加第三方登录模块，所有对目前的第三方登录的Github和Gitee中的Demo进行的调查，发现在gitee有个做的非常不错的项目：史上最全的整合第三方登录的开源库。目前已支持Github、Gitee、微博、钉钉、百度、Coding、腾讯云开发者平台、OSChina、支付宝、QQ、微信、淘宝、Google、Facebook、抖音、领英、小米、微软、今日头条、Teambition、StackOverflow、Pinterest、人人、华为、企业微信、酷家乐、Gitlab、美团、饿了么和推特等第三方平台的授权登录。 Login, so easy!</p>\n<p>JustAuth仓库：https://gitee.com/yadong.zhang/JustAuth</p>\n<p>JustAuth文档：https://docs.justauth.whnb.wang/#/</p>\n<h2>编写登录页面Vue样式和代码</h2>\n<p>首先需要编写一个登录框代码，下面是使用vue创建了一个组件 LoginBox，同时里面还引入了阿里矢量库中的几个图标，感兴趣的小伙伴可以查看这篇博客：<a href=\"http://moguit.cn/#/info?blogUid=1310f62f726ef0892e1de19bc14bba09\">Vue项目使用阿里巴巴矢量图标库</a></p>\n<pre><code class=\"language-vue\">&lt;template&gt;\n  &lt;div&gt;\n    &lt;div class=&quot;box loginBox&quot; v-if=&quot;showLogin == true&quot;&gt;\n      &lt;div class=&quot;title&quot;  &gt;\n        &lt;span class=&quot;t1&quot;&gt;\n          登录\n        &lt;/span&gt;\n        &lt;div class=&quot;t2&quot; @click=&quot;closeLogin()&quot;&gt;\n          X\n        &lt;/div&gt;\n      &lt;/div&gt;\n      &lt;el-divider&gt;&lt;/el-divider&gt;\n      &lt;el-form :label-position=&quot;labelPosition&quot; :model=&quot;loginForm&quot;&gt;\n        &lt;el-form-item label=&quot;用户名&quot;&gt;\n          &lt;el-input v-model=&quot;loginForm.userName&quot; disabled&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n        &lt;el-form-item label=&quot;密码&quot;&gt;\n          &lt;el-input type=&quot;password&quot; v-model=&quot;loginForm.password&quot; disabled&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n        &lt;el-row class=&quot;btn&quot;&gt;\n          &lt;el-button class=&quot;loginBtn&quot; type=&quot;primary&quot; @click=&quot;startLogin&quot; disabled&gt;登录&lt;/el-button&gt;\n          &lt;el-button class=&quot;registerBtn&quot; type=&quot;info&quot; @click=&quot;goRegister&quot; disabled&gt;注册&lt;/el-button&gt;\n        &lt;/el-row&gt;\n\n        &lt;el-row class=&quot;elRow&quot;&gt;\n          &lt;el-tooltip content=&quot;码云&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;danger&quot; circle @click=&quot;goAuth(\'gitee\')&quot;&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe602;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n          &lt;el-tooltip content=&quot;Github&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;info&quot; circle @click=&quot;goAuth(\'github\')&quot;&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe64a;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n          &lt;el-tooltip content=&quot;QQ&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;primary&quot; circle disabled&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe601;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n          &lt;el-tooltip content=&quot;微信&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;success&quot; circle disabled&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe66f;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n        &lt;/el-row&gt;\n        &lt;div class=&quot;loginTip&quot;&gt;登录过的用户请沿用之前的登录方式&lt;/div&gt;\n      &lt;/el-form&gt;\n    &lt;/div&gt;\n\n    &lt;div class=&quot;box registerBox&quot; v-if=&quot;showLogin == false&quot;&gt;\n      &lt;div class=&quot;title&quot;&gt;\n        &lt;span class=&quot;t1&quot;&gt;\n          登录\n        &lt;/span&gt;\n        &lt;div class=&quot;t2&quot; @click=&quot;closeLogin()&quot;&gt;\n          X\n        &lt;/div&gt;\n      &lt;/div&gt;\n      &lt;el-divider&gt;&lt;/el-divider&gt;\n      &lt;el-form :label-position=&quot;labelPosition&quot; :model=&quot;registerForm&quot;&gt;\n        &lt;el-form-item label=&quot;用户名&quot;&gt;\n          &lt;el-input v-model=&quot;registerForm.userName&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-form-item label=&quot;密码&quot;&gt;\n          &lt;el-input type=&quot;password&quot; v-model=&quot;registerForm.password&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-form-item label=&quot;重复密码&quot;&gt;\n          &lt;el-input type=&quot;password&quot; v-model=&quot;registerForm.password2&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-form-item label=&quot;邮箱&quot;&gt;\n          &lt;el-input v-model=&quot;registerForm.email&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-row class=&quot;btn&quot;&gt;\n          &lt;el-button class=&quot;loginBtn&quot; type=&quot;primary&quot; @click=&quot;startRegister&quot;&gt;注册&lt;/el-button&gt;\n          &lt;el-button class=&quot;registerBtn&quot; type=&quot;info&quot; @click=&quot;goLogin&quot;&gt;返回登录&lt;/el-button&gt;\n        &lt;/el-row&gt;\n\n        &lt;div class=&quot;loginTip&quot;&gt;注册后，需要到邮箱进行邮件认证~&lt;/div&gt;\n      &lt;/el-form&gt;\n    &lt;/div&gt;\n\n    &lt;div class=&quot;mask&quot;&gt;&lt;/div&gt;\n\n  &lt;/div&gt;\n&lt;/template&gt;\n\n&lt;script&gt;\n  import {login, register} from &quot;@/api/user&quot;;\n\n  export default {\n    name: &quot;share&quot;,\n    data() {\n      return {\n        // 显示登录页面\n        showLogin: true,\n        isLogin: false,\n        table: false,\n        dialog: false,\n        loading: false,\n        labelPosition: &quot;right&quot;,\n        loginForm: {\n          userName: &quot;&quot;,\n          password: &quot;&quot;\n        },\n        registerForm: {\n          userName: &quot;&quot;,\n          password: &quot;&quot;,\n          password2: &quot;&quot;,\n          email: &quot;&quot;\n        }\n      };\n    },\n    components: {},\n    created() {\n    },\n    methods: {\n      startLogin: function () {\n        var params = {};\n        params.userName = this.loginForm.userName;\n        params.passWord = this.loginForm.password;\n        params.isRememberMe = 0;\n        console.log(&quot;登录表单&quot;, params);\n        login(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data);\n          }\n        });\n      },\n      startRegister: function () {\n\n        var params = {};\n        params.userName = this.registerForm.userName;\n        params.passWord = this.registerForm.password;\n        params.email = this.registerForm.email;\n        console.log(&quot;登录表单&quot;, params);\n        register(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data);\n          }\n        });\n      },\n      goLogin: function () {\n        console.log(&quot;去登录页面&quot;);\n        this.showLogin = true;\n      },\n      goRegister: function () {\n        console.log(&quot;去注册页面&quot;);\n        this.showLogin = false;\n      },\n      goAuth: function (source) {\n        console.log(&quot;go&quot;, source)\n        var params = new URLSearchParams();\n        params.append(&quot;source&quot;, source);\n        login(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data.url);\n            var token = response.data.token;\n            console.log(response);\n            window.location.href = response.data.url\n          }\n        });\n      },\n      closeLogin: function() {\n        this.$emit(&quot;closeLoginBox&quot;, &quot;&quot;);\n      }\n    }\n  };\n&lt;/script&gt;\n\n\n&lt;style&gt;\n  .box {\n    width: 400px;\n    height: 420px;\n    background: white;\n    position: fixed;\n    margin: auto;\n    left: 0;\n    right: 0;\n    top: 0;\n    bottom: 0;\n    z-index: 1000; /* 要比遮罩层大 */\n  }\n\n  .registerBox {\n    height: 570px;\n  }\n\n  .box .title {\n    height: 48px;\n    font-size: 22px;\n    font-weight: bold;\n    text-align: center;\n    line-height: 48px;\n  }\n  .box .title .t2 {\n    font-size: 16px;\n    float: right;\n    margin-right: 6px;\n    margin-top: -6px;\n    cursor: pointer;\n  }\n\n  .box .el-divider--horizontal {\n    margin: 12px 0;\n  }\n\n  .box .el-form-item__label {\n    margin-left: 10px;\n    font-size: 16px;\n  }\n\n  .box .el-input__inner {\n    margin-left: 10px;\n    width: 90%;\n  }\n\n  .box .btn {\n    text-align: center;\n  }\n\n  .box .loginBtn {\n    width: 40%;\n  }\n\n  .box .registerBtn {\n    width: 40%;\n  }\n\n  .elRow {\n    margin-top: 15px;\n    text-align: center;\n  }\n\n  .loginTip {\n    margin-top: 10px;\n    font-size: 14px;\n    text-align: center;\n    color: #bababa;\n  }\n\n  .remarksBox {\n    position: fixed;\n    left: 50%;\n    margin-left: -100px;\n    top: 50%;\n    margin-top: -50px;\n    border: 1px solid red;\n    width: 200px;\n    height: 100px;\n    text-align: center;\n    z-index: 1000; /* 要比遮罩层大 */\n  }\n\n  /* 遮罩层 */\n  .mask {\n    position: fixed;\n    left: 0;\n    top: 0;\n    width: 100%;\n    height: 100%;\n    background-color: rgba(0, 0, 0, 0.5);\n    z-index: 999;\n  }\n&lt;/style&gt;\n</code></pre>\n<p>下面是运行后的结果如下所示</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156689.png\" alt=\"image-20191230091751151\" /></p>\n<p>因为目前没打算自己制作登录和注册功能，所以用户名、密码、以及登录和注册都被设置成disabled了，下面是引入的接口：login</p>\n<pre><code class=\"language-javascript\">import request from \'@/utils/request\'\n\nexport function login(params) {\n  return request({\n    url: process.env.WEB_API + \'/oauth/render\',\n    method: \'post\',\n    params\n  })\n}\n</code></pre>\n<h2>引入第三方登录</h2>\n<p>完成了前端的页面后，我们就需要撰写后端代码了</p>\n<p>首先需要引入JustAuth的Maven依赖，我们在pom文件中添加对应依赖</p>\n<pre><code class=\"language-xml\">&lt;!--JustAuth第三方登录模块--&gt;\n&lt;dependency&gt;\n    &lt;groupId&gt;me.zhyd.oauth&lt;/groupId&gt;\n    &lt;artifactId&gt;JustAuth&lt;/artifactId&gt;\n    &lt;version&gt;1.13.1&lt;/version&gt;\n&lt;/dependency&gt;\n</code></pre>\n<p>然后在编写定义一个Controller，这里我创建了一个AuthRestApi.java文件</p>\n<pre><code class=\"language-java\">package com.moxi.mogublog.web.restapi;\n\nimport com.alibaba.fastjson.JSONObject;\nimport com.moxi.mogublog.utils.JsonUtils;\nimport com.moxi.mogublog.utils.ResultUtil;\nimport com.moxi.mogublog.utils.StringUtils;\nimport com.moxi.mogublog.web.global.MessageConf;\nimport com.moxi.mogublog.web.global.SQLConf;\nimport com.moxi.mogublog.web.global.SysConf;\nimport com.moxi.mogublog.xo.entity.User;\nimport com.moxi.mogublog.xo.service.UserService;\nimport io.swagger.annotations.Api;\nimport io.swagger.annotations.ApiOperation;\nimport me.zhyd.oauth.config.AuthConfig;\nimport me.zhyd.oauth.exception.AuthException;\nimport me.zhyd.oauth.model.AuthCallback;\nimport me.zhyd.oauth.model.AuthResponse;\nimport me.zhyd.oauth.model.AuthToken;\nimport me.zhyd.oauth.request.AuthGiteeRequest;\nimport me.zhyd.oauth.request.AuthGithubRequest;\nimport me.zhyd.oauth.request.AuthRequest;\nimport me.zhyd.oauth.utils.AuthStateUtils;\nimport org.apache.log4j.LogManager;\nimport org.apache.log4j.Logger;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Value;\nimport org.springframework.data.redis.core.StringRedisTemplate;\nimport org.springframework.web.bind.annotation.GetMapping;\nimport org.springframework.web.bind.annotation.PathVariable;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RestController;\n\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport java.io.IOException;\nimport java.util.HashMap;\nimport java.util.Map;\nimport java.util.concurrent.TimeUnit;\n\n/**\n * 第三方登录认证\n */\n@RestController\n@RequestMapping(&quot;/oauth&quot;)\n@Api(value = &quot;认证RestApi&quot;, tags = {&quot;AuthRestApi&quot;})\npublic class AuthRestApi {\n\n    private static Logger log = LogManager.getLogger(IndexRestApi.class);\n\n    @Autowired\n    private UserService userService;\n    @Value(value = &quot;${justAuth.clientId.gitee}&quot;)\n    private String giteeClienId;\n    @Value(value = &quot;${justAuth.clientSecret.gitee}&quot;)\n    private String giteeClientSecret;\n    @Value(value = &quot;${justAuth.clientId.github}&quot;)\n    private String githubClienId;\n    @Value(value = &quot;${justAuth.clientSecret.github}&quot;)\n    private String githubClientSecret;\n    @Value(value = &quot;${data.webSite.url}&quot;)\n    private String webSiteUrl;\n    @Value(value = &quot;${data.web.url}&quot;)\n    private String moguWebUrl;\n    @Value(value = &quot;${BLOG.USER_TOKEN_SURVIVAL_TIME}&quot;)\n    private Long userTokenSurvivalTime;\n    @Autowired\n    private StringRedisTemplate stringRedisTemplate;\n\n    @ApiOperation(value = &quot;获取认证&quot;, notes = &quot;获取认证&quot;)\n    @RequestMapping(&quot;/render&quot;)\n    public String renderAuth(String source, HttpServletResponse response) throws IOException {\n        log.info(&quot;进入render:&quot; + source);\n        AuthRequest authRequest = getAuthRequest(source);\n        String token = AuthStateUtils.createState();\n        String authorizeUrl = authRequest.authorize(token);\n        Map&lt;String, String&gt; map = new HashMap&lt;&gt;();\n        map.put(SQLConf.URL, authorizeUrl);\n        return ResultUtil.result(SysConf.SUCCESS, map);\n    }\n\n\n    /**\n     * oauth平台中配置的授权回调地址，以本项目为例，在创建gitee授权应用时的回调地址应为：http://127.0.0.1:8603/oauth/callback/gitee\n     */\n    @RequestMapping(&quot;/callback/{source}&quot;)\n    public void login(@PathVariable(&quot;source&quot;) String source, AuthCallback callback, HttpServletRequest request, HttpServletResponse httpServletResponse) throws IOException {\n        log.info(&quot;进入callback：&quot; + source + &quot; callback params：&quot; + JSONObject.toJSONString(callback));\n        AuthRequest authRequest = getAuthRequest(source);\n        AuthResponse response = authRequest.login(callback);\n        String result = JSONObject.toJSONString(response);\n        System.out.println(JSONObject.toJSONString(response));\n\n        Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(result);\n        Map&lt;String, Object&gt; data = JsonUtils.jsonToMap(JsonUtils.objectToJson(map.get(SysConf.DATA)));\n        Map&lt;String, Object&gt; token = JsonUtils.jsonToMap(JsonUtils.objectToJson(data.get(SysConf.TOKEN)));\n        String accessToken = token.get(SysConf.ACCESS_TOKEN).toString();\n        User user = userService.insertUserInfo(request, result);\n\n        if (user != null) {\n            //将从数据库查询的数据缓存到redis中\n            stringRedisTemplate.opsForValue().set(SysConf.USER_TOEKN + SysConf.REDIS_SEGMENTATION + accessToken, JsonUtils.objectToJson(user), userTokenSurvivalTime, TimeUnit.SECONDS);\n        }\n\n        httpServletResponse.sendRedirect(webSiteUrl + &quot;?token=&quot; + accessToken);\n    }\n\n    @RequestMapping(&quot;/revoke/{source}/{token}&quot;)\n    public Object revokeAuth(@PathVariable(&quot;source&quot;) String source, @PathVariable(&quot;token&quot;) String token) throws IOException {\n        AuthRequest authRequest = getAuthRequest(source);\n        return authRequest.revoke(AuthToken.builder().accessToken(token).build());\n    }\n\n    @RequestMapping(&quot;/refresh/{source}&quot;)\n    public Object refreshAuth(@PathVariable(&quot;source&quot;) String source, String token) {\n        AuthRequest authRequest = getAuthRequest(source);\n        return authRequest.refresh(AuthToken.builder().refreshToken(token).build());\n    }\n\n    @ApiOperation(value = &quot;获取用户信息&quot;, notes = &quot;获取用户信息&quot;)\n    @GetMapping(&quot;/verify/{accessToken}&quot;)\n    public String verifyUser(@PathVariable(&quot;accessToken&quot;) String accessToken) {\n        String userInfo = stringRedisTemplate.opsForValue().get(&quot;TOKEN:&quot; + accessToken);\n        if (StringUtils.isEmpty(userInfo)) {\n            return ResultUtil.result(SysConf.ERROR, MessageConf.INVALID_TOKEN);\n        } else {\n            Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(userInfo);\n            return ResultUtil.result(SysConf.SUCCESS, map);\n        }\n    }\n\n    @ApiOperation(value = &quot;删除accessToken&quot;, notes = &quot;删除accessToken&quot;)\n    @RequestMapping(&quot;/delete/{accessToken}&quot;)\n    public String deleteUserAccessToken(@PathVariable(&quot;accessToken&quot;) String accessToken) {\n        stringRedisTemplate.delete(SysConf.USER_TOEKN + SysConf.REDIS_SEGMENTATION + accessToken);\n        return ResultUtil.result(SysConf.SUCCESS, MessageConf.DELETE_SUCCESS);\n    }\n\n\n    private AuthRequest getAuthRequest(String source) {\n        AuthRequest authRequest = null;\n        switch (source) {\n            case SysConf.GITHUB:\n                authRequest = new AuthGithubRequest(AuthConfig.builder()\n                        .clientId(githubClienId)\n                        .clientSecret(githubClientSecret)\n                        .redirectUri(moguWebUrl + &quot;/oauth/callback/github&quot;)\n                        .build());\n                break;\n            case SysConf.GITEE:\n                authRequest = new AuthGiteeRequest(AuthConfig.builder()\n                        .clientId(giteeClienId)\n                        .clientSecret(giteeClientSecret)\n                        .redirectUri(moguWebUrl + &quot;/oauth/callback/gitee&quot;)\n                        .build());\n                break;\n            default:\n                break;\n        }\n        if (null == authRequest) {\n            throw new AuthException(MessageConf.OPERATION_FAIL);\n        }\n        return authRequest;\n    }\n}\n</code></pre>\n<p>application.yml部分配置文件如下所示：</p>\n<pre><code class=\"language-yaml\">data:\n  # 门户页面\n  webSite:\n    url: http://localhost:9527/#/\n  # mogu_web网址，用于第三方登录回调\n  web:\n    url: http://127.0.0.1:8603\n    \n# 第三方登录\njustAuth:\n  clientId:\n    gitee: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX\n    github: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX\n  clientSecret:\n    gitee: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX\n    github: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX    \n</code></pre>\n<p>关于clientId和clientSecret需要到各自的码云和github设置上进行获取：</p>\n<p>在码云中：我们首先进入设置页面，然后选择第三方应用，然后创建应用</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156939.png\" alt=\"image-20191231125943234\" /></p>\n<p>然后开始填写对应的内容</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156977.png\" alt=\"image-20191231130159318\" /></p>\n<p>重新点击第三方应用，获取到对应的ClientID和Client Secret替换即可</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157133.png\" alt=\"image-20191231133512612\" /></p>\n<p>Github上的操作同理，我们需要设置setting，然后选择Developer settings，OAuth Apps：创建一个新的</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157017.png\" alt=\"image-20191231133218598\" /></p>\n<p>这里填写的信息和刚刚码云上差不多</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157055.png\" alt=\"image-20191231133315906\" /></p>\n<p>然后最后在创建成功后复制对应的ClientID和Client Secret即可：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157094.png\" alt=\"image-20191231133422982\" /></p>\n<p>在AuthRestApi中，下面几个方法的主要作用是：</p>\n<ul>\n<li>renderAuth：获取认证，前端通过login方法，即访问的是该接口，然后会创建一个认证请求，里面调用了getAuthRequest方法</li>\n<li>getAuthRequest：该方法需要传入一个source参数，该参数主要是失败用户请求的接口，然后封装一个URL，最后通过renderAuth返回到前台页面中，该方法前端接受后，最终会生成一个URL，然后跳转到对应的页面进行授权即可</li>\n</ul>\n<p>例如下面的vue代码：</p>\n<pre><code>    goAuth: function (source) {\n        var params = new URLSearchParams();\n        params.append(&quot;source&quot;, source);\n        login(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data.url);\n            var token = response.data.token;\n            console.log(response);\n            window.location.href = response.data.url\n          }\n        });\n      },\n</code></pre>\n<p>vue代码，就是通过source判断我点击的按钮，如果是github，那么source为 ”github“，然后调用后台的登录方法，通过传递的source，生成一个授权页面url，最后我们通过window.location.href 跳转到授权页面：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156806.png\" alt=\"image-20191231124501601\" /></p>\n<p>回调的接口如下所示：</p>\n<pre><code class=\"language-java\">    /**\n     * oauth平台中配置的授权回调地址，以本项目为例，在创建gitee授权应用时的回调地址应为：http://127.0.0.1:8603/oauth/callback/gitee\n     */\n    @RequestMapping(&quot;/callback/{source}&quot;)\n    public void login(@PathVariable(&quot;source&quot;) String source, AuthCallback callback, HttpServletRequest request, HttpServletResponse httpServletResponse) throws IOException {\n        log.info(&quot;进入callback：&quot; + source + &quot; callback params：&quot; + JSONObject.toJSONString(callback));\n        AuthRequest authRequest = getAuthRequest(source);\n        AuthResponse response = authRequest.login(callback);\n        String result = JSONObject.toJSONString(response);\n        System.out.println(JSONObject.toJSONString(response));\n\n        Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(result);\n        Map&lt;String, Object&gt; data = JsonUtils.jsonToMap(JsonUtils.objectToJson(map.get(SysConf.DATA)));\n        Map&lt;String, Object&gt; token = JsonUtils.jsonToMap(JsonUtils.objectToJson(data.get(SysConf.TOKEN)));\n        String accessToken = token.get(SysConf.ACCESS_TOKEN).toString();\n        User user = userService.insertUserInfo(request, result);\n\n        if (user != null) {\n            //将从数据库查询的数据缓存到redis中\n            stringRedisTemplate.opsForValue().set(SysConf.USER_TOEKN + SysConf.REDIS_SEGMENTATION + accessToken, JsonUtils.objectToJson(user), userTokenSurvivalTime, TimeUnit.SECONDS);\n        }\n\n        httpServletResponse.sendRedirect(webSiteUrl + &quot;?token=&quot; + accessToken);\n    }\n</code></pre>\n<p>我们需要将得到的用户信息，存储到数据库，同时生成一个token，通过url的方式，传递到前台，然后前台得到token后，通过token获取用户信息：</p>\n<pre><code class=\"language-java\">    @ApiOperation(value = &quot;获取用户信息&quot;, notes = &quot;获取用户信息&quot;)\n    @GetMapping(&quot;/verify/{accessToken}&quot;)\n    public String verifyUser(@PathVariable(&quot;accessToken&quot;) String accessToken) {\n        String userInfo = stringRedisTemplate.opsForValue().get(&quot;TOKEN:&quot; + accessToken);\n        if (StringUtils.isEmpty(userInfo)) {\n            return ResultUtil.result(SysConf.ERROR, MessageConf.INVALID_TOKEN);\n        } else {\n            Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(userInfo);\n            return ResultUtil.result(SysConf.SUCCESS, map);\n        }\n    }\n</code></pre>\n<p>然后在vue项目中，我们只需要判断是否有token通过url传递过来</p>\n<pre><code class=\"language-javascript\"> let token = this.getUrlVars()[&quot;token&quot;];\n      // 判断url中是否含有token\n      if (token != undefined) {\n        setCookie(&quot;token&quot;, token, 1)\n      }\n\n      // 从cookie中获取token\n      token = getCookie(&quot;token&quot;)\n      if (token != undefined) {\n        authVerify(token).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            this.isLogin = true;\n            this.userInfo = response.data;\n          } else {\n            this.isLogin = false;\n            delCookie(&quot;token&quot;);\n          }\n        });\n      } else {\n        this.isLogin = false;\n }\n</code></pre>\n<p>如果有，那么就通过token获取用户信息，登录完成后，就能够看到头像回显了：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156867.png\" alt=\"image-20191231125825022\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'c4c89a69942d1371ae6cbc26ecf5d2c6',0,'2020-04-11 10:12:45','2020-04-11 10:12:45','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('56b991bb35820162e8e8c601a724446f','默认标题','默认简介','<h1>斐波那契数列</h1>\n<h2>题目</h2>\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n<p>n&lt;=39</p>\n<h2>菲波那切数列是什么</h2>\n<pre><code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n<h2>递归方法实现</h2>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n<h3>存在问题</h3>\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588037311991.png\" alt=\"image-20200422211936865\" /></p>\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n<h2>非递归实现</h2>\n<p>我们继续查看刚刚的规律</p>\n<pre><code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-28 09:29:19','2020-04-28 09:29:19','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('5a32e43b6ca40d7342b5fbdd25d28124','默认标题','默认简介','<h1>Spring Security造成Eureka 无法使用iframe的内嵌页面的解决方法</h1>\n<h2>前言</h2>\n<p>最近想写个监控页面，让eureka的管理页面能够嵌入到我们的后台管理中，我们使用<iframe>标签，代码如下所示：</p>\n<pre><code class=\"language-html\">&lt;template&gt;\n  &lt;div class=&quot;app-container&quot;&gt;\n    &lt;iframe  :src=&quot;adminSwaggerUrl&quot; width=&quot;100%&quot; height=&quot;660px;&quot;&gt;&lt;/iframe&gt;\n  &lt;/div&gt;\n&lt;/template&gt;\n\n&lt;script&gt;\n\n  export default {\n\n    data() {\n      return {\n        adminSwaggerUrl: &quot;http://localhost:8761&quot;,\n      }\n    },\n    created() {\n\n    },\n    methods: {\n\n    }\n  }\n&lt;/script&gt;\n</code></pre>\n<p>但是发现无法直接正常显示：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573193914.png\" alt=\"image-20200106095854704\" /></p>\n<p>F12打开调试页面，发现下列的错误信息：</p>\n<pre><code>Refused to display \'http://localhost:8761/\' in a frame because it set \'X-Frame-Options\' to \'deny\'\n</code></pre>\n<p>这是因为Spring Security默认设置X-Frame-Options 为 deny：拒绝</p>\n<h2>X-Frame-Options</h2>\n<p>下面介绍下X-Frame-Options主要用处是用于防止点击劫持，点击劫持（ClickJacking）是一种视觉上的欺骗手段。攻击者使用一个透明的iframe，覆盖在一个网页上，然后诱使用户在网页上进行操作，此时用户将在不知情的情况下点击透明的iframe页面。通过调整iframe页面的位置，可以诱使用户恰好点击在iframe页面的一些功能性按钮上。\nHTTP响应头信息中的X-Frame-Options，可以指示浏览器是否应该加载一个iframe中的页面。如果服务器响应头信息中没有X-Frame-Options，则该网站存在ClickJacking攻击风险。网站可以通过设置X-Frame-Options阻止站点内的页面被其他页面嵌入从而防止点击劫持。</p>\n<p>X-Frame-Options响应头。赋值有如下三种：</p>\n<ul>\n<li>DENY：不能被嵌入到任何iframe或者frame中。</li>\n<li>SAMEORIGIN：页面只能被本站页面嵌入到iframe或者frame中</li>\n<li>ALLOW-FROM uri：只能被嵌入到指定域名的框架中</li>\n</ul>\n<h2>解决方案</h2>\n<p>从这里就可以看到，是因为Spring Security默认设置X-Frame-Options响应头是 DENY，也就是不能被嵌入到任何iframe中，这也造成了我们无法正常显示eureka页面，所以我们需要在Spring Security的配置文件中设置关闭X-Frame-Options即可，也就是加入下面这句</p>\n<pre><code>.headers().frameOptions().disable();\n</code></pre>\n<p>完整代码如下：</p>\n<pre><code class=\"language-java\">package com.moxi.mogublog.eureka.config;\n\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.security.config.annotation.web.builders.HttpSecurity;\nimport org.springframework.security.config.annotation.web.configuration.EnableWebSecurity;\nimport org.springframework.security.config.annotation.web.configuration.WebSecurityConfigurerAdapter;\nimport org.springframework.security.config.http.SessionCreationPolicy;\n\n/**\n * WebSecurityConfig\n *\n * @author: 陌溪\n * @create: 2019-12-21-19:20\n */\n@Configuration\n@EnableWebSecurity\npublic class WebSecurityConfig extends WebSecurityConfigurerAdapter {\n\n    /**\n     * 高版本的丢弃了\n     * &lt;p&gt;\n     * security:\n     * basic:\n     * enabled: true\n     * &lt;p&gt;\n     * 配置，应该使用以下方式开启\n     *\n     * @param http\n     * @throws Exception\n     */\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        // Configure HttpSecurity as needed (e.g. enable http basic).\n        http.sessionManagement().sessionCreationPolicy(SessionCreationPolicy.NEVER);\n        http.csrf().disable()\n        .headers().frameOptions().disable();\n\n        //注意：为了可以使用 http://${user}:${password}@${host}:${port}/eureka/ 这种方式登录,所以必须是httpBasic,\n        // 如果是form方式,不能使用url格式登录\n        http.authorizeRequests().anyRequest().authenticated().and().httpBasic();\n    }\n\n}\n</code></pre>\n<p>添加后，就能够正常显示页面了：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573194002.png\" alt=\"image-20200106101231543\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:47:05','2020-04-11 10:47:05','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('5b9a6b834ad2fef5f75aa08234bd7783','默认标题','默认简介','<h1>斐波那契数列</h1>\n<h2>题目</h2>\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n<p>n&lt;=39</p>\n<h2>菲波那切数列是什么</h2>\n<pre><code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n<h2>递归方法实现</h2>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n<h3>存在问题</h3>\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036791663.png\" alt=\"image-20200422211936865\" /></p>\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n<h2>非递归实现</h2>\n<p>我们继续查看刚刚的规律</p>\n<pre><code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-28 09:23:23','2020-04-28 09:23:23','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('6028bd1b5693bcb93517ac38864cc816','我是默认标题','默认简介','<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586567934013.png\" alt=\"\" /></p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586567934176.png\" alt=\"image-20200411085724059\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-11 09:22:43','2020-04-11 09:22:43',NULL,'1','陌溪',NULL,'1ec7047fe5c672d7c756bf79405cd04b',0,'0',0,1),('62084b220981cabd6b502f7ba7267003','默认标题','默认简介','<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:15:54','2020-04-11 10:15:54','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('6b2ff45da8f4a591f0dc0173d3d418d6','1234','1234','<p>1234</p>\n','6b0ba63beabccc91c4f8fb938984f8a3',0,0,'dca06b7785df4434091e70a0527fd9a4',0,'2020-04-23 21:10:09','2020-04-23 21:10:09','1723ad77a1ca06b29a011471036a2dd6','1','test1','蘑菇博客','1ec7047fe5c672d7c756bf79405cd04b',0,'1',0,1),('6b479e295387c8b267befef903f5fb94','我是默认标题','默认简介','<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586567213555.png\" alt=\"\" /></p>\n<p><img src=\"http://localhost:8600/null\" alt=\"image-20200411085724059\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-11 09:07:07','2020-04-11 09:07:07',NULL,'1','陌溪',NULL,'1ec7047fe5c672d7c756bf79405cd04b',0,'0',0,1),('6f8da0eedfef73419297a6b5cae98e70','默认标题','默认简介','<h1>斐波那契数列</h1>\n<h2>题目</h2>\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n<p>n&lt;=39</p>\n<h2>菲波那切数列是什么</h2>\n<pre><code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n<h2>递归方法实现</h2>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n<h3>存在问题</h3>\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036791663.png\" alt=\"image-20200422211936865\" /></p>\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n<h2>非递归实现</h2>\n<p>我们继续查看刚刚的规律</p>\n<pre><code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-28 09:22:36','2020-04-28 09:22:36','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('710dac2d4eaf8e6b4ff819e072974eaf','我是默认标题','默认简介','<p><img src=\"blog/admin/png/2020/4/11/1586535313682.png\" alt=\"\" /></p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-11 00:15:18','2020-04-11 00:15:18',NULL,'1','陌溪',NULL,'1ec7047fe5c672d7c756bf79405cd04b',0,'0',0,1),('717a5b80cbacb37a1c74535b8bc537c9','默认标题','默认简介','<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"images/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"images/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"images/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"images/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"images/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"images/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"images/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"images/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"images/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"images/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-11 10:43:49','2020-04-11 10:43:49','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('71ae9fa8ec228bbe1e460e541d0fdf75','df',' 飞','<p>发送</p>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,NULL,0,'2020-04-23 15:23:44','2020-04-23 15:23:44','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','1ec7047fe5c672d7c756bf79405cd04b',0,'1',0,1),('732886f96bfd74643c23018b3f870957','测试3','测试3','<p>测试3</p>\n','5c4c541e600ff422ccb371ee788f59d6',2,1,'cc9952f52c84dfa51d74ee35a1dc5367',1,'2020-04-26 13:32:51','2020-04-26 13:32:57','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',1,'1',2,1),('788050d0b0144aa6f8da2c6b2486a5a9','默认标题','默认简介','<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036728348.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-28 09:18:59','2020-04-28 09:18:59','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('7da7f728049fe9dc6c4bc23b9babb2cc','123','123','<p>123</p>\n','6b0ba63beabccc91c4f8fb938984f8a3',0,0,NULL,0,'2020-04-23 15:49:59','2020-04-23 15:49:59','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'1',0,1),('80caffbded55c0fe88a906b11ae56302','默认标题','默认简介','<h1>两个栈实现一个队列</h1>\n<h2>题目描述</h2>\n<p>用两个栈来实现一个队列，完成队列的Push和Pop操作。 队列中的元素为int类型。</p>\n<h2>思考</h2>\n<p>栈：先进后出</p>\n<p>队列：先进先出.</p>\n<p><img src=\"images/image-20200423094525763.png\" alt=\"image-20200423094525763\" /></p>\n<p>我们需要使用一个栈用于接收数据，并且一个栈用于输出数据</p>\n<h2>代码</h2>\n<pre><code>class Solution:\n    def __init__(self):\n        # 接收栈\n        self.acceptStack = []\n        # 输出栈\n        self.outputStack = []\n\n    def push(self, node):\n        # 把节点放到栈中\n        self.acceptStack.append(node)\n\n    def pop(self):\n        # 从接收栈中获取元素，把它放入到 输出栈中\n        if self.outputStack == []:\n            while self.acceptStack:\n                self.outputStack.append(self.acceptStack.pop())\n\n        # 判断输出栈中是否有元素，有，则输出最后一个\n        if self.outputStack != []:\n            return self.outputStack.pop()\n        else:\n            return None\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-27 22:12:03','2020-04-27 22:12:03','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'0',0,1),('82496a880ae665409ee4cd78b743157a','默认标题','默认简介','<h1>斐波那契数列</h1>\n\n<h2>题目</h2>\n\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n\n<p>n&lt;=39</p>\n\n<h2>菲波那切数列是什么</h2>\n\n<pre>\n<code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n\n<h2>递归方法实现</h2>\n\n<pre>\n<code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n\n<h3>存在问题</h3>\n\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n\n<p><img alt=\"image-20200422211936865\" src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587990240589.png\" /></p>\n\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n\n<h2>非递归实现</h2>\n\n<p>我们继续查看刚刚的规律</p>\n\n<pre>\n<code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n\n<pre>\n<code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',1,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'2020-04-27 20:24:09','2020-04-27 20:24:27','1f01cd1d2f474743b241d74008b12333','1','陌溪','蘑菇博客','718c76d4a84e408da23e04949a75e7e8',0,'1',0,1),('86da4c8c89545c426194c2f2582a6df9','测试博客3','测试博客3','<p>测试博客3</p>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<thead>\n		<tr>\n			<th scope=\"col\">测试</th>\n			<th scope=\"col\">测试</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>1</td>\n			<td>2</td>\n		</tr>\n		<tr>\n			<td>3</td>\n			<td>4</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n','5c4c541e600ff422ccb371ee788f59d6',7,1,'3dab9866f9ac1867d3845918d4b5b748',0,'2020-03-31 22:41:23','2020-04-07 15:46:16','1f01cd1d2f474743b241d74008b12333','1','admin','蘑菇博客','1ec7047fe5c672d7c756bf79405cd04b',0,'1',0,1),('880a639534746d5b8021a4ff33bfd92c','默认标题','默认简介','<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036728348.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n','5c4c541e600ff422ccb371ee788f59d6',0,0,'d134bdfe255b9aa8c2ce44da8297f6a6',0,'