  `reply` varchar(255) DEFAULT NULL COMMENT '回复',
  `admin_uid` varchar(32) DEFAULT NULL COMMENT '管理员uid',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='反馈表';

