ortUid\":\"481b95ba5cce396c9ec14544b0784751\",\"picName\":\"undefined\",\"fileUid\":\"2ebda235685f7167ac8db271bfa6ded3\"}','编辑图片',1,'2020-03-24 09:04:22','2020-03-24 09:04:22','XX|XX|内网IP|内网IP',65),('387fa74656e812519968bea906480bd2','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@272f440d]}','本地博客上传',1,'2020-04-15 17:27:34','2020-04-15 17:27:34','XX|XX|内网IP|内网IP',34),('3992536df5cb903dc4f0d7413c906c2a','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/deleteBatch','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','deleteBatch','{\"blogVoList\":[BlogVO(title=默认标题, summary=默认简介, content=<h1>Spring Security造成Eureka 无法使用iframe的内嵌页面的解决方法</h1>\n<h2>前言</h2>\n<p>最近想写个监控页面，让eureka的管理页面能够嵌入到我们的后台管理中，我们使用<iframe>标签，代码如下所示：</p>\n<pre><code class=\"language-html\">&lt;template&gt;\n  &lt;div class=&quot;app-container&quot;&gt;\n    &lt;iframe  :src=&quot;adminSwaggerUrl&quot; width=&quot;100%&quot; height=&quot;660px;&quot;&gt;&lt;/iframe&gt;\n  &lt;/div&gt;\n&lt;/template&gt;\n\n&lt;script&gt;\n\n  export default {\n\n    data() {\n      return {\n        adminSwaggerUrl: &quot;http://localhost:8761&quot;,\n      }\n    },\n    created() {\n\n    },\n    methods: {\n\n    }\n  }\n&lt;/script&gt;\n</code></pre>\n<p>但是发现无法直接正常显示：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573331917.png\" alt=\"image-20200106095854704\" /></p>\n<p>F12打开调试页面，发现下列的错误信息：</p>\n<pre><code>Refused to display \'http://localhost:8761/\' in a frame because it set \'X-Frame-Options\' to \'deny\'\n</code></pre>\n<p>这是因为Spring Security默认设置X-Frame-Options 为 deny：拒绝</p>\n<h2>X-Frame-Options</h2>\n<p>下面介绍下X-Frame-Options主要用处是用于防止点击劫持，点击劫持（ClickJacking）是一种视觉上的欺骗手段。攻击者使用一个透明的iframe，覆盖在一个网页上，然后诱使用户在网页上进行操作，此时用户将在不知情的情况下点击透明的iframe页面。通过调整iframe页面的位置，可以诱使用户恰好点击在iframe页面的一些功能性按钮上。\nHTTP响应头信息中的X-Frame-Options，可以指示浏览器是否应该加载一个iframe中的页面。如果服务器响应头信息中没有X-Frame-Options，则该网站存在ClickJacking攻击风险。网站可以通过设置X-Frame-Options阻止站点内的页面被其他页面嵌入从而防止点击劫持。</p>\n<p>X-Frame-Options响应头。赋值有如下三种：</p>\n<ul>\n<li>DENY：不能被嵌入到任何iframe或者frame中。</li>\n<li>SAMEORIGIN：页面只能被本站页面嵌入到iframe或者frame中</li>\n<li>ALLOW-FROM uri：只能被嵌入到指定域名的框架中</li>\n</ul>\n<h2>解决方案</h2>\n<p>从这里就可以看到，是因为Spring Security默认设置X-Frame-Options响应头是 DENY，也就是不能被嵌入到任何iframe中，这也造成了我们无法正常显示eureka页面，所以我们需要在Spring Security的配置文件中设置关闭X-Frame-Options即可，也就是加入下面这句</p>\n<pre><code>.headers().frameOptions().disable();\n</code></pre>\n<p>完整代码如下：</p>\n<pre><code class=\"language-java\">package com.moxi.mogublog.eureka.config;\n\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.security.config.annotation.web.builders.HttpSecurity;\nimport org.springframework.security.config.annotation.web.configuration.EnableWebSecurity;\nimport org.springframework.security.config.annotation.web.configuration.WebSecurityConfigurerAdapter;\nimport org.springframework.security.config.http.SessionCreationPolicy;\n\n/**\n * WebSecurityConfig\n *\n * @author: 陌溪\n * @create: 2019-12-21-19:20\n */\n@Configuration\n@EnableWebSecurity\npublic class WebSecurityConfig extends WebSecurityConfigurerAdapter {\n\n    /**\n     * 高版本的丢弃了\n     * &lt;p&gt;\n     * security:\n     * basic:\n     * enabled: true\n     * &lt;p&gt;\n     * 配置，应该使用以下方式开启\n     *\n     * @param http\n     * @throws Exception\n     */\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        // Configure HttpSecurity as needed (e.g. enable http basic).\n        http.sessionManagement().sessionCreationPolicy(SessionCreationPolicy.NEVER);\n        http.csrf().disable()\n        .headers().frameOptions().disable();\n\n        //注意：为了可以使用 http://${user}:${password}@${host}:${port}/eureka/ 这种方式登录,所以必须是httpBasic,\n        // 如果是form方式,不能使用url格式登录\n        http.authorizeRequests().anyRequest().authenticated().and().httpBasic();\n    }\n\n}\n</code></pre>\n<p>添加后，就能够正常显示页面了：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573332039.png\" alt=\"image-20200106101231543\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>Spring Security造成Eureka 无法使用iframe的内嵌页面的解决方法</h1>\n<h2>前言</h2>\n<p>最近想写个监控页面，让eureka的管理页面能够嵌入到我们的后台管理中，我们使用<iframe>标签，代码如下所示：</p>\n<pre><code class=\"language-html\">&lt;template&gt;\n  &lt;div class=&quot;app-container&quot;&gt;\n    &lt;iframe  :src=&quot;adminSwaggerUrl&quot; width=&quot;100%&quot; height=&quot;660px;&quot;&gt;&lt;/iframe&gt;\n  &lt;/div&gt;\n&lt;/template&gt;\n\n&lt;script&gt;\n\n  export default {\n\n    data() {\n      return {\n        adminSwaggerUrl: &quot;http://localhost:8761&quot;,\n      }\n    },\n    created() {\n\n    },\n    methods: {\n\n    }\n  }\n&lt;/script&gt;\n</code></pre>\n<p>但是发现无法直接正常显示：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573193914.png\" alt=\"image-20200106095854704\" /></p>\n<p>F12打开调试页面，发现下列的错误信息：</p>\n<pre><code>Refused to display \'http://localhost:8761/\' in a frame because it set \'X-Frame-Options\' to \'deny\'\n</code></pre>\n<p>这是因为Spring Security默认设置X-Frame-Options 为 deny：拒绝</p>\n<h2>X-Frame-Options</h2>\n<p>下面介绍下X-Frame-Options主要用处是用于防止点击劫持，点击劫持（ClickJacking）是一种视觉上的欺骗手段。攻击者使用一个透明的iframe，覆盖在一个网页上，然后诱使用户在网页上进行操作，此时用户将在不知情的情况下点击透明的iframe页面。通过调整iframe页面的位置，可以诱使用户恰好点击在iframe页面的一些功能性按钮上。\nHTTP响应头信息中的X-Frame-Options，可以指示浏览器是否应该加载一个iframe中的页面。如果服务器响应头信息中没有X-Frame-Options，则该网站存在ClickJacking攻击风险。网站可以通过设置X-Frame-Options阻止站点内的页面被其他页面嵌入从而防止点击劫持。</p>\n<p>X-Frame-Options响应头。赋值有如下三种：</p>\n<ul>\n<li>DENY：不能被嵌入到任何iframe或者frame中。</li>\n<li>SAMEORIGIN：页面只能被本站页面嵌入到iframe或者frame中</li>\n<li>ALLOW-FROM uri：只能被嵌入到指定域名的框架中</li>\n</ul>\n<h2>解决方案</h2>\n<p>从这里就可以看到，是因为Spring Security默认设置X-Frame-Options响应头是 DENY，也就是不能被嵌入到任何iframe中，这也造成了我们无法正常显示eureka页面，所以我们需要在Spring Security的配置文件中设置关闭X-Frame-Options即可，也就是加入下面这句</p>\n<pre><code>.headers().frameOptions().disable();\n</code></pre>\n<p>完整代码如下：</p>\n<pre><code class=\"language-java\">package com.moxi.mogublog.eureka.config;\n\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.security.config.annotation.web.builders.HttpSecurity;\nimport org.springframework.security.config.annotation.web.configuration.EnableWebSecurity;\nimport org.springframework.security.config.annotation.web.configuration.WebSecurityConfigurerAdapter;\nimport org.springframework.security.config.http.SessionCreationPolicy;\n\n/**\n * WebSecurityConfig\n *\n * @author: 陌溪\n * @create: 2019-12-21-19:20\n */\n@Configuration\n@EnableWebSecurity\npublic class WebSecurityConfig extends WebSecurityConfigurerAdapter {\n\n    /**\n     * 高版本的丢弃了\n     * &lt;p&gt;\n     * security:\n     * basic:\n     * enabled: true\n     * &lt;p&gt;\n     * 配置，应该使用以下方式开启\n     *\n     * @param http\n     * @throws Exception\n     */\n    @Override\n    protected void configure(HttpSecurity http) throws Exception {\n        // Configure HttpSecurity as needed (e.g. enable http basic).\n        http.sessionManagement().sessionCreationPolicy(SessionCreationPolicy.NEVER);\n        http.csrf().disable()\n        .headers().frameOptions().disable();\n\n        //注意：为了可以使用 http://${user}:${password}@${host}:${port}/eureka/ 这种方式登录,所以必须是httpBasic,\n        // 如果是form方式,不能使用url格式登录\n        http.authorizeRequests().anyRequest().authenticated().and().httpBasic();\n    }\n\n}\n</code></pre>\n<p>添加后，就能够正常显示页面了：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573194002.png\" alt=\"image-20200106101231543\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>Eureka管理页面配置/actuator/info接口返回git信息</h1>\n<h2>前言</h2>\n<p>这阵子在弄监控页面，我点击eureka里面的地址</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573092808.png\" alt=\"image-20200107213729955\" /></p>\n<p>发现进去的页面没有 任何内容显示，后面想想可能是没有什么东西没有配置而引起的</p>\n<p>通过查阅资料发现，微服务若是用git管理，当前微服务部署的git的版本信息是不可或缺的信息，spring boot admin中通过/actuator/info接口返回git基本信息。该接口若要返回git信息，首先需要引入Actuator依赖</p>\n<pre><code>&lt;!-- 使用Actuator的/info端点输出Git版本 --&gt;\n&lt;dependency&gt;\n    &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n    &lt;artifactId&gt;spring-boot-starter-actuator&lt;/artifactId&gt;\n&lt;/dependency&gt;\n</code></pre>\n<p>同时需要添加git-commit-id-plugin插件</p>\n<pre><code>            &lt;plugin&gt;\n                &lt;groupId&gt;pl.project13.maven&lt;/groupId&gt;\n                &lt;artifactId&gt;git-commit-id-plugin&lt;/artifactId&gt;\n                &lt;version&gt;2.1.15&lt;/version&gt;\n                &lt;executions&gt;\n                    &lt;execution&gt;\n                        &lt;goals&gt;\n                            &lt;goal&gt;revision&lt;/goal&gt;\n                        &lt;/goals&gt;\n                    &lt;/execution&gt;\n                &lt;/executions&gt;\n                &lt;configuration&gt;\n                    &lt;dotGitDirectory&gt;${project.basedir}/.git&lt;/dotGitDirectory&gt;\n                &lt;/configuration&gt;\n            &lt;/plugin&gt;\n</code></pre>\n<p>添加完成后，我们查看IDEA的Maven，能够发现多出了一个 git-commit-id:revision</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573092935.png\" alt=\"image-20200107214012195\" /></p>\n<p>我们点击后，在<code>target/classes</code>目录下，我们可以发现产生了一个<code>git.properties</code>配置信息：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573093056.png\" alt=\"image-20200107214404474\" /></p>\n<p>里面的内容就是当前项目的git信息：</p>\n<pre><code>#Generated by Git-Commit-Id-Plugin\n#Tue Jan 07 21:25:46 CST 2020\ngit.build.user.email=xzx19950624@qq.com\ngit.build.host=DESKTOP-DIA5I1I\ngit.dirty=true\ngit.remote.origin.url=https\\://github.com/moxi624/mogu_blog_v2.git\ngit.closest.tag.name=\ngit.commit.id.describe-short=6f1ef9e-dirty\ngit.commit.user.email=xzx19950624@qq.com\ngit.commit.time=2020-01-07T19\\:58\\:26+0800\ngit.commit.message.full=update banner\ngit.build.version=0.0.1-SNAPSHOT\ngit.commit.message.short=update banner\ngit.commit.id.abbrev=6f1ef9e\ngit.branch=dev\ngit.build.user.name=陌溪_\ngit.closest.tag.commit.count=\ngit.commit.id.describe=6f1ef9e-dirty\ngit.commit.id=6f1ef9e48bbd0f3cb825b7934152dde21d821456\ngit.tags=\ngit.build.time=2020-01-07T21\\:25\\:46+0800\ngit.commit.user.name=陌溪_\n\n</code></pre>\n<p>然后启动eureka页面，在点击刚刚的a标签，发现能够成功获取到git信息了</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586573093007.png\" alt=\"image-20200107214142962\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"images/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"images/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"images/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"images/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"images/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"images/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"images/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"images/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"images/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"images/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"images/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"images/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"images/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"images/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"images/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"images/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"images/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"images/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"images/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"images/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"images/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)]}','删除选中博客',1,'2020-04-11 10:50:05','2020-04-11 10:50:05','XX|XX|内网IP|内网IP',162),('3998ac4f035f6908cee42fb376212122','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@71cea743]}','本地博客上传',1,'2020-04-10 18:47:16','2020-04-10 18:47:16','XX|XX|内网IP|内网IP',36570),('3cb248f36db3c8fee304dd9077bc2a8a','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blogSort/add','POST','com.moxi.mogublog.admin.restapi.BlogSortRestApi','add','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"blogSortVO\":BlogSortVO(sortName=测试1, content=测试1, sort=0)}','增加博客分类',1,'2020-03-31 19:58:41','2020-03-31 19:58:41','XX|XX|内网IP|内网IP',149),('3cce797e5933ddaae198ac5d0f6d5e07','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','