ictureSortUid=c268ec41fec675b2421e49802cf348b8)}','增加图片',1,'2020-04-19 19:08:50','2020-04-19 19:08:50','XX|XX|内网IP|内网IP',54),('499c457e887737a96ae7ab2027165be9','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[]}','本地博客上传',1,'2020-04-10 11:40:33','2020-04-10 11:40:33','XX|XX|内网IP|内网IP',2),('49a6b449211514dd02eb6c2858361021','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":null}','本地博客上传',1,'2020-04-10 12:06:58','2020-04-10 12:06:58','XX|XX|内网IP|内网IP',4),('49ddfc0fbab238d7128e31a68050350c','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/edit','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','edit','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"blogVO\":BlogVO(title=默认标题, summary=默认简介, content=<h1>http和https</h1>\n\n<h2>http</h2>\n\n<p>http是一种无状态协议。无状态是指客户机和服务器之间不需要建立持久连接，这意味着当一个客户端向服务器发出请求，然后服务器返回响应（response），连接就被关闭了，在服务器端不保留连接的有关信息，HTTP遵循请求/应答模型。客户机向服务器发送请求，服务器处理请求并返回适当的应答。所有HTTP连接都构成一套请求和应答。</p>\n\n<h2>https</h2>\n\n<p>HTTPS是以安全为目标的HTTP通道，简单将就是HTTP的安全版。即HTTP下加入SSL层，HTTPS的安全基础是SSL。其所用的端口是443，过程大致如下：</p>\n\n<h3>获取连接证书</h3>\n\n<p>SSL客户端通过TCP和服务器建立连接后（443端口），并且在一般的TCP连接协商过程中请求证书。即客户端发出一个消息给服务器，这个消息里面包含了自己可实现的算法列表和其它一些需要的消息，SSL的服务器端会回应一个数据包，这里面确定了这次通信所需要的算法，然后服务器向客户端返回证书。（证书里面包含了服务器信息：域名。申请证书的公司，公共密钥）</p>\n\n<h3>证书验证</h3>\n\n<p>客户端在收到服务器返回的证书后，判断签发这个证书的公共签发机构，并使用这个机构的公共密钥确认签名是否有效，客户端还会确保证书中列出的域名就是它正在连接的域名</p>\n\n<h3>数据加密和传输</h3>\n\n<p>如果确认证书有效，那么生成对称密钥并使用服务器的公共密钥进行加密。然后发送给服务器，服务器使用它的密钥进行解密，这样两台计算机可以开始进行对称加密进行通信。</p>\n\n<p><img alt=\"image-20200413085448943\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821524.png\" /></p>\n\n<p>对称加密：是指加密和解密用的都是同一个密钥，目前微信小程序采用的就是这个加密方式</p>\n\n<h3>对称加密存在的问题</h3>\n\n<p>首先我们知道对称加密是指：加密和解密都使用的同一个密钥，这种方式存在的最大的问题就是密钥发送问题，即如果安全的将密钥发送给对方。</p>\n\n<h4>为什么叫对称加密？</h4>\n\n<p>一方通过密钥将信息加密后，把密文传给另一个方，另一方通过这个相同的密钥将密文解密，转换成可以理解的明文。他们之间的关系如下</p>\n\n<blockquote>\n<p>明文 -&gt; 密钥 -&gt; 密文</p>\n</blockquote>\n\n<p>但是从上面的图我们可以看出，我们在进行加密后，首先需要将密钥发送给服务器，那么这个过程就可能存在危险的</p>\n\n<p><img alt=\"image-20200413091318404\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821727.png\" /></p>\n\n<h3>非对称加密</h3>\n\n<p>上面提到的是对称加密，其实还有一种是非对称加密，非对称加密是通过两个密钥（公钥 - 私钥）来实现对数据的加密和解密的，公钥用于加密，私钥用于解密。</p>\n\n<p><img alt=\"image-20200413085937800\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821663.png\" /></p>\n\n<p>过程如下：</p>\n\n<p>首先服务器会颁发一个公钥放在网络中，同时它自己还有一份私钥，然后客户端可以直接获取到对应的公钥</p>\n\n<p>然后将客户端的数据进行公钥的加密，加密后传输的服务器中，服务器在进行私钥解密，得到最终的数据</p>\n\n<p><img alt=\"image-20200413102124070\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821777.png\" /></p>\n\n<p>由于非对称加密的方式不需要发送用来解密的私钥，所以可以保证安全性，但是和对称加密比起来，它非常慢，所以我们还是要用对称加密来传送消息，但是对称加密使用的密钥我们通过非对称加密的方式发送出去。这个结果就变成了：</p>\n\n<p><img alt=\"image-20200413102622594\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821827.png\" /></p>\n\n<p>但是我们需要注意的是，此时交换的两个公钥不一定正确，因为可能会被中间人截获，同时掉包</p>\n\n<p>例如：中间人虽然不知道小红的私钥是什么，但是在截获了小红的公钥Key1之后，却可以偷天换日，自己另外生成一对公钥私钥，把自己的公钥Key3发送给小灰。</p>\n\n<p><img alt=\"image-20200413102718466\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821885.png\" /></p>\n\n<p>这一次通信再次被中间人截获，中间人先用自己的私钥解开了Key3的加密，获得Key2，然后再用当初小红发来的Key1重新加密，再发给小红</p>\n\n<p><img alt=\"image-20200413102738635\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821913.png\" /></p>\n\n<h3>证书机制</h3>\n\n<p>这个时候我们需要做的就是从指定的机构出获取公钥，而不是任由其在网络传输</p>\n\n<ul>\n	<li>作为服务器端的小红，首先先把自己的公钥给证书颁发机构，向证书颁发机构申请证书</li>\n	<li>证书颁发机构自己也有一堆公钥和私钥。机构利用自己的私钥来解密Key1，通过服务端网址等信息生成一个证书签名，证书签名同样经过机构的私钥加密。证书制作完成后，机构把证书发送给服务端的小红。</li>\n	<li>当小灰向小红请求通信的时候，小红不再直接返回自己的公钥，而是把自己申请的证书返回给小灰。</li>\n	<li>小灰收到证书以后，要做的第一件事就是验证证书的真伪，需要说明的是，各大浏览器和操作系统已经维护了所有权威证书机构的名称和公钥，所以小灰只需要知道是哪个机构颁发的证书，就可以从本地找到对应的机构公钥，解密出证书签名。</li>\n</ul>\n\n<p><img alt=\"image-20200413103251089\" src=\"http://localhost:8600/blog/admin/png/2020/4/13/1586769821975.png\" /></p>\n\n<h2>参考</h2>\n\n<p>https://blog.csdn.net/jiangshangchunjiezi/article/details/88545263</p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)}','编辑博客',1,'2020-04-20 21:22:13','2020-04-20 21:22:13','XX|XX|内网IP|内网IP',189),('4a068671ff5a4c888898e0dea9c7f56b','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@39ee1081]}','本地博客上传',1,'2020-04-11 09:17:47','2020-04-11 09:17:47','XX|XX|内网IP|内网IP',8842),('4a4690e79f354aa251540794e4e5942c','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/pictureSort/getPictureSortByUid','POST','com.moxi.mogublog.admin.restapi.PictureSortRestApi','getPictureSortByUid','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"pictureSortVO\":PictureSortVO(parentUid=null, name=null, fileUid=null, sort=0)}','通过Uid获取分类',1,'2020-04-07 15:54:20','2020-04-07 15:54:20','XX|XX|内网IP|内网IP',6),('4aca1d1d25435657d5e2c7938efe33f8','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/delete','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','delete','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"blogVO\":BlogVO(title=null, summary=null, content=null, tagUid=null, blogSortUid=null, fileUid=null, adminUid=null, isPublish=null, isOriginal=null, author=null,