stapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@75cc6dcd]}','本地博客上传',1,'2020-04-10 09:22:26','2020-04-10 09:22:26','XX|XX|内网IP|内网IP',39230),('53f66ef6e9319cd6b6ebca5d92f550ab','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@36cddf6b]}','本地博客上传',1,'2020-04-11 10:43:49','2020-04-11 10:43:49','XX|XX|内网IP|内网IP',716),('5448aaeb02f0d8ed5a3ef488737fe73b','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/deleteBatch','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','deleteBatch','{\"blogVoList\":[BlogVO(title=默认标题, summary=默认简介, content=<h1>主要特性</h1>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532809883.png\" alt=\"img\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n\n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532838610.png\" alt=\"img\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532855864.png\" alt=\"img\" /></p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532865716.png\" alt=\"img\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。 这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。 然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e; 然后是e = next，导致了e指向了key(7)， 而下一次循环的next = e.next导致了next指向了key(3) 注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532880409.png\" alt=\"img\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532894138.png\" alt=\"img\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。 e.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532906785.png\" alt=\"img\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532920198.png\" alt=\"img\" /></p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532929437.png\" alt=\"img\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532942126.png\" alt=\"img\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532954258.png\" alt=\"img\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log2n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"http://picture.moguit.cn//blog/admin/png/2020/4/10/1586532964536.png\" alt=\"img\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>SpringBoot+Vue如何集成第三方登录登录JustAuth</h1>\n<h2>前言</h2>\n<p>这两天打算给蘑菇博客增加第三方登录模块，所有对目前的第三方登录的Github和Gitee中的Demo进行的调查，发现在gitee有个做的非常不错的项目：史上最全的整合第三方登录的开源库。目前已支持Github、Gitee、微博、钉钉、百度、Coding、腾讯云开发者平台、OSChina、支付宝、QQ、微信、淘宝、Google、Facebook、抖音、领英、小米、微软、今日头条、Teambition、StackOverflow、Pinterest、人人、华为、企业微信、酷家乐、Gitlab、美团、饿了么和推特等第三方平台的授权登录。 Login, so easy!</p>\n<p>JustAuth仓库：https://gitee.com/yadong.zhang/JustAuth</p>\n<p>JustAuth文档：https://docs.justauth.whnb.wang/#/</p>\n<h2>编写登录页面Vue样式和代码</h2>\n<p>首先需要编写一个登录框代码，下面是使用vue创建了一个组件 LoginBox，同时里面还引入了阿里矢量库中的几个图标，感兴趣的小伙伴可以查看这篇博客：<a href=\"http://moguit.cn/#/info?blogUid=1310f62f726ef0892e1de19bc14bba09\">Vue项目使用阿里巴巴矢量图标库</a></p>\n<pre><code class=\"language-vue\">&lt;template&gt;\n  &lt;div&gt;\n    &lt;div class=&quot;box loginBox&quot; v-if=&quot;showLogin == true&quot;&gt;\n      &lt;div class=&quot;title&quot;  &gt;\n        &lt;span class=&quot;t1&quot;&gt;\n          登录\n        &lt;/span&gt;\n        &lt;div class=&quot;t2&quot; @click=&quot;closeLogin()&quot;&gt;\n          X\n        &lt;/div&gt;\n      &lt;/div&gt;\n      &lt;el-divider&gt;&lt;/el-divider&gt;\n      &lt;el-form :label-position=&quot;labelPosition&quot; :model=&quot;loginForm&quot;&gt;\n        &lt;el-form-item label=&quot;用户名&quot;&gt;\n          &lt;el-input v-model=&quot;loginForm.userName&quot; disabled&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n        &lt;el-form-item label=&quot;密码&quot;&gt;\n          &lt;el-input type=&quot;password&quot; v-model=&quot;loginForm.password&quot; disabled&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n        &lt;el-row class=&quot;btn&quot;&gt;\n          &lt;el-button class=&quot;loginBtn&quot; type=&quot;primary&quot; @click=&quot;startLogin&quot; disabled&gt;登录&lt;/el-button&gt;\n          &lt;el-button class=&quot;registerBtn&quot; type=&quot;info&quot; @click=&quot;goRegister&quot; disabled&gt;注册&lt;/el-button&gt;\n        &lt;/el-row&gt;\n\n        &lt;el-row class=&quot;elRow&quot;&gt;\n          &lt;el-tooltip content=&quot;码云&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;danger&quot; circle @click=&quot;goAuth(\'gitee\')&quot;&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe602;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n          &lt;el-tooltip content=&quot;Github&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;info&quot; circle @click=&quot;goAuth(\'github\')&quot;&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe64a;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n          &lt;el-tooltip content=&quot;QQ&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;primary&quot; circle disabled&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe601;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n          &lt;el-tooltip content=&quot;微信&quot; placement=&quot;bottom&quot;&gt;\n            &lt;el-button type=&quot;success&quot; circle disabled&gt;\n              &lt;span class=&quot;iconfont&quot;&gt;&amp;#xe66f;&lt;/span&gt;\n            &lt;/el-button&gt;\n          &lt;/el-tooltip&gt;\n\n        &lt;/el-row&gt;\n        &lt;div class=&quot;loginTip&quot;&gt;登录过的用户请沿用之前的登录方式&lt;/div&gt;\n      &lt;/el-form&gt;\n    &lt;/div&gt;\n\n    &lt;div class=&quot;box registerBox&quot; v-if=&quot;showLogin == false&quot;&gt;\n      &lt;div class=&quot;title&quot;&gt;\n        &lt;span class=&quot;t1&quot;&gt;\n          登录\n        &lt;/span&gt;\n        &lt;div class=&quot;t2&quot; @click=&quot;closeLogin()&quot;&gt;\n          X\n        &lt;/div&gt;\n      &lt;/div&gt;\n      &lt;el-divider&gt;&lt;/el-divider&gt;\n      &lt;el-form :label-position=&quot;labelPosition&quot; :model=&quot;registerForm&quot;&gt;\n        &lt;el-form-item label=&quot;用户名&quot;&gt;\n          &lt;el-input v-model=&quot;registerForm.userName&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-form-item label=&quot;密码&quot;&gt;\n          &lt;el-input type=&quot;password&quot; v-model=&quot;registerForm.password&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-form-item label=&quot;重复密码&quot;&gt;\n          &lt;el-input type=&quot;password&quot; v-model=&quot;registerForm.password2&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-form-item label=&quot;邮箱&quot;&gt;\n          &lt;el-input v-model=&quot;registerForm.email&quot;&gt;&lt;/el-input&gt;\n        &lt;/el-form-item&gt;\n\n        &lt;el-row class=&quot;btn&quot;&gt;\n          &lt;el-button class=&quot;loginBtn&quot; type=&quot;primary&quot; @click=&quot;startRegister&quot;&gt;注册&lt;/el-button&gt;\n          &lt;el-button class=&quot;registerBtn&quot; type=&quot;info&quot; @click=&quot;goLogin&quot;&gt;返回登录&lt;/el-button&gt;\n        &lt;/el-row&gt;\n\n        &lt;div class=&quot;loginTip&quot;&gt;注册后，需要到邮箱进行邮件认证~&lt;/div&gt;\n      &lt;/el-form&gt;\n    &lt;/div&gt;\n\n    &lt;div class=&quot;mask&quot;&gt;&lt;/div&gt;\n\n  &lt;/div&gt;\n&lt;/template&gt;\n\n&lt;script&gt;\n  import {login, register} from &quot;@/api/user&quot;;\n\n  export default {\n    name: &quot;share&quot;,\n    data() {\n      return {\n        // 显示登录页面\n        showLogin: true,\n        isLogin: false,\n        table: false,\n        dialog: false,\n        loading: false,\n        labelPosition: &quot;right&quot;,\n        loginForm: {\n          userName: &quot;&quot;,\n          password: &quot;&quot;\n        },\n        registerForm: {\n          userName: &quot;&quot;,\n          password: &quot;&quot;,\n          password2: &quot;&quot;,\n          email: &quot;&quot;\n        }\n      };\n    },\n    components: {},\n    created() {\n    },\n    methods: {\n      startLogin: function () {\n        var params = {};\n        params.userName = this.loginForm.userName;\n        params.passWord = this.loginForm.password;\n        params.isRememberMe = 0;\n        console.log(&quot;登录表单&quot;, params);\n        login(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data);\n          }\n        });\n      },\n      startRegister: function () {\n\n        var params = {};\n        params.userName = this.registerForm.userName;\n        params.passWord = this.registerForm.password;\n        params.email = this.registerForm.email;\n        console.log(&quot;登录表单&quot;, params);\n        register(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data);\n          }\n        });\n      },\n      goLogin: function () {\n        console.log(&quot;去登录页面&quot;);\n        this.showLogin = true;\n      },\n      goRegister: function () {\n        console.log(&quot;去注册页面&quot;);\n        this.showLogin = false;\n      },\n      goAuth: function (source) {\n        console.log(&quot;go&quot;, source)\n        var params = new URLSearchParams();\n        params.append(&quot;source&quot;, source);\n        login(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data.url);\n            var token = response.data.token;\n            console.log(response);\n            window.location.href = response.data.url\n          }\n        });\n      },\n      closeLogin: function() {\n        this.$emit(&quot;closeLoginBox&quot;, &quot;&quot;);\n      }\n    }\n  };\n&lt;/script&gt;\n\n\n&lt;style&gt;\n  .box {\n    width: 400px;\n    height: 420px;\n    background: white;\n    position: fixed;\n    margin: auto;\n    left: 0;\n    right: 0;\n    top: 0;\n    bottom: 0;\n    z-index: 1000; /* 要比遮罩层大 */\n  }\n\n  .registerBox {\n    height: 570px;\n  }\n\n  .box .title {\n    height: 48px;\n    font-size: 22px;\n    font-weight: bold;\n    text-align: center;\n    line-height: 48px;\n  }\n  .box .title .t2 {\n    font-size: 16px;\n    float: right;\n    margin-right: 6px;\n    margin-top: -6px;\n    cursor: pointer;\n  }\n\n  .box .el-divider--horizontal {\n    margin: 12px 0;\n  }\n\n  .box .el-form-item__label {\n    margin-left: 10px;\n    font-size: 16px;\n  }\n\n  .box .el-input__inner {\n    margin-left: 10px;\n    width: 90%;\n  }\n\n  .box .btn {\n    text-align: center;\n  }\n\n  .box .loginBtn {\n    width: 40%;\n  }\n\n  .box .registerBtn {\n    width: 40%;\n  }\n\n  .elRow {\n    margin-top: 15px;\n    text-align: center;\n  }\n\n  .loginTip {\n    margin-top: 10px;\n    font-size: 14px;\n    text-align: center;\n    color: #bababa;\n  }\n\n  .remarksBox {\n    position: fixed;\n    left: 50%;\n    margin-left: -100px;\n    top: 50%;\n    margin-top: -50px;\n    border: 1px solid red;\n    width: 200px;\n    height: 100px;\n    text-align: center;\n    z-index: 1000; /* 要比遮罩层大 */\n  }\n\n  /* 遮罩层 */\n  .mask {\n    position: fixed;\n    left: 0;\n    top: 0;\n    width: 100%;\n    height: 100%;\n    background-color: rgba(0, 0, 0, 0.5);\n    z-index: 999;\n  }\n&lt;/style&gt;\n</code></pre>\n<p>下面是运行后的结果如下所示</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156689.png\" alt=\"image-20191230091751151\" /></p>\n<p>因为目前没打算自己制作登录和注册功能，所以用户名、密码、以及登录和注册都被设置成disabled了，下面是引入的接口：login</p>\n<pre><code class=\"language-javascript\">import request from \'@/utils/request\'\n\nexport function login(params) {\n  return request({\n    url: process.env.WEB_API + \'/oauth/render\',\n    method: \'post\',\n    params\n  })\n}\n</code></pre>\n<h2>引入第三方登录</h2>\n<p>完成了前端的页面后，我们就需要撰写后端代码了</p>\n<p>首先需要引入JustAuth的Maven依赖，我们在pom文件中添加对应依赖</p>\n<pre><code class=\"language-xml\">&lt;!--JustAuth第三方登录模块--&gt;\n&lt;dependency&gt;\n    &lt;groupId&gt;me.zhyd.oauth&lt;/groupId&gt;\n    &lt;artifactId&gt;JustAuth&lt;/artifactId&gt;\n    &lt;version&gt;1.13.1&lt;/version&gt;\n&lt;/dependency&gt;\n</code></pre>\n<p>然后在编写定义一个Controller，这里我创建了一个AuthRestApi.java文件</p>\n<pre><code class=\"language-java\">package com.moxi.mogublog.web.restapi;\n\nimport com.alibaba.fastjson.JSONObject;\nimport com.moxi.mogublog.utils.JsonUtils;\nimport com.moxi.mogublog.utils.ResultUtil;\nimport com.moxi.mogublog.utils.StringUtils;\nimport com.moxi.mogublog.web.global.MessageConf;\nimport com.moxi.mogublog.web.global.SQLConf;\nimport com.moxi.mogublog.web.global.SysConf;\nimport com.moxi.mogublog.xo.entity.User;\nimport com.moxi.mogublog.xo.service.UserService;\nimport io.swagger.annotations.Api;\nimport io.swagger.annotations.ApiOperation;\nimport me.zhyd.oauth.config.AuthConfig;\nimport me.zhyd.oauth.exception.AuthException;\nimport me.zhyd.oauth.model.AuthCallback;\nimport me.zhyd.oauth.model.AuthResponse;\nimport me.zhyd.oauth.model.AuthToken;\nimport me.zhyd.oauth.request.AuthGiteeRequest;\nimport me.zhyd.oauth.request.AuthGithubRequest;\nimport me.zhyd.oauth.request.AuthRequest;\nimport me.zhyd.oauth.utils.AuthStateUtils;\nimport org.apache.log4j.LogManager;\nimport org.apache.log4j.Logger;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Value;\nimport org.springframework.data.redis.core.StringRedisTemplate;\nimport org.springframework.web.bind.annotation.GetMapping;\nimport org.springframework.web.bind.annotation.PathVariable;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RestController;\n\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport java.io.IOException;\nimport java.util.HashMap;\nimport java.util.Map;\nimport java.util.concurrent.TimeUnit;\n\n/**\n * 第三方登录认证\n */\n@RestController\n@RequestMapping(&quot;/oauth&quot;)\n@Api(value = &quot;认证RestApi&quot;, tags = {&quot;AuthRestApi&quot;})\npublic class AuthRestApi {\n\n    private static Logger log = LogManager.getLogger(IndexRestApi.class);\n\n    @Autowired\n    private UserService userService;\n    @Value(value = &quot;${justAuth.clientId.gitee}&quot;)\n    private String giteeClienId;\n    @Value(value = &quot;${justAuth.clientSecret.gitee}&quot;)\n    private String giteeClientSecret;\n    @Value(value = &quot;${justAuth.clientId.github}&quot;)\n    private String githubClienId;\n    @Value(value = &quot;${justAuth.clientSecret.github}&quot;)\n    private String githubClientSecret;\n    @Value(value = &quot;${data.webSite.url}&quot;)\n    private String webSiteUrl;\n    @Value(value = &quot;${data.web.url}&quot;)\n    private String moguWebUrl;\n    @Value(value = &quot;${BLOG.USER_TOKEN_SURVIVAL_TIME}&quot;)\n    private Long userTokenSurvivalTime;\n    @Autowired\n    private StringRedisTemplate stringRedisTemplate;\n\n    @ApiOperation(value = &quot;获取认证&quot;, notes = &quot;获取认证&quot;)\n    @RequestMapping(&quot;/render&quot;)\n    public String renderAuth(String source, HttpServletResponse response) throws IOException {\n        log.info(&quot;进入render:&quot; + source);\n        AuthRequest authRequest = getAuthRequest(source);\n        String token = AuthStateUtils.createState();\n        String authorizeUrl = authRequest.authorize(token);\n        Map&lt;String, String&gt; map = new HashMap&lt;&gt;();\n        map.put(SQLConf.URL, authorizeUrl);\n        return ResultUtil.result(SysConf.SUCCESS, map);\n    }\n\n\n    /**\n     * oauth平台中配置的授权回调地址，以本项目为例，在创建gitee授权应用时的回调地址应为：http://127.0.0.1:8603/oauth/callback/gitee\n     */\n    @RequestMapping(&quot;/callback/{source}&quot;)\n    public void login(@PathVariable(&quot;source&quot;) String source, AuthCallback callback, HttpServletRequest request, HttpServletResponse httpServletResponse) throws IOException {\n        log.info(&quot;进入callback：&quot; + source + &quot; callback params：&quot; + JSONObject.toJSONString(callback));\n        AuthRequest authRequest = getAuthRequest(source);\n        AuthResponse response = authRequest.login(callback);\n        String result = JSONObject.toJSONString(response);\n        System.out.println(JSONObject.toJSONString(response));\n\n        Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(result);\n        Map&lt;String, Object&gt; data = JsonUtils.jsonToMap(JsonUtils.objectToJson(map.get(SysConf.DATA)));\n        Map&lt;String, Object&gt; token = JsonUtils.jsonToMap(JsonUtils.objectToJson(data.get(SysConf.TOKEN)));\n        String accessToken = token.get(SysConf.ACCESS_TOKEN).toString();\n        User user = userService.insertUserInfo(request, result);\n\n        if (user != null) {\n            //将从数据库查询的数据缓存到redis中\n            stringRedisTemplate.opsForValue().set(SysConf.USER_TOEKN + SysConf.REDIS_SEGMENTATION + accessToken, JsonUtils.objectToJson(user), userTokenSurvivalTime, TimeUnit.SECONDS);\n        }\n\n        httpServletResponse.sendRedirect(webSiteUrl + &quot;?token=&quot; + accessToken);\n    }\n\n    @RequestMapping(&quot;/revoke/{source}/{token}&quot;)\n    public Object revokeAuth(@PathVariable(&quot;source&quot;) String source, @PathVariable(&quot;token&quot;) String token) throws IOException {\n        AuthRequest authRequest = getAuthRequest(source);\n        return authRequest.revoke(AuthToken.builder().accessToken(token).build());\n    }\n\n    @RequestMapping(&quot;/refresh/{source}&quot;)\n    public Object refreshAuth(@PathVariable(&quot;source&quot;) String source, String token) {\n        AuthRequest authRequest = getAuthRequest(source);\n        return authRequest.refresh(AuthToken.builder().refreshToken(token).build());\n    }\n\n    @ApiOperation(value = &quot;获取用户信息&quot;, notes = &quot;获取用户信息&quot;)\n    @GetMapping(&quot;/verify/{accessToken}&quot;)\n    public String verifyUser(@PathVariable(&quot;accessToken&quot;) String accessToken) {\n        String userInfo = stringRedisTemplate.opsForValue().get(&quot;TOKEN:&quot; + accessToken);\n        if (StringUtils.isEmpty(userInfo)) {\n            return ResultUtil.result(SysConf.ERROR, MessageConf.INVALID_TOKEN);\n        } else {\n            Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(userInfo);\n            return ResultUtil.result(SysConf.SUCCESS, map);\n        }\n    }\n\n    @ApiOperation(value = &quot;删除accessToken&quot;, notes = &quot;删除accessToken&quot;)\n    @RequestMapping(&quot;/delete/{accessToken}&quot;)\n    public String deleteUserAccessToken(@PathVariable(&quot;accessToken&quot;) String accessToken) {\n        stringRedisTemplate.delete(SysConf.USER_TOEKN + SysConf.REDIS_SEGMENTATION + accessToken);\n        return ResultUtil.result(SysConf.SUCCESS, MessageConf.DELETE_SUCCESS);\n    }\n\n\n    private AuthRequest getAuthRequest(String source) {\n        AuthRequest authRequest = null;\n        switch (source) {\n            case SysConf.GITHUB:\n                authRequest = new AuthGithubRequest(AuthConfig.builder()\n                        .clientId(githubClienId)\n                        .clientSecret(githubClientSecret)\n                        .redirectUri(moguWebUrl + &quot;/oauth/callback/github&quot;)\n                        .build());\n                break;\n            case SysConf.GITEE:\n                authRequest = new AuthGiteeRequest(AuthConfig.builder()\n                        .clientId(giteeClienId)\n                        .clientSecret(giteeClientSecret)\n                        .redirectUri(moguWebUrl + &quot;/oauth/callback/gitee&quot;)\n                        .build());\n                break;\n            default:\n                break;\n        }\n        if (null == authRequest) {\n            throw new AuthException(MessageConf.OPERATION_FAIL);\n        }\n        return authRequest;\n    }\n}\n</code></pre>\n<p>application.yml部分配置文件如下所示：</p>\n<pre><code class=\"language-yaml\">data:\n  # 门户页面\n  webSite:\n    url: http://localhost:9527/#/\n  # mogu_web网址，用于第三方登录回调\n  web:\n    url: http://127.0.0.1:8603\n    \n# 第三方登录\njustAuth:\n  clientId:\n    gitee: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX\n    github: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX\n  clientSecret:\n    gitee: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX\n    github: XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX    \n</code></pre>\n<p>关于clientId和clientSecret需要到各自的码云和github设置上进行获取：</p>\n<p>在码云中：我们首先进入设置页面，然后选择第三方应用，然后创建应用</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156939.png\" alt=\"image-20191231125943234\" /></p>\n<p>然后开始填写对应的内容</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156977.png\" alt=\"image-20191231130159318\" /></p>\n<p>重新点击第三方应用，获取到对应的ClientID和Client Secret替换即可</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157133.png\" alt=\"image-20191231133512612\" /></p>\n<p>Github上的操作同理，我们需要设置setting，然后选择Developer settings，OAuth Apps：创建一个新的</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157017.png\" alt=\"image-20191231133218598\" /></p>\n<p>这里填写的信息和刚刚码云上差不多</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157055.png\" alt=\"image-20191231133315906\" /></p>\n<p>然后最后在创建成功后复制对应的ClientID和Client Secret即可：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571157094.png\" alt=\"image-20191231133422982\" /></p>\n<p>在AuthRestApi中，下面几个方法的主要作用是：</p>\n<ul>\n<li>renderAuth：获取认证，前端通过login方法，即访问的是该接口，然后会创建一个认证请求，里面调用了getAuthRequest方法</li>\n<li>getAuthRequest：该方法需要传入一个source参数，该参数主要是失败用户请求的接口，然后封装一个URL，最后通过renderAuth返回到前台页面中，该方法前端接受后，最终会生成一个URL，然后跳转到对应的页面进行授权即可</li>\n</ul>\n<p>例如下面的vue代码：</p>\n<pre><code>    goAuth: function (source) {\n        var params = new URLSearchParams();\n        params.append(&quot;source&quot;, source);\n        login(params).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            console.log(response.data.url);\n            var token = response.data.token;\n            console.log(response);\n            window.location.href = response.data.url\n          }\n        });\n      },\n</code></pre>\n<p>vue代码，就是通过source判断我点击的按钮，如果是github，那么source为 ”github“，然后调用后台的登录方法，通过传递的source，生成一个授权页面url，最后我们通过window.location.href 跳转到授权页面：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156806.png\" alt=\"image-20191231124501601\" /></p>\n<p>回调的接口如下所示：</p>\n<pre><code class=\"language-java\">    /**\n     * oauth平台中配置的授权回调地址，以本项目为例，在创建gitee授权应用时的回调地址应为：http://127.0.0.1:8603/oauth/callback/gitee\n     */\n    @RequestMapping(&quot;/callback/{source}&quot;)\n    public void login(@PathVariable(&quot;source&quot;) String source, AuthCallback callback, HttpServletRequest request, HttpServletResponse httpServletResponse) throws IOException {\n        log.info(&quot;进入callback：&quot; + source + &quot; callback params：&quot; + JSONObject.toJSONString(callback));\n        AuthRequest authRequest = getAuthRequest(source);\n        AuthResponse response = authRequest.login(callback);\n        String result = JSONObject.toJSONString(response);\n        System.out.println(JSONObject.toJSONString(response));\n\n        Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(result);\n        Map&lt;String, Object&gt; data = JsonUtils.jsonToMap(JsonUtils.objectToJson(map.get(SysConf.DATA)));\n        Map&lt;String, Object&gt; token = JsonUtils.jsonToMap(JsonUtils.objectToJson(data.get(SysConf.TOKEN)));\n        String accessToken = token.get(SysConf.ACCESS_TOKEN).toString();\n        User user = userService.insertUserInfo(request, result);\n\n        if (user != null) {\n            //将从数据库查询的数据缓存到redis中\n            stringRedisTemplate.opsForValue().set(SysConf.USER_TOEKN + SysConf.REDIS_SEGMENTATION + accessToken, JsonUtils.objectToJson(user), userTokenSurvivalTime, TimeUnit.SECONDS);\n        }\n\n        httpServletResponse.sendRedirect(webSiteUrl + &quot;?token=&quot; + accessToken);\n    }\n</code></pre>\n<p>我们需要将得到的用户信息，存储到数据库，同时生成一个token，通过url的方式，传递到前台，然后前台得到token后，通过token获取用户信息：</p>\n<pre><code class=\"language-java\">    @ApiOperation(value = &quot;获取用户信息&quot;, notes = &quot;获取用户信息&quot;)\n    @GetMapping(&quot;/verify/{accessToken}&quot;)\n    public String verifyUser(@PathVariable(&quot;accessToken&quot;) String accessToken) {\n        String userInfo = stringRedisTemplate.opsForValue().get(&quot;TOKEN:&quot; + accessToken);\n        if (StringUtils.isEmpty(userInfo)) {\n            return ResultUtil.result(SysConf.ERROR, MessageConf.INVALID_TOKEN);\n        } else {\n            Map&lt;String, Object&gt; map = JsonUtils.jsonToMap(userInfo);\n            return ResultUtil.result(SysConf.SUCCESS, map);\n        }\n    }\n</code></pre>\n<p>然后在vue项目中，我们只需要判断是否有token通过url传递过来</p>\n<pre><code class=\"language-javascript\"> let token = this.getUrlVars()[&quot;token&quot;];\n      // 判断url中是否含有token\n      if (token != undefined) {\n        setCookie(&quot;token&quot;, token, 1)\n      }\n\n      // 从cookie中获取token\n      token = getCookie(&quot;token&quot;)\n      if (token != undefined) {\n        authVerify(token).then(response =&gt; {\n          if (response.code == &quot;success&quot;) {\n            this.isLogin = true;\n            this.userInfo = response.data;\n          } else {\n            this.isLogin = false;\n            delCookie(&quot;token&quot;);\n          }\n        });\n      } else {\n        this.isLogin = false;\n }\n</code></pre>\n<p>如果有，那么就通过token获取用户信息，登录完成后，就能够看到头像回显了：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586571156867.png\" alt=\"image-20191231125825022\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=c4c89a69942d1371ae6cbc26ecf5d2c6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[http://localhost:8600/blog/admin/png/2020/4/8/1586331059667.png], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>Github Actions完成Spring boot编译部署任务</h1>\n<h2>前言</h2>\n<p>官网介绍：GitHub Actions提供了一个强大的执行环境，可以集成到你的工作流程的每一步。您可以发现、创建和共享操作来执行任何您想要的作业，并将它们组合起来以定制您的工作流。</p>\n<h2>1.开始一个Actions</h2>\n<p>我们选</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586570868915.png\" alt=\"image-20200101133018350\" /></p>\n<p>这时候会自动创建一个maven.yml</p>\n<pre><code>name: Java CI     #Actions名称\n\non: [push]        #Action触发条件\n\njobs:\n  build:\n	runs-on: ubuntu-latest    #运行环境\n\nsteps:\n- uses: actions/checkout@v1    #获得你该仓库的v1分支\n- name: Set up JDK 1.8\n  uses: actions/setup-java@v1  #使用官方脚本创建java环境\n  with:\n    java-version: 1.8\n- name: Build with Maven\n  run: mvn -B package --file pom.xml\n</code></pre>\n<p>这是我写的</p>\n<ul>\n<li>\n<pre><code class=\"language-yml\">name: Java CI     #Actions名称\n\non: \n  push:\n    branches: \n      - master       #在提交master时触发\n\njobs:\n  build:\n	runs-on: ubuntu-latest    #运行环境\n\nsteps:\n\n- uses: actions/checkout@master    #获取master分支\n- name: Set up JDK 1.8\n  uses: actions/setup-java@v1  #使用官方脚本创建java环境\n  with:\n    java-version: 1.8\n</code></pre>\n</li>\n</ul>\n<h1>2.配置config免密</h1>\n<p>因为我们需要在编译的时候获取到线上环境的config，而线上环境的config有很多服务器密码等信息。所以需要创建一个私有库来存放这些信息。</p>\n<p>创建好私有库后。我们需要配置github该私有库的免密登录。</p>\n<pre><code class=\"language-shell\">ssh-keygen -t rsa\n</code></pre>\n<p>这时候会生成id_rsa  id_rsa.pub两个文件。</p>\n<p>我们将id_rsa.pub文件中的内容放入该私有库</p>\n<p>Settings-&gt;Deploy keys</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586570869242.png\" alt=\"image-20200101134437785\" /></p>\n<p>将id_rsa中的内容写入项目的Secrets中（非配置文件私有库）</p>\n<p>这样我们就可以在Actions中引入该私钥而不会暴露出来。</p>\n<p>在Actions中写入该步骤，实现Actions中的服务器可以访问私有库</p>\n<p>通过${{ secrets.xxxxx }}引用，实例如下</p>\n<pre><code class=\"language-shell\">  - name: Set SSH Environment\n    run: |\n      mkdir -p ~/.ssh/\n      echo &quot;${{ secrets.ID_RSA }}&quot; &gt; ~/.ssh/id_rsa\n      echo &quot;${{ secrets.ID_RSA_PUB }}&quot; &gt; ~/.ssh/id_rsa.pub\n      cat ~/.ssh/id_rsa.pub &gt;&gt; ~/.ssh/authorized_keys\n      chmod 600 ~/.ssh/id_rsa\n      chmod 700 ~/.ssh &amp;&amp; chmod 700 ~/.ssh/*\n      ls -l ~/.ssh/\n</code></pre>\n<p>补充</p>\n<p><em>密钥验证</em></p>\n<ul>\n<li>机器1生成密钥对并将公钥发给机器2，机器2将公钥保存。</li>\n<li>机器1要登录机器2时，机器2生成随机字符串并用机器1的公钥加密后，发给机器1。</li>\n<li>机器1用私钥将其解密后发回给机器2，验证成功后登录</li>\n</ul>\n<h1>3.获得config</h1>\n<p>通过git clone命名获取私有库config</p>\n<p>git clone git@github.com:xxxx/xxxx_config.git</p>\n<p>之后就可以编写自己的build过程</p>\n<h1>4.将构建的jar包拷贝到自己服务器</h1>\n<p>这里我们使用别人写好scp的Actions组件，将Actions服务器中的编译好的文件传输到我们自己的服务器。</p>\n<pre><code class=\"language-shell\">- name: scp\n  uses: garygrossgarten/github-action-scp@release\n  with:\n    local: xxx 本地文件\n    remote: xxx 远程文件\n    host: ${{ secrets.DOCKER_IP }}\n    username: ${{ secrets.DOCKER_ID }}\n    password: ${{ secrets.DOCKER_PASSWORD }}\n    port: ${{ secrets.DOCKER_PORT }}\n</code></pre>\n<h1>5.ssh到我们自己的服务器上执行命令</h1>\n<pre><code class=\"language-shell\">  - name: start_eureka\n    uses: appleboy/ssh-action@master\n    with:\n      host: ${{ secrets.DOCKER_IP }}\n      username: ${{ secrets.DOCKER_ID }}\n      password: ${{ secrets.DOCKER_PASSWORD }}\n      port: ${{ secrets.DOCKER_PORT }}\n      script: |\n      	cd xxxx\n        ./xxxxx\n</code></pre>\n<p>整个过程就完成了</p>\n<h1>6.问题</h1>\n<p>由于Actions服务器本身的限制问题，我们无法使用系统自带的scp和ssh命令，只能使用别人重写的脚本执行相关命令。</p>\n<h2>7.最终效果</h2>\n<p><img src=\"images/image-20200106102921524.png\" alt=\"image-20200106102921524\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=1d151a81e0e2d1ba824f815b259e41e1, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=[null], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<h1>Optional类</h1>\n<h2>概念</h2>\n<p>Optional类是一个容器类，代表一个值存在或者不存在，原来null表示一个值不存在，现在Optional可以更好的表达这个概念，并且可以规避空指针异常</p>\n<h2>常用方法</h2>\n<ul>\n<li>\n<p>Optional.of：创建一个Optional实例</p>\n</li>\n<li>\n<p>Optional.empty：创建一个空的Optional实例</p>\n</li>\n<li>\n<p>Optional.ofNullable：若t不为null，创建optional实例，否者创建一个空实例</p>\n</li>\n<li>\n<p>isPresent：判断是否包含值</p>\n</li>\n<li>\n<p>orElse(T t)：如果对象包含值，则返回该值，否则返回t</p>\n</li>\n<li>\n<p>orElseGet(Supplier s)：如果调用对象包含值，返回该值，否则返回S获取的值</p>\n</li>\n<li>\n<p>map(Function f)：如果有值对其处理，返回处理后的Optional，否则返回Optional.empty()</p>\n</li>\n<li>\n<p>flatMap(Function mapper)：与map类似，要求返回值必须是Optional</p>\n</li>\n</ul>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<h1>Java8新特性</h1>\n<h2>主要特性</h2>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314086.png\" alt=\"image-20200405101639700\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n    \n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314266.png\" alt=\"image-20200405110723887\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314283.png\" alt=\"image-20200405111030936\" /></p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314353.png\" alt=\"image-20200405111105573\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。\n这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。\n然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e;\n然后是e = next，导致了e指向了key(7)，\n而下一次循环的next = e.next导致了next指向了key(3)\n注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314387.png\" alt=\"image-20200405111205298\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314414.png\" alt=\"image-20200405111254924\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。\ne.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314442.png\" alt=\"image-20200405111319072\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314136.png\" alt=\"image-20200405105335235\" /></p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314186.png\" alt=\"image-20200405105401674\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314210.png\" alt=\"image-20200405105533985\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314243.png\" alt=\"image-20200405105704798\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log<sub>2</sub>n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314470.png\" alt=\"image-20200405115011067\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<h1>Lambda表达式</h1>\n<h2>为什么要用Lambda表达式</h2>\n<p>Lambda是一个匿名函数，我们可以把Lambda表达式理解为是一段可以传递的代码，将代码像数据一样传递，这样可以写出更简洁、更灵活的代码，作为一个更紧凑的代码风格，使Java语言表达能力得到了提升</p>\n<h2>实例代码</h2>\n<p>Lambda表达式最先替代的就是匿名内部类，假设原来我们写一个Comparator比较函数，采用匿名内部类的方式</p>\n<pre><code>    /**\n     * 原来使用匿名内部类\n     */\n    public static void test() {\n        // 使用匿名内部类，重写Intger的 compare方法\n        Comparator&lt;Integer&gt; comparator = new Comparator&lt;Integer&gt;() {\n            @Override\n            public int compare(Integer o1, Integer o2) {\n                return Integer.compare(o1, o2);\n            }\n        };\n\n        // 传入比较的方法\n        TreeSet&lt;Integer&gt; ts = new TreeSet&lt;&gt;(comparator);\n    }\n</code></pre>\n<p>然后在采用Lambda表达式后</p>\n<pre><code>    /**\n     * 使用Lambda表达式解决匿名内部类需要编写大量模板语言的问题\n     */\n    public static void test2() {\n        Comparator&lt;Integer&gt; comparator = (x, y) -&gt; Integer.compare(x, y);\n\n        // 传入比较的方法\n        TreeSet&lt;Integer&gt; ts = new TreeSet&lt;&gt;(comparator);\n    }\n</code></pre>\n<h2>策略设计模式</h2>\n<p>假设我们现在有一个需求，就是查找出员工里面年龄超过35的，我们使用策略设计模式</p>\n<pre><code>/**\n * 员工类\n *\n * @author: 陌溪\n * @create: 2020-04-05-12:13\n */\npublic class Employee {\n    private String name;\n    private int age;\n    private double salary;\n    \n    // set get\n}\n</code></pre>\n<p>然后创建一个接口，这里就是判定条件</p>\n<pre><code>/**\n * 接口\n * @param &lt;T&gt;\n */\npublic interface MyPredicte&lt;T&gt; {\n    public boolean test(T t);\n}\n\n</code></pre>\n<p>我们实现这个接口</p>\n<pre><code>/**\n * 按年龄过滤\n *\n * @author: 陌溪\n * @create: 2020-04-05-12:23\n */\npublic class FilterEmployeeByAge implements MyPredicte&lt;Employee&gt; {\n\n    @Override\n    public boolean test(Employee employee) {\n        return employee.getAge() &gt; 35;\n    }\n}\n</code></pre>\n<p>然后在具体的例子中使用</p>\n<pre><code>    /**\n     * 获取当前公司员工年龄大于35\n     */\n    public static void test3() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        MyPredicte&lt;Employee&gt; mp = new FilterEmployeeByAge();\n        List&lt;Employee&gt; emps = new ArrayList&lt;&gt;();\n        for (Employee emp : emps) {\n            if(mp.test(emp)) {\n                emps.add(emp);\n            }\n        }\n    }\n</code></pre>\n<p>当某一天需求变更了，变成需要查找金额大于60000的，那么只需要在编写一个实现类即可</p>\n<pre><code>/**\n * 按薪资过滤\n *\n * @author: 陌溪\n * @create: 2020-04-05-12:23\n */\npublic class FilterEmployeeBySalary implements MyPredicte&lt;Employee&gt; {\n\n    @Override\n    public boolean test(Employee employee) {\n        return employee.getSalary() &gt; 60000;\n    }\n}\n\n</code></pre>\n<p>那么具体使用只需要更改为</p>\n<pre><code>    /**\n     * 获取当前公司薪资大于60000\n     */\n    public static void test3() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        MyPredicte&lt;Employee&gt; mp = new FilterEmployeeBySalary();\n        List&lt;Employee&gt; emps = new ArrayList&lt;&gt;();\n        for (Employee emp : emps) {\n            if(mp.test(emp)) {\n                emps.add(emp);\n            }\n        }\n    }\n</code></pre>\n<p>这样一个方法，被称为策略设计模式</p>\n<h2>匿名内部类</h2>\n<p>使用上面的策略设计模式，我们会发现一个问题，就是每当我需要增加一个条件的时候，就需要增加一个实现类，如果条件多了的话，那么就会有很多实现类，那么为了优化，我们可以采取匿名内部类的方式</p>\n<pre><code>    /**\n     * 优化方式，采用匿名内部类的方式\n     */\n    public static void test5() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        // 匿名内部类\n        filterEmployee(employees, new MyPredicte&lt;Employee&gt;() {\n            @Override\n            public boolean test(Employee employee) {\n                return employee.getSalary() &lt;= 5000;\n            }\n        });\n    }\n</code></pre>\n<p>直接在内部类中，使用我们的过滤条件</p>\n<h2>Lambda表达式</h2>\n<pre><code>    /**\n     * 使用Lambda表达式优化\n     */\n    public static void test6() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        List&lt;Employee&gt; list = filterEmployee(employees, (e) -&gt; e.getSalary() &lt;= 5000);\n        list.forEach(System.out::println);\n    }\n</code></pre>\n<p>或者</p>\n<pre><code>    /**\n     * 不使用策略模式\n     */\n    public static void test7() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n        employees.stream().filter(e-&gt; e.getSalary() &gt;= 5000).limit(2).forEach(System.out::println);\n        \n        System.out.println(&quot;=========&quot;);\n        employees.stream().map(Employee::getName).forEach(System.out::println);\n    }\n</code></pre>\n<h2>学习Lambda</h2>\n<p>Lambda表达式基础语法：Java8中引入了一个新的操作符 “-&gt;” 该操作符称为箭头操作符 或 Lambda操作符</p>\n<p>箭头操作符将Lambda表达式拆分为两部分：</p>\n<ul>\n<li>左侧：Lambda表达式的参数列表（可以想象成，是上面定义的接口中抽象方法参数的列表）</li>\n<li>右侧：Lambda表达式中，所需要执行的功能，即Lambda体（需要对抽象方法实现的功能）</li>\n</ul>\n<h3>语法格式</h3>\n<h4>1、无参，无返回值</h4>\n<p>格式：</p>\n<pre><code>() -&gt; System.out.println(“hello”);\n</code></pre>\n<p>举例：</p>\n<pre><code>    public static void test() {\n        Runnable r = new Runnable() {\n            @Override\n            public void run() {\n                System.out.println(&quot;hello&quot;);\n            }\n        };\n\n        System.out.println(&quot;=========&quot;);\n\n        Runnable runnable = () -&gt; {\n            System.out.println(&quot;hello lambda&quot;);\n        };\n    }\n</code></pre>\n<p>JDK1.8以后，调用Lambda外的值，不需要增加final字段，它默认已经添加了final</p>\n<pre><code>int n = 10;\nRunnable runnable = () -&gt; {\n	System.out.println(&quot;hello lambda&quot; + n);\n};\n</code></pre>\n<h4>2、有一个参数，有返回值</h4>\n<p>格式：</p>\n<pre><code>(x) -&gt; System.out.println(x);\n或  (一个参数时，小括号可以省略不写)\nx -&gt; System.out.println(x);\n</code></pre>\n<p>实例：</p>\n<pre><code>public static void test2() {\n    Consumer&lt;String&gt; consumer = (x) -&gt; System.out.println(x);\n    consumer.accept(&quot;我在bilibili&quot;);\n}\n</code></pre>\n<h4>3、有多个参数，一个返回值</h4>\n<pre><code>    /**\n     * 多个参数，有返回值\n     */\n    public static void test3() {\n        Comparator&lt;Integer&gt; comparator = (x, y) -&gt; {\n            System.out.println(&quot;函数式接口&quot;);\n            return Integer.compare(x, y);\n        };\n    }\n</code></pre>\n<h4>4、有多个参数，只有一条语句</h4>\n<p>这个时候，可以省略大括号 和 return</p>\n<pre><code>\n    /**\n     * 多个参数，函数体只有一条，并且有返回值时\n     */\n    public static void test4() {\n        Comparator&lt;Integer&gt; comparator = (x, y) -&gt; Integer.compare(x, y);\n    }\n</code></pre>\n<h3>类型推断</h3>\n<p>Lambda中，表达式的参数列表的数据类型可以省略不写，因为JVM编译器通过上下文推断出，数据类型，即“类型推断”。</p>\n<pre><code>(Integer x, Integer y) -&gt; Integer.compare(x, y);\n</code></pre>\n<p>但是底层的类型检查还是有的，只是JDK底层帮我们做了类型检查这件事</p>\n<h2>函数式接口</h2>\n<p>Lambda表达式需要“函数式接口”的支持</p>\n<p>函数式接口：接口中只有一个抽象方法的接口，称为函数式接口，如：</p>\n<pre><code>/**\n * 函数式接口 \n */\npublic interface MyPredicte&lt;T&gt; {\n    public boolean test(T t);\n}\n</code></pre>\n<p>可以使用注解 <code>@FunctionalInterface</code> 修饰的，则为函数式接口</p>\n<pre><code>/**\n * 接口，用于解决重复条件\n * @param &lt;T&gt;\n */\n@FunctionalInterface\npublic interface MyPredicte&lt;T&gt; {\n    public boolean test(T t);\n}\n\n</code></pre>\n<h2>场景</h2>\n<p>对一个数进行某种运算</p>\n<p>首先创建一个函数式接口</p>\n<pre><code>@FunctionalInterface\npublic interface MyFun {\n    public Integer getValue(Integer value);\n}\n</code></pre>\n<p>然后在定义一个方法，把方法作为参数传递</p>\n<pre><code>    /**\n     * 需求：对一个数进行运算\n     */\n    public static void test5() {\n        Integer value = operation(100, (x) -&gt; x*x);\n        System.out.println(value);\n    }\n\n    public static Integer operation(Integer num, MyFun myFun) {\n        return myFun.getValue(num);\n    }\n</code></pre>\n<h2>训练</h2>\n<ul>\n<li>调用Collections.sort()方法，通过定制排序比较两个Employee（先比较年龄比，年龄相同比较姓名），使用Lambda表达式</li>\n</ul>\n<pre><code>    public static void test() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n        Collections.sort(employees, (e1, e2) -&gt; {\n            if(e1.getAge() == e2.getAge()) {\n                return e1.getName().compareTo(e2.getName());\n            } else {\n                return Integer.compare(e1.getAge(), e2.getAge());\n            }\n        });\n\n        employees.stream().map(Employee::getName).forEach(System.out::println);\n    }\n</code></pre>\n<h2>Java内置函数接口</h2>\n<h2>Comsumer 消费型接口</h2>\n<p>格式：<code>Comsumer&lt;T&gt;</code></p>\n<p>传入参数，然后对参数进行操作，没有返回值</p>\n<pre><code>    /**\n     * 消费型接口\n     */\n    public static void test() {\n        happy(1000, (m) -&gt; System.out.println(&quot;消费成功：&quot; + m + &quot;元&quot;));\n    }\n    public static void happy(double money, Consumer&lt;Double&gt; consumer) {\n        consumer.accept(money);\n    }\n</code></pre>\n<h2>Supplier 供给型接口</h2>\n<p>格式：<code>Supplier&lt;T&gt;</code></p>\n<p>T get();</p>\n<p>传入参数，对参数进行操作，然后有返回值</p>\n<pre><code>    /**\n     * 供给型接口，供给功能如何实现\n     */\n    public static void test2() {\n        List&lt;Integer&gt; list = getNumList(10, () -&gt; {\n          Integer a =   (int)(Math.random() * 10);\n          return a;\n        });\n\n        list.stream().forEach(System.out::println);\n    }\n\n    /**\n     * 产生指定个数的整数\n     * @param n\n     * @return\n     */\n    public static List&lt;Integer&gt; getNumList(Integer n, Supplier&lt;Integer&gt; supplier) {\n        List&lt;Integer&gt; list = new ArrayList&lt;&gt;();\n        for (int i = 0; i &lt; n; i++) {\n            list.add(supplier.get());\n        }\n        return list;\n    }\n</code></pre>\n<p>最后输出结果</p>\n<pre><code>0\n5\n9\n4\n4\n3\n4\n5\n0\n3\n</code></pre>\n<h2>Function 函数型接口</h2>\n<p>格式：<code>Function&lt;T,R&gt;</code></p>\n<p><code>R apply(T t);</code></p>\n<pre><code>    /**\n     * 函数型接口\n     * Function&lt;T, R&gt;\n     */\n    public static void test3() {\n        String str = strHandler(&quot;abcdefg&quot;, (x) -&gt; {\n            return x.toUpperCase().substring(0, 5);\n        });\n        System.out.println(str);\n    }\n\n    /**\n     * 需求：用于处理字符串\n     */\n    public static String strHandler(String str, Function&lt;String, String&gt; function) {\n        // 使用apply方法进行处理，怎么处理需要具体实现\n        return function.apply(str);\n    }\n</code></pre>\n<p>输出结果：</p>\n<pre><code>ABCDE\n</code></pre>\n<h2>Predicate 断言型接口</h2>\n<p>格式：<code>Predicate&lt;T&gt;</code>， 用于做一些判断</p>\n<pre><code>    /**\n     * 断言型接口(把长度大于3的str过滤出来)\n     */\n    public static void test4() {\n        List&lt;String&gt; list = Arrays.asList(&quot;abc&quot;, &quot;abcd&quot;, &quot;df&quot;, &quot;cgg&quot;, &quot;aaab&quot;);\n        List&lt;String&gt; result = strPredict(list, (x) -&gt; x.length() &gt; 3);\n        result.forEach(item -&gt; {\n            System.out.println(item);\n        });\n    }\n\n    /**\n     * 将满足条件的字符串，放入到集合中\n     */\n    public static List&lt;String&gt; strPredict(List&lt;String&gt; list, Predicate&lt;String&gt; predicate) {\n        List&lt;String&gt; result = new ArrayList&lt;&gt;();\n        list.forEach(item -&gt; {\n            if(predicate.test(item)) {\n                result.add(item);\n            }\n        });\n        return result;\n    }\n</code></pre>\n<h2>扩展</h2>\n<p>上述的四大核心接口，并不能被适用于一个特殊的应用场景，只能满足大部分的需求</p>\n<p>因为他们对于参数的参入有局限性</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314505.png\" alt=\"image-20200406093105110\" /></p>\n<p>同时后面针对这样的情况，后面也使用子接口，进行了解决</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314539.png\" alt=\"image-20200406093204147\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<h1>Lambda表达式</h1>\n<h2>为什么要用Lambda表达式</h2>\n<p>Lambda是一个匿名函数，我们可以把Lambda表达式理解为是一段可以传递的代码，将代码像数据一样传递，这样可以写出更简洁、更灵活的代码，作为一个更紧凑的代码风格，使Java语言表达能力得到了提升</p>\n<h2>实例代码</h2>\n<p>Lambda表达式最先替代的就是匿名内部类，假设原来我们写一个Comparator比较函数，采用匿名内部类的方式</p>\n<pre><code>    /**\n     * 原来使用匿名内部类\n     */\n    public static void test() {\n        // 使用匿名内部类，重写Intger的 compare方法\n        Comparator&lt;Integer&gt; comparator = new Comparator&lt;Integer&gt;() {\n            @Override\n            public int compare(Integer o1, Integer o2) {\n                return Integer.compare(o1, o2);\n            }\n        };\n\n        // 传入比较的方法\n        TreeSet&lt;Integer&gt; ts = new TreeSet&lt;&gt;(comparator);\n    }\n</code></pre>\n<p>然后在采用Lambda表达式后</p>\n<pre><code>    /**\n     * 使用Lambda表达式解决匿名内部类需要编写大量模板语言的问题\n     */\n    public static void test2() {\n        Comparator&lt;Integer&gt; comparator = (x, y) -&gt; Integer.compare(x, y);\n\n        // 传入比较的方法\n        TreeSet&lt;Integer&gt; ts = new TreeSet&lt;&gt;(comparator);\n    }\n</code></pre>\n<h2>策略设计模式</h2>\n<p>假设我们现在有一个需求，就是查找出员工里面年龄超过35的，我们使用策略设计模式</p>\n<pre><code>/**\n * 员工类\n *\n * @author: 陌溪\n * @create: 2020-04-05-12:13\n */\npublic class Employee {\n    private String name;\n    private int age;\n    private double salary;\n    \n    // set get\n}\n</code></pre>\n<p>然后创建一个接口，这里就是判定条件</p>\n<pre><code>/**\n * 接口\n * @param &lt;T&gt;\n */\npublic interface MyPredicte&lt;T&gt; {\n    public boolean test(T t);\n}\n\n</code></pre>\n<p>我们实现这个接口</p>\n<pre><code>/**\n * 按年龄过滤\n *\n * @author: 陌溪\n * @create: 2020-04-05-12:23\n */\npublic class FilterEmployeeByAge implements MyPredicte&lt;Employee&gt; {\n\n    @Override\n    public boolean test(Employee employee) {\n        return employee.getAge() &gt; 35;\n    }\n}\n</code></pre>\n<p>然后在具体的例子中使用</p>\n<pre><code>    /**\n     * 获取当前公司员工年龄大于35\n     */\n    public static void test3() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        MyPredicte&lt;Employee&gt; mp = new FilterEmployeeByAge();\n        List&lt;Employee&gt; emps = new ArrayList&lt;&gt;();\n        for (Employee emp : emps) {\n            if(mp.test(emp)) {\n                emps.add(emp);\n            }\n        }\n    }\n</code></pre>\n<p>当某一天需求变更了，变成需要查找金额大于60000的，那么只需要在编写一个实现类即可</p>\n<pre><code>/**\n * 按薪资过滤\n *\n * @author: 陌溪\n * @create: 2020-04-05-12:23\n */\npublic class FilterEmployeeBySalary implements MyPredicte&lt;Employee&gt; {\n\n    @Override\n    public boolean test(Employee employee) {\n        return employee.getSalary() &gt; 60000;\n    }\n}\n\n</code></pre>\n<p>那么具体使用只需要更改为</p>\n<pre><code>    /**\n     * 获取当前公司薪资大于60000\n     */\n    public static void test3() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        MyPredicte&lt;Employee&gt; mp = new FilterEmployeeBySalary();\n        List&lt;Employee&gt; emps = new ArrayList&lt;&gt;();\n        for (Employee emp : emps) {\n            if(mp.test(emp)) {\n                emps.add(emp);\n            }\n        }\n    }\n</code></pre>\n<p>这样一个方法，被称为策略设计模式</p>\n<h2>匿名内部类</h2>\n<p>使用上面的策略设计模式，我们会发现一个问题，就是每当我需要增加一个条件的时候，就需要增加一个实现类，如果条件多了的话，那么就会有很多实现类，那么为了优化，我们可以采取匿名内部类的方式</p>\n<pre><code>    /**\n     * 优化方式，采用匿名内部类的方式\n     */\n    public static void test5() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        // 匿名内部类\n        filterEmployee(employees, new MyPredicte&lt;Employee&gt;() {\n            @Override\n            public boolean test(Employee employee) {\n                return employee.getSalary() &lt;= 5000;\n            }\n        });\n    }\n</code></pre>\n<p>直接在内部类中，使用我们的过滤条件</p>\n<h2>Lambda表达式</h2>\n<pre><code>    /**\n     * 使用Lambda表达式优化\n     */\n    public static void test6() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n\n        List&lt;Employee&gt; list = filterEmployee(employees, (e) -&gt; e.getSalary() &lt;= 5000);\n        list.forEach(System.out::println);\n    }\n</code></pre>\n<p>或者</p>\n<pre><code>    /**\n     * 不使用策略模式\n     */\n    public static void test7() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n        employees.stream().filter(e-&gt; e.getSalary() &gt;= 5000).limit(2).forEach(System.out::println);\n        \n        System.out.println(&quot;=========&quot;);\n        employees.stream().map(Employee::getName).forEach(System.out::println);\n    }\n</code></pre>\n<h2>学习Lambda</h2>\n<p>Lambda表达式基础语法：Java8中引入了一个新的操作符 “-&gt;” 该操作符称为箭头操作符 或 Lambda操作符</p>\n<p>箭头操作符将Lambda表达式拆分为两部分：</p>\n<ul>\n<li>左侧：Lambda表达式的参数列表（可以想象成，是上面定义的接口中抽象方法参数的列表）</li>\n<li>右侧：Lambda表达式中，所需要执行的功能，即Lambda体（需要对抽象方法实现的功能）</li>\n</ul>\n<h3>语法格式</h3>\n<h4>1、无参，无返回值</h4>\n<p>格式：</p>\n<pre><code>() -&gt; System.out.println(“hello”);\n</code></pre>\n<p>举例：</p>\n<pre><code>    public static void test() {\n        Runnable r = new Runnable() {\n            @Override\n            public void run() {\n                System.out.println(&quot;hello&quot;);\n            }\n        };\n\n        System.out.println(&quot;=========&quot;);\n\n        Runnable runnable = () -&gt; {\n            System.out.println(&quot;hello lambda&quot;);\n        };\n    }\n</code></pre>\n<p>JDK1.8以后，调用Lambda外的值，不需要增加final字段，它默认已经添加了final</p>\n<pre><code>int n = 10;\nRunnable runnable = () -&gt; {\n	System.out.println(&quot;hello lambda&quot; + n);\n};\n</code></pre>\n<h4>2、有一个参数，有返回值</h4>\n<p>格式：</p>\n<pre><code>(x) -&gt; System.out.println(x);\n或  (一个参数时，小括号可以省略不写)\nx -&gt; System.out.println(x);\n</code></pre>\n<p>实例：</p>\n<pre><code>public static void test2() {\n    Consumer&lt;String&gt; consumer = (x) -&gt; System.out.println(x);\n    consumer.accept(&quot;我在bilibili&quot;);\n}\n</code></pre>\n<h4>3、有多个参数，一个返回值</h4>\n<pre><code>    /**\n     * 多个参数，有返回值\n     */\n    public static void test3() {\n        Comparator&lt;Integer&gt; comparator = (x, y) -&gt; {\n            System.out.println(&quot;函数式接口&quot;);\n            return Integer.compare(x, y);\n        };\n    }\n</code></pre>\n<h4>4、有多个参数，只有一条语句</h4>\n<p>这个时候，可以省略大括号 和 return</p>\n<pre><code>\n    /**\n     * 多个参数，函数体只有一条，并且有返回值时\n     */\n    public static void test4() {\n        Comparator&lt;Integer&gt; comparator = (x, y) -&gt; Integer.compare(x, y);\n    }\n</code></pre>\n<h3>类型推断</h3>\n<p>Lambda中，表达式的参数列表的数据类型可以省略不写，因为JVM编译器通过上下文推断出，数据类型，即“类型推断”。</p>\n<pre><code>(Integer x, Integer y) -&gt; Integer.compare(x, y);\n</code></pre>\n<p>但是底层的类型检查还是有的，只是JDK底层帮我们做了类型检查这件事</p>\n<h2>函数式接口</h2>\n<p>Lambda表达式需要“函数式接口”的支持</p>\n<p>函数式接口：接口中只有一个抽象方法的接口，称为函数式接口，如：</p>\n<pre><code>/**\n * 函数式接口 \n */\npublic interface MyPredicte&lt;T&gt; {\n    public boolean test(T t);\n}\n</code></pre>\n<p>可以使用注解 <code>@FunctionalInterface</code> 修饰的，则为函数式接口</p>\n<pre><code>/**\n * 接口，用于解决重复条件\n * @param &lt;T&gt;\n */\n@FunctionalInterface\npublic interface MyPredicte&lt;T&gt; {\n    public boolean test(T t);\n}\n\n</code></pre>\n<h2>场景</h2>\n<p>对一个数进行某种运算</p>\n<p>首先创建一个函数式接口</p>\n<pre><code>@FunctionalInterface\npublic interface MyFun {\n    public Integer getValue(Integer value);\n}\n</code></pre>\n<p>然后在定义一个方法，把方法作为参数传递</p>\n<pre><code>    /**\n     * 需求：对一个数进行运算\n     */\n    public static void test5() {\n        Integer value = operation(100, (x) -&gt; x*x);\n        System.out.println(value);\n    }\n\n    public static Integer operation(Integer num, MyFun myFun) {\n        return myFun.getValue(num);\n    }\n</code></pre>\n<h2>训练</h2>\n<ul>\n<li>调用Collections.sort()方法，通过定制排序比较两个Employee（先比较年龄比，年龄相同比较姓名），使用Lambda表达式</li>\n</ul>\n<pre><code>    public static void test() {\n        List&lt;Employee&gt; employees = Arrays.asList(\n                new Employee(&quot;张三&quot;, 18, 3333),\n                new Employee(&quot;李四&quot;, 38, 55555),\n                new Employee(&quot;王五&quot;, 50, 6666.66),\n                new Employee(&quot;赵六&quot;, 16, 77777.77),\n                new Employee(&quot;田七&quot;, 8, 8888.88)\n        );\n        Collections.sort(employees, (e1, e2) -&gt; {\n            if(e1.getAge() == e2.getAge()) {\n                return e1.getName().compareTo(e2.getName());\n            } else {\n                return Integer.compare(e1.getAge(), e2.getAge());\n            }\n        });\n\n        employees.stream().map(Employee::getName).forEach(System.out::println);\n    }\n</code></pre>\n<h2>Java内置函数接口</h2>\n<h2>Comsumer 消费型接口</h2>\n<p>格式：<code>Comsumer&lt;T&gt;</code></p>\n<p>传入参数，然后对参数进行操作，没有返回值</p>\n<pre><code>    /**\n     * 消费型接口\n     */\n    public static void test() {\n        happy(1000, (m) -&gt; System.out.println(&quot;消费成功：&quot; + m + &quot;元&quot;));\n    }\n    public static void happy(double money, Consumer&lt;Double&gt; consumer) {\n        consumer.accept(money);\n    }\n</code></pre>\n<h2>Supplier 供给型接口</h2>\n<p>格式：<code>Supplier&lt;T&gt;</code></p>\n<p>T get();</p>\n<p>传入参数，对参数进行操作，然后有返回值</p>\n<pre><code>    /**\n     * 供给型接口，供给功能如何实现\n     */\n    public static void test2() {\n        List&lt;Integer&gt; list = getNumList(10, () -&gt; {\n          Integer a =   (int)(Math.random() * 10);\n          return a;\n        });\n\n        list.stream().forEach(System.out::println);\n    }\n\n    /**\n     * 产生指定个数的整数\n     * @param n\n     * @return\n     */\n    public static List&lt;Integer&gt; getNumList(Integer n, Supplier&lt;Integer&gt; supplier) {\n        List&lt;Integer&gt; list = new ArrayList&lt;&gt;();\n        for (int i = 0; i &lt; n; i++) {\n            list.add(supplier.get());\n        }\n        return list;\n    }\n</code></pre>\n<p>最后输出结果</p>\n<pre><code>0\n5\n9\n4\n4\n3\n4\n5\n0\n3\n</code></pre>\n<h2>Function 函数型接口</h2>\n<p>格式：<code>Function&lt;T,R&gt;</code></p>\n<p><code>R apply(T t);</code></p>\n<pre><code>    /**\n     * 函数型接口\n     * Function&lt;T, R&gt;\n     */\n    public static void test3() {\n        String str = strHandler(&quot;abcdefg&quot;, (x) -&gt; {\n            return x.toUpperCase().substring(0, 5);\n        });\n        System.out.println(str);\n    }\n\n    /**\n     * 需求：用于处理字符串\n     */\n    public static String strHandler(String str, Function&lt;String, String&gt; function) {\n        // 使用apply方法进行处理，怎么处理需要具体实现\n        return function.apply(str);\n    }\n</code></pre>\n<p>输出结果：</p>\n<pre><code>ABCDE\n</code></pre>\n<h2>Predicate 断言型接口</h2>\n<p>格式：<code>Predicate&lt;T&gt;</code>， 用于做一些判断</p>\n<pre><code>    /**\n     * 断言型接口(把长度大于3的str过滤出来)\n     */\n    public static void test4() {\n        List&lt;String&gt; list = Arrays.asList(&quot;abc&quot;, &quot;abcd&quot;, &quot;df&quot;, &quot;cgg&quot;, &quot;aaab&quot;);\n        List&lt;String&gt; result = strPredict(list, (x) -&gt; x.length() &gt; 3);\n        result.forEach(item -&gt; {\n            System.out.println(item);\n        });\n    }\n\n    /**\n     * 将满足条件的字符串，放入到集合中\n     */\n    public static List&lt;String&gt; strPredict(List&lt;String&gt; list, Predicate&lt;String&gt; predicate) {\n        List&lt;String&gt; result = new ArrayList&lt;&gt;();\n        list.forEach(item -&gt; {\n            if(predicate.test(item)) {\n                result.add(item);\n            }\n        });\n        return result;\n    }\n</code></pre>\n<h2>扩展</h2>\n<p>上述的四大核心接口，并不能被适用于一个特殊的应用场景，只能满足大部分的需求</p>\n<p>因为他们对于参数的参入有局限性</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314505.png\" alt=\"image-20200406093105110\" /></p>\n<p>同时后面针对这样的情况，后面也使用子接口，进行了解决</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568314539.png\" alt=\"image-20200406093204147\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<h1>Java8新特性</h1>\n<h2>主要特性</h2>\n<ul>\n<li>Lambda表达式</li>\n<li>函数式接口</li>\n<li>方法引用与构造器引用</li>\n<li>Stream API</li>\n<li>接口中默认方法与静态方法</li>\n<li>新时间日期API</li>\n<li>最大化减少空指针异常（Optional）</li>\n<li>。。。。</li>\n</ul>\n<h2>HashMap优化</h2>\n<h3>HashMap1.7</h3>\n<p>在JDK1.7 到 JDK1.8的时候，对HashMap做了优化</p>\n<p>首先JDK1.7的HashMap当出现Hash碰撞的时候，最后插入的元素会放在前面，这个称为 “头插法”</p>\n<blockquote>\n<p>JDK7用头插是考虑到了一个所谓的热点数据的点(新插入的数据可能会更早用到)，但这其实是个伪命题,因为JDK7中rehash的时候，旧链表迁移新链表的时候，如果在新表的数组索引位置相同，则链表元素会倒置(就是因为头插) 所以最后的结果 还是打乱了插入的顺序 所以总的来看支撑JDK7使用头插的这点原因也不足以支撑下去了 所以就干脆换成尾插 一举多得</p>\n</blockquote>\n<p><img src=\"images/image-20200405101639700.png\" alt=\"image-20200405101639700\" /></p>\n<h3>HashMap1.7存在死链问题</h3>\n<p>参考：<a href=\"https://blog.csdn.net/chenyiminnanjing/article/details/82706942\">hashmap扩容时死循环问题</a></p>\n<p>在JDK1.8以后，由头插法改成了尾插法，因为头插法还存在一个死链的问题</p>\n<p>在说死链问题时，我们先从Hashmap存储数据说起，下面这个是HashMap的put方法</p>\n<pre><code>public V put(K key, V value)\n{\n    ......\n    //计算Hash值\n    int hash = hash(key.hashCode());\n    int i = indexFor(hash, table.length);\n    //各种校验吧\n    for (Entry&lt;K,V&gt; e = table[i]; e != null; e = e.next) {\n        Object k;\n        if (e.hash == hash &amp;&amp; ((k = e.key) == key || key.equals(k))) {\n            V oldValue = e.value;\n            e.value = value;\n            e.recordAccess(this);\n            return oldValue;\n        }\n    }\n    modCount++;\n    //该key不存在，需要增加一个结点\n    addEntry(hash, key, value, i);\n    return null;\n}\n</code></pre>\n<p>这里添加一个节点需要检查是否超出容量，出现一个负载因子</p>\n<pre><code>void addEntry(int hash, K key, V value, int bucketIndex)\n{\n    Entry&lt;K,V&gt; e = table[bucketIndex];\n    table[bucketIndex] = new Entry&lt;K,V&gt;(hash, key, value, e);\n    //查看当前的size是否超过了我们设定的阈值threshold，如果超过，需要resize\n    if (size++ &gt;= threshold)\n        resize(2 * table.length);//扩容都是2倍2倍的来的，\n}\n</code></pre>\n<blockquote>\n<p>HashMap有 负载因子：0.75，以及 初始容量：16，扩容阈值：16*0.75 = 12，当HashMap达到扩容的条件时候，会把HashMap中的每个元素，重新进行运算Hash值，打入到扩容后的数组中。</p>\n</blockquote>\n<p>既然新建了一个更大尺寸的hash表，然后把数据从老的Hash表中迁移到新的Hash表中。</p>\n<pre><code>void resize(int newCapacity)\n{\n    Entry[] oldTable = table;\n    int oldCapacity = oldTable.length;\n    ......\n    //创建一个新的Hash Table\n    Entry[] newTable = new Entry[newCapacity];\n    \n    //将Old Hash Table上的数据迁移到New Hash Table上\n    transfer(newTable);\n    table = newTable;\n    threshold = (int)(newCapacity * loadFactor);\n}\n</code></pre>\n<p>重点在这个transfer()方法</p>\n<pre><code>void transfer(Entry[] newTable)\n{\n    Entry[] src = table;\n    int newCapacity = newTable.length;\n    //下面这段代码的意思是：\n    //  从OldTable里摘一个元素出来，然后放到NewTable中\n    for (int j = 0; j &lt; src.length; j++) {\n        Entry&lt;K,V&gt; e = src[j];\n        if (e != null) {\n            src[j] = null;\n            do {\n                Entry&lt;K,V&gt; next = e.next;\n                int i = indexFor(e.hash, newCapacity);\n                e.next = newTable[i];\n                newTable[i] = e;\n                e = next;\n            } while (e != null);\n        }\n    }\n}\n</code></pre>\n<p>do循环里面的是最能说明问题的，当只有一个线程的时候：</p>\n<p><img src=\"images/image-20200405110723887.png\" alt=\"image-20200405110723887\" /></p>\n<p>最上面的是old hash 表，其中的Hash表的size=2, 所以key = 3, 7, 5，在mod 2以后都冲突在table[1]这里了。接下来的三个步骤是Hash表 扩容变成4，然后在把所有的元素放入新表</p>\n<pre><code>do {\n    Entry&lt;K,V&gt; next = e.next; // &lt;--假设线程一执行到这里就被调度挂起了\n    int i = indexFor(e.hash, newCapacity);\n    e.next = newTable[i];\n    newTable[i] = e;\n    e = next;\n} while (e != null);\n</code></pre>\n<p>而我们的线程二执行完成了。于是我们有下面的这个样子</p>\n<p><img src=\"images/image-20200405111030936.png\" alt=\"image-20200405111030936\" /></p>\n<p><img src=\"images/image-20200405111105573.png\" alt=\"image-20200405111105573\" /></p>\n<p>注意，因为Thread1的 e 指向了key(3)，而next指向了key(7)，其在线程二rehash后，指向了线程二重组后的链表。我们可以看到链表的顺序被反转后。\n这里的意思是线程1这会还没有完全开始扩容，但e和next已经指向了，线程2是正常的扩容的，那这会在3这个位置上，就是7-&gt;3这个顺序。\n然后线程一被调度回来执行：</p>\n<p>先是执行 newTalbe[i] = e;\n然后是e = next，导致了e指向了key(7)，\n而下一次循环的next = e.next导致了next指向了key(3)\n注意看图里面的线，线程1指向线程2里面的key3.</p>\n<p><img src=\"images/image-20200405111205298.png\" alt=\"image-20200405111205298\" /></p>\n<p>线程一接着工作。把key(7)摘下来，放到newTable[i]的第一个，然后把e和next往下移。</p>\n<p><img src=\"images/image-20200405111254924.png\" alt=\"image-20200405111254924\" /></p>\n<p>这时候，原来的线程2里面的key7的e和key3的next没了，e=key3,next=null。</p>\n<p>当继续执行，需要将key3加回到key7的前面。\ne.next = newTable[i] 导致 key(3).next 指向了 key(7)</p>\n<p>注意：此时的key(7).next 已经指向了key(3)， 环形链表就这样出现了。</p>\n<p><img src=\"images/image-20200405111319072.png\" alt=\"image-20200405111319072\" /></p>\n<p>线程2生成的e和next的关系影响到了线程1里面的情况。从而打乱了正常的e和next的链。于是，当我们的线程一调用到，HashTable.get(11)时，即又到了3这个位置，需要插入新的，那这会就e 和next就乱了</p>\n<h3>HashMap每次扩容为什么是2倍</h3>\n<p>参考：<a href=\"https://blog.csdn.net/apeopl/article/details/88935422\">HashMap初始容量为什么是2的n次幂</a></p>\n<p>首先看向HashMap中添加元素是怎么存放的</p>\n<p><img src=\"images/image-20200405105335235.png\" alt=\"image-20200405105335235\" /></p>\n<p><img src=\"images/image-20200405105401674.png\" alt=\"image-20200405105401674\" /></p>\n<p>第一个截图是向HashMap中添加元素putVal()方法的部分源码，可以看出，向集合中添加元素时，会使用(n - 1) &amp; hash的计算方法来得出该元素在集合中的位置；而第二个截图是HashMap扩容时调用resize()方法中的部分源码，可以看出会新建一个tab，然后遍历旧的tab，将旧的元素进过e.hash &amp; (newCap - 1)的计算添加进新的tab中，也就是(n - 1) &amp; hash的计算方法，其中n是集合的容量，hash是添加的元素进过hash函数计算出来的hash值</p>\n<p>HashMap的容量为什么是2的n次幂，和这个(n - 1) &amp; hash的计算方法有着千丝万缕的关系，符号&amp;是按位与的计算，这是位运算，计算机能直接运算，特别高效，按位与&amp;的计算方法是，只有当对应位置的数据都为1时，运算结果也为1，当HashMap的容量是2的n次幂时，(n-1)的2进制也就是1111111***111这样形式的，这样与添加元素的hash值进行位运算时，能够充分的散列，使得添加的元素均匀分布在HashMap的每个位置上，减少hash碰撞，下面举例进行说明。</p>\n<p>当HashMap的容量是16时，它的二进制是10000，(n-1)的二进制是01111，与hash值得计算结果如下:</p>\n<p><img src=\"images/image-20200405105533985.png\" alt=\"image-20200405105533985\" /></p>\n<p>上面四种情况我们可以看出，不同的hash值，和(n-1)进行位运算后，能够得出不同的值，使得添加的元素能够均匀分布在集合中不同的位置上，避免hash碰撞，下面就来看一下HashMap的容量不是2的n次幂的情况，当容量为10时，二进制为01010，(n-1)的二进制是01001，向里面添加同样的元素，结果为：</p>\n<p><img src=\"images/image-20200405105704798.png\" alt=\"image-20200405105704798\" /></p>\n<p>可以看出，有三个不同的元素进过&amp;运算得出了同样的结果，严重的hash碰撞了。</p>\n<p>终上所述，HashMap计算添加元素的位置时，使用的位运算，这是特别高效的运算；另外，HashMap的初始容量是2的n次幂，扩容也是2倍的形式进行扩容，是因为容量是2的n次幂，可以使得添加的元素均匀分布在HashMap中的数组上，减少hash碰撞，避免形成链表的结构，使得查询效率降低</p>\n<h3>JDK1.8结构变化</h3>\n<p>由JDK1.7的，数组 + 链表</p>\n<p>JDK1.8变为：数组 + 链表 + 红黑树</p>\n<p>具体触发条件为：某个链表连接的个数大于8，并且总的容量大于64的时候，那么会把原来的链表转换成红黑树</p>\n<p>这么做的好处是什么：除了添加元素外，查询和删除效率比链表快</p>\n<p>红黑树查询、增加和删除的时间复杂度：O(log<sub>2</sub>n)</p>\n<p>链表的查询和删除的时间复杂度： O(n)，插入为：O(1)</p>\n<h3>ConcurrentHashMap变化</h3>\n<h4>为何JDK8要放弃分段锁？</h4>\n<p>由原来的分段锁，变成了CAS，也就是通过无锁化设计替代了阻塞同步的加锁操作，性能得到了提高。</p>\n<p>通过分段锁的方式提高了并发度。分段是一开始就确定的了，后期不能再进行扩容的，其中的段Segment继承了重入锁ReentrantLock，有了锁的功能，同时含有类似HashMap中的数组加链表结构（这里没有使用红黑树），虽然Segment的个数是不能扩容的，但是单个Segment里面的数组是可以扩容的。</p>\n<p>JDK1.8的ConcurrentHashMap摒弃了1.7的segment设计，而是JDK1.8版本的HashMap的基础上实现了线程安全的版本，即也是采用<strong>数组+链表+红黑树</strong>的形式，虽然ConcurrentHashMap的读不需要锁，但是需要保证能读到最新数据，所以必须加volatile。即数组的引用需要加volatile，同时一个Node节点中的val和next属性也必须要加volatile。</p>\n<p>至于为什么抛弃Segment的设计，是因为分段锁的这个段不太好评定，如果我们的Segment设置的过大，那么隔离级别也就过高，那么就有很多空间被浪费了，也就是会让某些段里面没有元素，如果太小容易造成冲突</p>\n<h2>内存结构优化</h2>\n<p>取消永久区，把方法区 放在 元空间中</p>\n<blockquote>\n<p>方法区主要用于存储一些类模板</p>\n</blockquote>\n<p><img src=\"images/image-20200405115011067.png\" alt=\"image-20200405115011067\" /></p>\n<p>OOM错误发生概率降低</p>\n<p>同时相关JVM调优命令变为：</p>\n<blockquote>\n<p>MetaspaceSize</p>\n<p>MaxMetaspaceSize</p>\n</blockquote>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<h2>Mysql默认搜索引擎</h2>\n<p>Mysql5.5以后默认使用InnoDB为搜索引擎</p>\n<p>MyISAM是表锁，不支持事务和主外键</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226467.png\" alt=\"image-20200404084731063\" /></p>\n<p>InnoDB默认可以创建16个索引</p>\n<h2>硬盘</h2>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226583.png\" alt=\"image-20200404085422944\" /></p>\n<p>Mysql是存储在硬盘上，因此Redis比Mysql快</p>\n<h2>索引</h2>\n<p>Mysql官方对索引的定位为：索引是帮助Mysql高效获取数据的数据结构，可以得到索引的本质就是，索引是数据结构。</p>\n<p>可以简单的理解为：排好序的快速查找B+树数据结构，B+树中的B代表平衡(balance) 而不是 二叉（binary）</p>\n<h2>检索原理</h2>\n<p>在数据之外，数据库系统还维护着满足特定查找算法的数据结构，这些数据结构以某种方式引用（指向）数据，这样就可以在这些数据上实现高级查找算法，这种数据结构，就是索引。下图就是一种可能的索引方式示例：</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226626.png\" alt=\"image-20200404090022629\" /></p>\n<p>为了加快Col2的查找，可以维护一个左边所示的二叉树，每个节点分别包含索引键值和一个指向对应数据记录的物理地址的指针，这样就可以运用二叉树在一定的复杂度内获取相应数据，从而快速的检索出符合条件的记录。</p>\n<h2>B+树</h2>\n<p>B树：Balance Tree，多路平衡查找树</p>\n<p>B+树：加强版多路平衡查找树</p>\n<p>tip：没有B-树，B-树就是B树，中间不是减号而是横线</p>\n<h2>Mysql搜索引擎的发展之路</h2>\n<p>Mysql InnoDB的搜索引擎 的 底层也不是一来就是 B+树的，而是经过了不断的迭代过程</p>\n<ul>\n<li>全部遍历</li>\n<li>Hash</li>\n<li>二叉树</li>\n<li>平衡二叉树（AVL）</li>\n<li>B树</li>\n<li>B+树</li>\n</ul>\n<h3>全部遍历</h3>\n<p>相当于全表查询，把每条数据都查找一遍</p>\n<h3>Hash</h3>\n<p>加速查找速度的数据结构，常见的有两类</p>\n<ul>\n<li>哈希，例如HashMap，查询、插入、修改、删除的平均时间复杂度都是O(1)</li>\n<li>树：例如平衡二叉搜索树，查询、插入、修改、删除的平均事件复杂度都是O(log<sub>2</sub> (n))</li>\n</ul>\n<p>可以看到，不管是读请求，还是写请求，哈希类型的索引，都要比树型的索引更快一些，为什么不用Hash做索引呢，而要设计成树型结构呢？</p>\n<p>假设SQL语句为：</p>\n<pre><code>select * from student where age = 15\n</code></pre>\n<p>我们能够通过Hash就可以很好的用Hash进行解决</p>\n<p>但是随着SQL的复杂化，对于以下范围查找，Hash就搞不定了，也就是说Hash就只能解决查1的问题</p>\n<pre><code>select * from student where age &gt; 15 and age &lt; 20\n</code></pre>\n<p>想想范围/排序等其它SQL条件：</p>\n<p>哈希型的索引，时间复杂度会退化O(n) 而树型的“有序” 特性，依然能够保持 O(log<sub>2</sub>(n) )</p>\n<p>InnoDB：并不支持Hash索引</p>\n<h3>二叉树</h3>\n<p>二叉树的特点</p>\n<ul>\n<li>一个节点只能有两个子节点，也就是一个节点的度不能超过2</li>\n<li>左子节点小于本节点，右子节点大于等于本节点，比我大的向右，比我小的向做</li>\n</ul>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226684.png\" alt=\"image-20200404093846645\" /></p>\n<p>对该二叉树的节点查找发现：</p>\n<p>深度为1的节点查找次数为：1</p>\n<p>深度为2的节点查找次数为：2</p>\n<p>深度为N的节点查找次数为：N</p>\n<p>结论：因此其平均查找长度为：(1+2+2+3+3+3) / 6 = 2.3次</p>\n<h4>问题</h4>\n<ul>\n<li>如果ID是持续递增的话，会出现什么样的结构？</li>\n</ul>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226716.png\" alt=\"image-20200404094336765\" /></p>\n<p>这样树型结构，又会退化到 O(n) 的时间复杂度</p>\n<h3>平衡二叉树（AVL）</h3>\n<h4>结构图</h4>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226766.png\" alt=\"image-20200404094719626\" /></p>\n<h4>问题</h4>\n<p>从算法的数学逻辑来讲，二叉树的查找速度和比较次数都是最小的，那为什么我们选择BTree?因为AVL还有一个问题，那就是 磁盘IO的问题</p>\n<ul>\n<li>磁盘IO的次数，就是由树高来决定的，也即磁盘的IO次数最坏的情况下就等于树的高度。</li>\n</ul>\n<p>随着数据量增加，树就会越高，那么查找的就越慢，而且导致的IO操作增加</p>\n<h4>解决方法</h4>\n<p>我们需要解决的就是树的高度问题，导致磁盘IO过多</p>\n<p>那么就需要将树进行压缩，也就是将原来的瘦高 -&gt; 矮胖，通过降低树的高度达到减少IO的次数</p>\n<h3>B树</h3>\n<p>B树，又被称为 2-3树，也就是B树上的节点，可能是2，也可能是3</p>\n<h4>结构图：</h4>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226793.png\" alt=\"image-20200404100139814\" /></p>\n<h4>底层原理</h4>\n<p>数据库索引是存储在磁盘上的，如果数据很大，必然导致索引的大小也会很大，超过几个G（好比新华字典字数多必然导致目录厚）</p>\n<p>当我们利用索引查询时，是不可能将全部几个G的索引都加载进内存的，我们能做的只能是：</p>\n<p>逐一加载每一个磁盘页，因为磁盘页对应着索引树的节点。</p>\n<p>InnoDB的 page_size</p>\n<pre><code>SHOW GLOBAL STATUS LIKE \'Innodb_page_size\';\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226827.png\" alt=\"image-20200404151334993\" /></p>\n<p>系统从磁盘读取数据到内存时是以磁盘块（block）为单位的，位于同一磁盘块中的数据会被一次性读取出来，而不是需要什么取什么</p>\n<p>InnoDB存储引擎中有页(Page)的概念，页是其磁盘管理的最小单位。</p>\n<p>系统一个磁盘块的存储空间往往没有这么大，因此InnoDB每次申请磁盘空间时都会是若干地址连续磁盘块来达到页的大小16KB。InnoDB在把磁盘数据读入到磁盘时会以页为基本单位，在查询数据时如果一个页中每条数据都有助于定位数据记录的位置，这将会减少磁盘I/O次数，提高效率。</p>\n<p>一句话说：就是多个块填充到一页大小</p>\n<h4>检索原理</h4>\n<p>B树比平衡二叉树减少了一次IO操作</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226857.png\" alt=\"image-20200404152149658\" /></p>\n<p>每个节点占用一个盘块的磁盘空间，一个节点上有两个升序排序的关键字和三个指向子树根节点的指针，指针存储的是子节点所在磁盘块的地址。</p>\n<p>模拟查找关键字29的过程</p>\n<ul>\n<li>根据根节点找到磁盘块1，读入内存【磁盘IO操作1次】</li>\n<li>比较关键字29在区间(17, 35)，找到磁盘块1的指针P2。</li>\n<li>根据P2指针找到磁盘块3，读入内存。【磁盘IO操作第2次】</li>\n<li>比较关键字29在区间(26, 30)，找到磁盘块3的指针P2。</li>\n<li>根据P2指针找到磁盘块8，读入内存。【磁盘IO操作3次】</li>\n<li>在磁盘块8中的关键字列表，找到关键字29</li>\n</ul>\n<p>分析上述过程，发现需要3次IO操作，和3次内存查找操作，由于内存中的关键字是一个有序表结构，可以利用二分法查找提高效率。而3次磁盘IO操作是影响整个BTree查找效率的决定性因素。BTree相对于AVLTree缩减了节点个数，使每次磁盘IO取到内存的数据都发挥了作用，从而提高了查找效率。</p>\n<h3>B+树</h3>\n<p>B+树把所有数据放在叶子节点，形成了链表，我们查找数据更方便</p>\n<p>好查，好排序，好划定范围</p>\n<h4>B+树结构图</h4>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226873.png\" alt=\"image-20200404155456211\" /></p>\n<p>把两种数据结构集成在一块了：树 + 链表</p>\n<p>图中可以看出所有的data信息都移动叶子节点中，而且子节点和子节点之间会有指针指向，这个也是B+树的核心点，这样可以大大提升范围查找效率，也方便遍历整个树。</p>\n<ul>\n<li>非叶子节点不在存储数据，数据只存储在同一层的叶子节点上</li>\n<li>叶子之间，增加链表，获取所有节点，不再需要中序遍历</li>\n<li>这也说明了，B+树的检索性能比B树强</li>\n</ul>\n<h4>检索原理</h4>\n<p>由于B+树的非叶子只存储键值信息，假设每个磁盘块能存储4个键值及指针信息，那就变成如下结构</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568226918.png\" alt=\"image-20200404161422032\" /></p>\n<p>B树结构图中可以看出每个节点不仅包含数据的key值，还有data值，而每一页的存储空间是有限的，如果data数据较大时将会导致每个节点（即一个页）能存储的key的数量很小，当存储数量很大时同样会导致B树的深度较大，增大查询时的磁盘IO次数进而影响查询效率。</p>\n<h2>Mysql为什么是B+树</h2>\n<p>B+树中，所有数据记录节点都是按照键值大小顺序存放在同一层叶子节点上，而非叶子节点上只存储key值信息，这样可以大大加大每个节点存储的key值数量，降低B+树的高度。</p>\n<ul>\n<li>InnoDB存储引擎的最小存储单元是页，页可以用于存放数据，也可以用于存放键值+指针，在B+树中叶子节点存放数据，而非叶子节点存放键值+指针</li>\n<li>索引组织表通过非叶子节点的二分查找法以及指针确定数据在哪个页中，首先找到根页进而去数据页查找到需要的数据</li>\n</ul>\n<p>B+树算法：通过集成B树的特征，B+树相比B树，新增叶子节点与非叶子节点关系，叶子节点包含了键值和数据，非叶子节点只是包含键值和子节点引用，不包含数据。</p>\n<p>通过非叶子节点查询叶子节点获取相应的数据，所有相邻的叶子节点包含非叶子节点使用链表进行结合，叶子节点是顺序并且相邻节点有顺序引用关系。</p>\n<h4>结论</h4>\n<p>从B树到B+树，B+树在B树的基础上的一种优化使其更适合实现外存储索引结构，InnoDB存储引擎就是用B+树实现的索引结构</p>\n<p>B树和B+树的不同之处</p>\n<ul>\n<li>非叶子节点只存储键值信息</li>\n<li>所有叶子节点之间都有一个链指针</li>\n<li>数据记录都存放在叶子节点中</li>\n</ul>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=我是默认标题, summary=默认简介, content=<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568188262.png\" alt=\"\" /></p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/11/1586568188300.png\" alt=\"image-20200411085724059\" /></p>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=1ec7047fe5c672d7c756bf79405cd04b, fileUid=null, adminUid=null, isPublish=0, isOriginal=1, author=陌溪, articlesPart=null, level=0, tagList=[Tag(content=测试标签, clickCount=1, sort=12)], photoList=null, blogSort=BlogSort(sortName=测试1, content=测试1, clickCount=0, sort=0), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)]}','删除选中博客',1,'2020-04-11 10:16:31','2020-04-11 10:16:31','XX|XX|内网IP|内网IP',207),('553b80fe23d4a20dfe78a418bb72311f','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@2dfa7dd]}','本地博客