:31','XX|XX|内网IP|内网IP',3),('5d1361aefdf79b722758a06a387bce7d','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/delete','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','delete','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"blogVO\":BlogVO(title=null, summary=null, content=null, tagUid=null, blogSortUid=null, fileUid=null, adminUid=null, isPublish=null, isOriginal=null, author=null, articlesPart=null, level=0, tagList=null, photoList=null, blogSort=null, praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=null, startComment=null)}','删除博客',1,'2020-04-11 00:18:48','2020-04-11 00:18:48','XX|XX|内网IP|内网IP',492),('5d691d16c754eb077882b4ef25f9ed25','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/edit','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','edit','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"blogVO\":BlogVO(title=默认标题, summary=默认简介, content=<h1>斐波那契数列</h1>\n\n<h2>题目</h2>\n\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n\n<p>n&lt;=39</p>\n\n<h2>菲波那切数列是什么</h2>\n\n<pre>\n<code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n\n<h2>递归方法实现</h2>\n\n<pre>\n<code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n\n<h3>存在问题</h3>\n\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n\n<p><img alt=\"image-20200422211936865\" src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587990240589.png\" /></p>\n\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n\n<h2>非递归实现</h2>\n\n<p>我们继续查看刚刚的规律</p>\n\n<pre>\n<code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n\n<pre>\n<code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=1, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)}','编辑博客',1,'2020-04-27 20:24:27','2020-04-27 20:24:27','XX|XX|内网IP|内网IP',140),('5d9557c55db465ac8931a92718b7a067','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/edit','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','edit','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"request\":SecurityContextHolderAwareRequestWrapper[ org.springframework.security.web.header.HeaderWriterFilter$HeaderWriterRequest@1250e1e3],\"blogVO\":BlogVO(title=测试2, summary=测试2, content=<p>测试2</p>\n, tagUid=6b0ba63beabccc91c4f8fb938984f8a3, blogSortUid=6a1c7a50c0e7b8e8657949bf02d5d0