6:18','2020-04-10 11:16:18','XX|XX|内网IP|内网IP',18),('8e7dda5648c70edc2e88eab4894097d5','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/add','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','add','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"blogVO\":BlogVO(title=123, summary=123, content=<p>123</p>\n, tagUid=6b0ba63beabccc91c4f8fb938984f8a3, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=null, adminUid=null, isPublish=1, isOriginal=1, author=null, articlesPart=null, level=0, tagList=null, photoList=null, blogSort=null, praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=null, startComment=1)}','增加博客',1,'2020-04-23 15:49:59','2020-04-23 15:49:59','XX|XX|内网IP|内网IP',104),('8e7df5c2fc9493a201a2e3961a4341ed','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/system/editMe','POST','com.moxi.mogublog.admin.restapi.SystemRestApi','editMe','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"adminVO\":AdminVO(userName=admin, passWord=null, nickName=admin, gender=1, avatar=,63da0632ccf7f1fde167bdf92ff25b6b, email=1595833114@qq.com, birthday=null, mobile=null, qqNumber=1595833114, weChat=null, occupation=Java开发, summary=null, personResume=<h2>前言</h2>\r\n\r\n<p>目前博客源码已经开源至码云和Github中，感兴趣的小伙伴可以star关注一下下~</p>\r\n\r\n<p>Gitee地址：<a href=\"https://gitee.com/moxi159753/mogu_blog_v2\">https://gitee.com/moxi159753/mogu_blog_v2</a></p>\r\n\r\n<p>Github地址：<a href=\"https://github.com/moxi624/mogu_blog_v2\">https://github.com/moxi624/mogu_blog_v2</a></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<h2>关于我</h2>\r\n\r\n<p>许志翔，目前就读于桂林电子科技大学，是一名研二的学生，所属计算机信息与安全学院，研究方向是教育大数据，是一名&quot;不顾正业&quot;的研究僧，沉迷于Java和Vue技术开发，梦想着进入BATJ，也将一直为此不断努力了~</p>\r\n\r\n<p>正宗95后，爱编程，爱旅游，爱生活，爱锻炼，从刚研究生入学后，就坚持着两件事，一个是写代码，一个就是每天5公里慢跑</p>\r\n\r\n<pre>\r\n<code>意志力和天生才华，都是人们在事实发生了之后再去赋予某个人的优点：杰森是位不可思议的网球选手，因此，他一定生下来就具有这种才华；杰尼年复一年地练习拉小提琴，每天坚持几个小时，因此，他一定有着令人难以置信的意志力。\r\n\r\n——《刻意练习：从新手到大师》</code></pre>\r\n\r\n<p>最近可能随着研究生生涯过半，已经要着手开始写小论文的事情了，博客项目的更新估计会变的比较缓慢，应该不会存在大版本的更新迭代了</p>\r\n\r\n<p>不过目前博客项目的技术功能也编写的差不多，可能还要做的就是SEO优化，后面一段时间应该注重于网站的稳定性和BUG的解决，要是小伙伴在使用的时候，发现了什么问题，欢迎私聊我，或者在QQ群里提出~</p>\r\n\r\n<p>在今年的8、9月份，也该着手于校招了，后面应该更多的时间沉淀在Java的基础学习了，当然如果有老哥有内推名额的话，欢迎推荐我一下下....&nbsp; &nbsp;卑微.jpg&nbsp;</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/52552ed0efb245a9a67d5c9928d72e14\" /></p>\r\n\r\n<p>回顾2019年，每天也会在项目中，花费一些时间去提交代码，可能有的时候是增加了新功能，有的时候是解决一个BUG，到现在已经成为了一个习惯了，因此博客项目中也添加了比较多的有趣的功能，比如这个文章贡献度</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/aaff67a315c547c5964f0aebb4e8ce23\" /></p>\r\n\r\n<p>哈哈哈，其实它和码云上的代码贡献度是一样的，每次发表一篇博客，就会标记出个点，点越大说明该天发表博客越多，可能是因为自己有些强迫症的原因，不过我也希望能够借此来激励自己养成每天写博客的习惯，通过分享自己学习到的东西，来和各位IT的前辈们共同进步。</p>\r\n\r\n<p>当然闲暇之余也会玩玩游戏，有空的时候会在酒馆搓搓炉石~，玩玩农药，有喜欢的小伙伴也可以一起，虽然我贼菜</p>\r\n\r\n<hr />\r\n<h2>项目起因</h2>\r\n\r\n<p>本博客项目由我和几个小伙伴参与开发的，最开始的搭建蘑菇博客的初心是为了巩固和学习Java开发的一些知识，因此项目的技术选型都是比较新颖的技术，可能这些技术并不一定适用于博客系统，但是我也想着能尽可能把更多的技术融合进来，毕竟通过自己手把手的操作一遍，也能够算是入门了。我也很庆幸我成功将自己的项目开源出来了，并且坚持下来，蘑菇博客起源是2018年9月，到想在也已经度过了1年半的岁月。我也从最开始只会一点点Jsp和Servlet就出去找工作的傻小子慢慢成长了，在读研之前，我也在公司里呆过，算上来好像将近快一年，很感谢之前在公司里的同事和领导，是他们带我入门企业级的项目开发，让我养成了很多Java项目开发的规范。</p>\r\n\r\n<p>起初项目开源在码云上，没有多少人关注，所以自己也是坚持做自己的喜欢的事，有的时候是看看论文，有的时候敲敲代码，在2019年12月14日，蘑菇博客被码云推荐了，上了首页</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/49865d11fd4c4b289d87bf305b2dde0a\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>然后项目的关注度就开始上升了，有些小伙伴就开始关注项目的运行和部署了，所以我也花费了一些时间，整理了博客的开发、运行、部署的文档，希望每个小伙伴都能够通过本项目一起学习</p>\r\n\r\n<p>目前蘑菇博客已经有300star了，很高兴大家对蘑菇博客项目的认可</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/f55b31b7e00b42eda71e88105c4e147a\" /></p>\r\n\r\n<p>同时因为更新比较勤快，项目也在码云&nbsp; 博客&nbsp; &nbsp;关键字搜索的第一个，不过未来要走得路还很长，我也希望能够认识更多志同道合的小伙伴，然后一起学习和交流</p>\r\n\r\n<p><img src=\"http://image.moguit.cn/36588a0c8bf04e9bb103eac0f432bfa7\" /></p>\r\n, github=https://github.com/moxi624/mogu_blog_v2, gitee=https://gitee.com/moxi159753/mogu_blog_v2)}','编辑我的信息',1,'2020-04-07 17:34:12','2020-04-07 17:34:12','XX|XX|内网IP|内网IP',138),('911e269bbd4e2e4170da0fb3581a07c7','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/picture/setCover','POST','com.moxi.mogublog.admin.restapi.PictureRestApi','setCover','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"pictureVO\":PictureVO(fileUid=null, fileUids=null, picName=null, pictureSortUid=976dbeb57cb6d5234c1c73e1de8522cf)}','通过图片Uid将图片设为封面',1,'2020-04-07 15:45:32','2020-04-07 15:45:32','XX|XX|内网IP|内网IP',186),('911e705d41ab27a96c7aeb3772b3b479','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/pictureSort/getPictureSortByUid','POST','com.moxi.mogublog.admin.restapi.PictureSortRestApi','getPictureSortByUid','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"pictureSortVO\":PictureSortVO(parentUid=null, name=null, fileUid=null, sort=0)}','通过Uid获取分类',1,'2020-04-07 15:53:36','2020-04-07 15:53:36','XX|XX|内网IP|内网IP',5),('917d2e5c81865ec62883f66eb14380c2','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/categoryMenu/add','POST','com.moxi.mogublog.admin.restapi.CategoryMenuRestApi','add','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"categoryMenuVO\":CategoryMenuVO(name=本地上传, menuLevel=3, menuType=1, summary=本地文件上传, icon=, parentUid=1f01cd1d2f474743b241d74008b12333, url=/blog/uploadLocalBlog, sort=null, isShow=1)}','增加菜单',1,'2020-04-15 17:28:36','2020-04-15 17:28:36','XX|XX|内网IP|内网IP',54),('927ac36c99ec493b0332abbd08f35dac','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/deleteBatch','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','deleteBatch','{\"blogVoList\":[BlogVO(title=默认标题, summary=默认简介, content=<h1>斐波那契数列</h1>\n<h2>题目</h2>\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n<p>n&lt;=39</p>\n<h2>菲波那切数列是什么</h2>\n<pre><code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n<h2>递归方法实现</h2>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n<h3>存在问题</h3>\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036727470.png\" alt=\"image-20200422211936865\" /></p>\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n<h2>非递归实现</h2>\n<p>我们继续查看刚刚的规律</p>\n<pre><code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588036728348.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1