,\"ffc6e9ca2cc243febf6d2f476b849163\",\"2a733ff390af9b44ecda4e8c4634dh8c\",\"327d945daf4ddb71976c4ab3830e7g7d\",\"f87d2f9b4539abbade38583420dc8i9b\",\"fbc30e4ae5bb33b39baca7bf6bd8cj0a\",\"9449ce5dd5e24b21a9d15f806cb36e87\",\"2a733ff390af9b44ecda4e8c4634db8k\",\"327d945daf4ddb71976c4ab3830e7d7i\",\"aef85c40b54320d7c5a9d78697e12e6n\",\"f87d2f9b4539abbade38583420dc8c9l\",\"fbc30e4ae5bb33b39baca7bf6bd8ca0m\",\"147cd431cbb9007bde87444d7987b151\",\"cbd7ba11c1b38c66b569405ed9185f35\",\"bfc9463e59a3ca250dcfc1c86627e034\",\"2a733ff390af9b44ecda4e8c4634d75u\",\"a9396f1a3fbdec3d4cb614f388a22bea\",\"93f7fd9a6e81735c47649e6b36042b5d\",\"505b4769b77617a314a3ed78e4acdff7\",\"079f0cfdb7a7017d827f5c349983eebc\",\"02ea2f9ef5d44f559fb66189b05f6769\",\"2a733ff390af9b44ecda4e8c4634d75v\"])}','更新角色信息',1,'2020-04-15 17:28:59','2020-04-15 17:28:59','XX|XX|内网IP|内网IP',165),('dc58ed0d327e7f2b353b2bf8fce81033','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/deleteBatch','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','deleteBatch','{\"blogVoList\":[BlogVO(title=默认标题, summary=默认简介, content=<h1>斐波那契数列</h1>\n<h2>题目</h2>\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n<p>n&lt;=39</p>\n<h2>菲波那切数列是什么</h2>\n<pre><code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n<h2>递归方法实现</h2>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n<h3>存在问题</h3>\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588037311991.png\" alt=\"image-20200422211936865\" /></p>\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n<h2>非递归实现</h2>\n<p>我们继续查看刚刚的规律</p>\n<pre><code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n<pre><code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/28/1588037311854.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)]}','删除选中博客',1,'2020-04-28 09:32:15','2020-04-28 09:32:15','XX|XX|内网IP|内网IP',201),('dc923ac804e9894fdf31521dab7997c0','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/uploadLocalBlog','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','uploadPics','{\"filedatas\":[org.springframework.web.multipart.support.StandardMultipartHttpServletRequest$StandardMultipartFile@5388f120,org.springframework.web.multipart.supp