pringframework.validation.BeanPropertyBindingResult: 0 errors,\"pictureVO\":PictureVO(fileUid=null, fileUids=null, picName=null, pictureSortUid=null)}','删除图片',1,'2020-04-19 11:41:03','2020-04-19 11:41:03','XX|XX|内网IP|内网IP',226),('f05ccb34dc13cbba4fcfdb128e6dea18','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/edit','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','edit','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"request\":SecurityContextHolderAwareRequestWrapper[ org.springframework.security.web.header.HeaderWriterFilter$HeaderWriterRequest@5a695768],\"blogVO\":BlogVO(title=JAVA, summary=123, content=<p>123456789</p>\n, tagUid=6b0ba63beabccc91c4f8fb938984f8a3, blogSortUid=6a1c7a50c0e7b8e8657949bf02d5d0ca, fileUid=b7cc599479588334b7e799656478b425, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=1, isOriginal=1, author=admin, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签2, clickCount=1, sort=11)], photoList=[http://localhost:8600/blog/admin/jpg/2020/3/24/1585015264264.jpg], blogSort=BlogSort(sortName=测试分类, content=测试分类, clickCount=5, sort=23), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)}','编辑博客',1,'2020-03-29 19:55:32','2020-03-29 19:55:32','XX|XX|内网IP|内网IP',62),('f224d24324ef3051d4fced033e2cf781','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/pictureSort/getPictureSortByUid','POST','com.moxi.mogublog.admin.restapi.PictureSortRestApi','getPictureSortByUid','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"pictureSortVO\":PictureSortVO(parentUid=null, name=null, fileUid=null, sort=0)}','通过Uid获取分类',1,'2020-04-07 15:53:37','2020-04-07 15:53:37','XX|XX|内网IP|内网IP',4),('f304889575d5e32c4be1ea326bdd08a8','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/blog/deleteBatch','POST','com.moxi.mogublog.admin.restapi.BlogRestApi','deleteBatch','{\"blogVoList\":[BlogVO(title=默认标题, summary=默认简介, content=<h1>两个栈实现一个队列</h1>\n<h2>题目描述</h2>\n<p>用两个栈来实现一个队列，完成队列的Push和Pop操作。 队列中的元素为int类型。</p>\n<h2>思考</h2>\n<p>栈：先进后出</p>\n<p>队列：先进先出.</p>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587996717233.png\" alt=\"image-20200423094525763\" /></p>\n<p>我们需要使用一个栈用于接收数据，并且一个栈用于输出数据</p>\n<h2>代码</h2>\n<pre><code>class Solution:\n    def __init__(self):\n        # 接收栈\n        self.acceptStack = []\n        # 输出栈\n        self.outputStack = []\n\n    def push(self, node):\n        # 把节点放到栈中\n        self.acceptStack.append(node)\n\n    def pop(self):\n        # 从接收栈中获取元素，把它放入到 输出栈中\n        if self.outputStack == []:\n            while self.acceptStack:\n                self.outputStack.append(self.acceptStack.pop())\n\n        # 判断输出栈中是否有元素，有，则输出最后一个\n        if self.outputStack != []:\n            return self.outputStack.pop()\n        else:\n            return None\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587996717067.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>两个栈实现一个队列</h1>\n<h2>题目描述</h2>\n<p>用两个栈来实现一个队列，完成队列的Push和Pop操作。 队列中的元素为int类型。</p>\n<h2>思考</h2>\n<p>栈：先进后出</p>\n<p>队列：先进先出.</p>\n<p><img src=\"images/image-20200423094525763.png\" alt=\"image-20200423094525763\" /></p>\n<p>我们需要使用一个栈用于接收数据，并且一个栈用于输出数据</p>\n<h2>代码</h2>\n<pre><code>class Solution:\n    def __init__(self):\n        # 接收栈\n        self.acceptStack = []\n        # 输出栈\n        self.outputStack = []\n\n    def push(self, node):\n        # 把节点放到栈中\n        self.acceptStack.append(node)\n\n    def pop(self):\n        # 从接收栈中获取元素，把它放入到 输出栈中\n        if self.outputStack == []:\n            while self.acceptStack:\n                self.outputStack.append(self.acceptStack.pop())\n\n        # 判断输出栈中是否有元素，有，则输出最后一个\n        if self.outputStack != []:\n            return self.outputStack.pop()\n        else:\n            return None\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>青蛙跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级。求该青蛙跳上一个n级的台阶总共有多少种跳法（先后次序不同算不同的结果）</p>\n<h2>找规律</h2>\n<pre><code>当\n\n</code></pre>\n<p><img src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587996717067.png\" alt=\"image-20200422221734432\" /></p>\n<p>代码实现</p>\n<pre><code>class Solution:\n    def JumpFloor(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n == 2:\n            return 2;\n\n        ret = 0\n        a = 1\n        b = 2\n        for i in range(3, n + 1):\n            ret = a + b\n            a = b\n            b = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloor(10))\n</code></pre>\n<h1>变态跳台阶</h1>\n<h2>题目</h2>\n<p>一只青蛙一次可以跳上1级台阶，也可以跳上2级……它也可以跳上n级。求该青蛙跳上一个n级的台阶总共有多少种跳法。</p>\n<h2>找规律</h2>\n<pre><code>当 n = 1   1\n当 n = 2   2\n当 n = 3   4\n当 n = 4   8\n当 n = n   2^(n-1)\n</code></pre>\n<p>通过找规律的方法解题：</p>\n<pre><code>class Solution:\n    def jumpFloorII(self, number):\n        return pow(2, number -1)\n</code></pre>\n<p>找出通项</p>\n<pre><code>f(n) = f(n-1) + f(n-2) + ..... + f(1)\nf(n-1) = f(n-2) + ..... + f(1)\n# 我们结合上面的式子，移项可得\nf(n) = 2f(n-1)，n &gt; 1\nf(1) = 1\n</code></pre>\n<p>解法</p>\n<pre><code>class Solution:\n    def JumpFloorII(self, n):\n        if n == 1:\n            return 1;\n        ret = 0\n        a = 1\n        for i in range(2, n + 1):\n            ret = 2 * a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().JumpFloorII(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=0, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1),BlogVO(title=默认标题, summary=默认简介, content=<h1>斐波那契数列</h1>\n\n<h2>题目</h2>\n\n<p>大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）。</p>\n\n<p>n&lt;=39</p>\n\n<h2>菲波那切数列是什么</h2>\n\n<pre>\n<code>0 1 1 2 3 5 8 13\n\nn = 0, num = 0\nn = 1, num = 1\nn = 2, num = 1\n.....\n\n当 n = k(n&gt;1),f(k) = f(k-1) + f(k-2)\n当 n = 1, f(1) = 1\n当 n = 0, f(0) = 0\n</code></pre>\n\n<h2>递归方法实现</h2>\n\n<pre>\n<code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n    def Fibonacci(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n        if n &gt; 0:\n            return self.Fibonacci(n - 1) + self.Fibonacci(n -2);\n        else:\n            return None\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci(10))\n</code></pre>\n\n<h3>存在问题</h3>\n\n<p>但是这样存在问题，随着n提升，时间复杂度不断增加</p>\n\n<p><img alt=\"image-20200422211936865\" src=\"http://localhost:8600/blog/admin/png/2020/4/27/1587990240589.png\" /></p>\n\n<p>我们发现对于某个值，我们重复计算了很多遍</p>\n\n<h2>非递归实现</h2>\n\n<p>我们继续查看刚刚的规律</p>\n\n<pre>\n<code>当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n</code></pre>\n\n<p>我们可以从n = 2，一直循环，直到我们计算出我们输入的值为n的时候</p>\n\n<p>我们只需要从最小的开始计算，每次保留中间结果，最后得出我们的第n个的结果。</p>\n\n<pre>\n<code># 大家都知道斐波那契数列，现在要求输入一个整数n，请你输出斐波那契数列的第n项（从0开始，第0项为0）  n&lt;=39\nclass Solution:\n\n    # 非递归实现\n    # 当 n = 2的时候， h = f(1) + f(0) = 1 + 0 = 1\n    # 当 n = 3的时候， h = f(2) + f(1) = 1 + 1 = 2\n    # 当 n = 4的时候， h = f(3) + f(2) = 3 + 1 = 4\n    def Fibonacci2(self, n):\n        if n == 0:\n            return 0;\n        if n == 1:\n            return 1;\n\n        ret = 0\n        a = 1\n        b = 0\n        for i in range(0, n-1):\n            ret = a + b\n            b = a\n            a = ret\n        return ret\n\nif __name__ == \'__main__\':\n    print(Solution().Fibonacci2(10))\n</code></pre>\n, tagUid=5c4c541e600ff422ccb371ee788f59d6, blogSortUid=718c76d4a84e408da23e04949a75e7e8, fileUid=d134bdfe255b9aa8c2ce44da8297f6a6, adminUid=1f01cd1d2f474743b241d74008b12333, isPublish=1, isOriginal=1, author=陌溪, articlesPart=蘑菇博客, level=0, tagList=[Tag(content=测试标签, clickCount=2, sort=12)], photoList=[http://localhost:8600//blog/admin/jpg/2020/2/1/1580528781247.jpg], blogSort=BlogSort(sortName=测试3, content=测试3, clickCount=0, sort=1), praiseCount=null, copyright=null, levelKeyword=null, useSort=0, sort=0, startComment=1)]}','删除选中博客',1,'2020-04-28 09:18:14','2020-04-28 09:18:14','XX|XX|内网IP|内网IP',230),('f35144b26a06e2031eff1a30b51cb7d0','admin','1f01cd1d2f474743b241d74008b12333','192.168.80.1','/picture/setCover','POST','com.moxi.mogublog.admin.restapi.PictureRestApi','setCover','{\"result\":org.springframework.validation.BeanPropertyBindingResult: 0 errors,\"pictureVO\":PictureVO(fileUid=null, fileUids=null, picName=null, pictureSortUid=976dbeb57cb6d5234c1c73e1de8522cf)}','通过图片Uid将图片设为封面',1,'2020-04-07 1